(94, 'https://cdn.tgdd.vn/Products/Images/8790/297341/bhx/canh-ga-nhap-khau-dong-lanh-500g-3-5-canh-202311271117234727.jpg', 'Cánh gà nhập khẩu đông lạnh 500g (3 -5 cánh)', 55500, 0, 55500, 'túi', '500g', 'Cánh gà nhập khẩu tươi ngon, thịt chắc, nhiều dinh dưỡng thường dùng để chiên với nước mắm hoặc hấp hành. Cánh gà nhập khẩu đông lạnh với phương pháp cấp đông hiện đại, giúp lưu giữ hương vị tự nhiên, mang đến những món ăn ngon cho gia đình.', '2023-11-28 12:59:35', NULL, 0, NULL, 3, 1),
(95, 'https://cdn.tgdd.vn/Products/Images/8790/297338/bhx/canh-toi-ga-nhap-khau-dong-lanh-500g-5-8-canh-202311251121084470_300x300.jpg', 'Cánh tỏi gà nhập khẩu 500g', 56000, 0, 56000, 'túi', '500g', 'Cánh tỏi gà nhập khẩu thích hợp để nấu món cánh gà chiên nước mắm, gà rán, cánh gà chiên tiêu,... Cánh tỏi gà nhập khẩu đông lạnh với phương pháp cấp đông hiện đại, giúp lưu giữ hương vị tự nhiên, mang đến những món ăn ngon cho gia đình.', '2023-11-28 12:59:35', NULL, 0, NULL, 3, 1),
(96, 'https://cdn.tgdd.vn/Products/Images/8790/297315/bhx/dui-toi-ga-nhap-khau-dong-lanh-550g-650g-2-4-cai-202311251122222879_300x300.jpg', 'Đùi tỏi gà nhập khẩu 550g - 650g', 49500, 10, 44500, 'túi', '550-650g', 'Đùi tỏi gà nhập khẩu từ Mỹ được đóng gói và bảo quản theo những tiêu chuẩn nghiêm ngặt về vệ sinh và an toàn thực phẩm, đảm bảo về chất lượng. Đùi tỏi gà nhập khẩu đông lạnh với phương pháp cấp đông hiện đại, giúp lưu giữ hương vị tự nhiên, mang đến những món ăn ngon cho gia đình.', '2023-11-28 12:59:35', NULL, 0, NULL, 3, 1),
(97, 'https://cdn.tgdd.vn/Products/Images/8790/313892/bhx/long-ga-cp-250gr-202311030713319435_300x300.jpg', 'Lòng gà 250g', 25900, 21, 20500, 'khay', '250g', 'Lòng gà được sản xuất trên dây chuyền khép kín, an toàn vệ sinh thực phẩm. Lòng gà tươi sạch khay 250g gồm gan, tim, mề là bộ phận ngon và nhiều chất dinh dưỡng của con gà. Sản phẩm có 2 mã QR để khách hàng có thể truy xuất nguồn gốc thịt, vô cùng an tâm', '2023-11-28 12:59:36', NULL, 0, NULL, 3, 1),
(98, 'https://cdn.tgdd.vn/Products/Images/8790/316862/bhx/ga-vuon-dat-do-nguyen-con-09kg-13kg-202310161040283918.jpg', 'Gà vườn đất đỏ nguyên con 0.9kg - 1.3kg', 109000, 40, 65400, 'con', '0.9-1.3kg', '', '2023-11-28 12:59:36', NULL, 0, NULL, 3, 1),
(99, 'https://cdn.tgdd.vn/Products/Images/8790/297314/bhx/ga-dai-han-quoc-nhap-khau-dong-lanh-nguyen-con-12kg-202311271608572349_300x300.jpg', 'Gà dai Hàn Quốc nhập khẩu 1.2kg', 97800, 19, 79000, 'túi', '1.2kg', '', '2023-11-28 12:59:36', NULL, 0, NULL, 3, 1),
(100, 'https://cdn.tgdd.vn/Products/Images/8790/310972/bhx/ga-cung-kim-ke-nguyen-con-12kg-202307271554394037_300x300.jpg', 'Gà cúng kim kê nguyên con 1.2kg', 163000, 9, 147000, 'khay', '1.2kg', 'Gà dai nhập khẩu được đóng gói và bảo quản theo những tiêu chuẩn nghiêm ngặt về vệ sinh và an toàn thực phẩm. Gà dai nguyên con nhập khẩu đông lạnh với chân gà sẫm màu do gà vận động nhiều, vẫn giữ được phần thịt gà dai, thơm, ngọt nên thường dùng để hầm nấu canh, súp hoặc cháo, giúp người dùng bảo quản lâu hơn.', '2023-11-28 12:59:36', NULL, 0, NULL, 3, 1),
(101, 'https://cdn.tgdd.vn/Products/Images/8790/314820/bhx/ga-ac-nguyen-con-135g-202309091638193829_300x300.jpg', 'Gà ác nguyên con 135g', 38000, 5, 36100, 'con', '135g', 'Gà ác nguyên con được làm sạch và đóng gói vệ sinh sạch sẽ, tiện lợi cho người dùng. Khi mua về, bạn chỉ cần làm sạch và mang đi chế biến như gà ác hầm, gà ác nướng,... Đây là thực phẩm chứa nhiều dinh dưỡng.', '2023-11-28 12:59:36', NULL, 0, NULL, 3, 1),
(102, 'https://cdn.tgdd.vn/Products/Images/8790/310968/bhx/chim-cut-395g-3-4-con-202308051602533416_300x300.jpg', 'Chim cút 395g (3-4 con)', 46000, 5, 43700, 'túi', '395g', 'Chim cút túi 395g (3-4 con) tươi mới, đã được làm sạch hết nội tạng, đóng gói tiện lợi sạch sẽ. Chim cút có thể chế biến thành nhiều món ăn ngon, hấp dẫn và dinh dưỡng như chim cút nướng, chim cút hầm,...', '2023-11-28 12:59:36', NULL, 0, NULL, 3, 1),
(103, 'https://cdn.tgdd.vn/Products/Images/8790/314819/bhx/bo-cau-nguyen-con-235g-202309091633043830_300x300.jpg', 'Bồ câu nguyên con 235g', 99000, 10, 89000, 'con', '235g', 'Bồ câu nguyên con được làm sạch sẵn, khi mua về chỉ cần rửa sạch và mang đi chế biến thành nhiều món ăn ngon. Bồ câu là một trong những thực phẩm vô cùng dinh dưỡng, tốt cho sức khỏe,...', '2023-11-28 12:59:36', NULL, 0, NULL, 3, 1),
(104, 'https://cdn.tgdd.vn/Products/Images/8790/297340/bhx/canh-ga-giua-nhap-khau-dong-lanh-500g-12-17-mieng-202311270834148874.jpg', 'Cánh gà giữa nhập khẩu 500g', 74500, 0, 74500, 'túi', '500g', 'Cánh giữa gà nhập khẩu tươi ngon, nhiều thịt, giàu dinh dưỡng thường dùng để chiên với nước mắm hoặc hấp hành. Cánh gà giữa nhập khẩu đông lạnh với phương pháp cấp đông hiện đại, giúp lưu giữ hương vị tự nhiên, mang đến những món ăn ngon cho gia đình.', '2023-11-28 12:59:36', NULL, 0, NULL, 3, 1),
(105, 'https://cdn.tgdd.vn/Products/Images/8790/305671/bhx/canh-ga-giua-nhap-khau-dong-lanh-500g-9-11-mieng-202304050828341487_300x300.jpg', 'Cánh gà giữa nhập khẩu 500g, bột chiên giòn Meizan 150g', 84500, 0, 84500, 'túi', '', 'Cánh gà giữa nhập khẩu 500g & bột chiên giòn Meizan 150g kết hợp tạo nên món cánh gà chiên giòn thơm ngon, giòn rụm hấp dẫn. Cánh giữa gà nhập khẩu tươi ngon, nhiều thịt, giàu dinh dưỡng cùng bột chiên Meizan sử dụng dễ dàng, an toàn cho sức khỏe.\r\n', '2023-11-28 12:59:36', NULL, 0, NULL, 3, 1);
INSERT INTO `product` (`id`, `thumbnail`, `name`, `reg_price`, `discount_percent`, `discount_price`, `unit`, `canonical`, `description`, `created_at`, `updated_at`, `deleted`, `rating`, `category_id`, `brand_id`) VALUES
(106, 'https://cdn.tgdd.vn/Products/Images/12718/308127/bhx/vit-nau-chao-300g-202306131643068316_300x300.jpg', 'Vịt nấu chao 300g', 49000, 5, 46550, 'khay', '300g', 'Vịt nấu chao khay 300g là thực phẩm sơ chế sẵn vô cùng tiện dụng, đến từ thương hiệu uy tín có tiếng. Thịt vịt chất lượng, sốt chao đậm đà bắt vị, cho món ăn ngon nhanh chóng tại nhà, đảm chảo đầy đủ chất dinh dưỡng', '2023-11-28 12:59:36', NULL, 0, NULL, 3, 1),
(107, 'https://cdn.tgdd.vn/Products/Images/12718/310990/bhx/lau-ga-la-giang-khay-500g-202308051600231776_300x300.jpg', 'Lẩu gà lá giang 500g', 93500, 9, 85000, 'khay', '500g', 'Lẩu gà lá giang tươi, chất lượng, bao gồm thịt gà, lá giang, trứng gà non,... có thể dùng để chế biến thành lẩu, canh, súp, kho hoặc các món ăn thơm ngon khác. Lẩu gà sơ chế sẵn tiện lợi, được nhiều chị em nội trợ tin tưởng lựa chọn.', '2023-11-28 12:59:36', NULL, 0, NULL, 3, 1),
(108, 'https://cdn.tgdd.vn/Products/Images/8790/305766/bhx/uc-ga-phi-le-co-da-cp-1kg-2-4-mieng-202308171354378371_300x300.jpg', 'Ức gà phi lê có da C.P 1kg', 98000, 17, 81000, 'túi', '1kg', 'Thịt heo, thịt gà là nguyên liệu quen thuộc trong mỗi bữa ăn của gia đình. Combo Ức Gà Phi Lê Có Da 1KG & xương que heo đông lạnh 500g có thể chế biến đa dạng với nhiều hình thức như chiên, kho, nấu súp,... cung cấp năng lượng và chất dinh dưỡng cho cơ thể. ', '2023-11-28 13:58:24', NULL, 0, NULL, 3, 2),
(109, 'https://cdn.tgdd.vn/Products/Images/8790/239600/bhx/uc-ga-tuoi-phi-le-cp-500g-1-3-mieng-202308171335000630_300x300.jpg', 'Ức gà tươi phi lê C.P 500g', 53000, 0, 53000, 'khay', '500g', '', '2023-11-28 13:58:24', NULL, 0, NULL, 3, 2),
(110, 'https://cdn.tgdd.vn/Products/Images/8790/318596/bhx/uc-ga-tuoi-phi-le-cp-500g-1-3-mieng-202311111017507281.jpg', '2 hộp Ức gà tươi phi lê C.P 500g', 106000, 10, 95500, 'khay', '', 'Ức gà tươi phi lê CP đạt các tiêu chuẩn về an toàn thực phẩm, đảm bảo về chất lượng, độ tươi và ngon. Thịt gà C.P xuất xứ rõ ràng, được dùng nhiều trong chế độ ăn uống khoa học như giảm cân, tăng cơ bắp. Ức gà có 2 mã QR để khách hàng có thể truy xuất nguồn gốc thịt, vô cùng an tâm.', '2023-11-28 13:58:24', NULL, 0, NULL, 3, 2),
(111, 'https://cdn.tgdd.vn/Products/Images/8790/226870/bhx/canh-ga-cp-500g-3-5-canh-202308171327033343_300x300.jpg', 'Cánh gà C.P 500g', 57000, 0, 57000, 'khay', '500g', '', '2023-11-28 13:58:24', NULL, 0, NULL, 3, 2),
(112, 'https://cdn.tgdd.vn/Products/Images/8790/239604/bhx/dui-canh-ga-tuoi-cp-500g-6-8-dui-202308171336283644_300x300.jpg', 'Đùi cánh gà tươi C.P 500g', 47500, 0, 47500, 'khay', '500g', '', '2023-11-28 13:58:24', NULL, 0, NULL, 3, 2),
(113, 'https://cdn.tgdd.vn/Products/Images/8790/226883/bhx/ma-dui-ga-cp-500g-3-5-cai-202308171329289195_300x300.jpg', 'Má đùi gà C.P 500g', 39500, 0, 39500, 'khay', '500g', 'Combo Má Đùi Gà CP 500G & xương que heo đông lạnh 500g là sản phẩm thích hợp cho mọi gia đình. Thịt gà, thịt heo là những nguyên liệu không thể thiếu trong mỗi bữa ăn, có thể chiên, kho, nấu súp,... giúp bữa ăn đa dạng và cung cấp đầy đủ dinh dưỡng cho cơ thể', '2023-11-28 13:58:24', NULL, 0, NULL, 3, 2),
(114, 'https://cdn.tgdd.vn/Products/Images/8790/318598/bhx/dui-toi-ga-cp-500g-4-6-dui-202311111020113445.jpg', '2 hộp Đùi tỏi gà C.P 500g', 116000, 10, 104500, 'khay', '', '2 hộp Đùi tỏi gà CP đạt các tiêu chuẩn về an toàn thực phẩm, đảm bảo về chất lượng, độ tươi và ngon, xuất xứ rõ ràng. Đùi tỏi gà là một một nguyên liệu thích hợp để nấu món gà rán, cơm đùi gà quay tiêu hay gà chiên nước mắm,... Có thể dùng điện thoại quét code QR trên sản phẩm để kiểm tra nguồn góc.', '2023-11-28 13:58:24', NULL, 0, NULL, 3, 2),
(115, 'https://cdn.tgdd.vn/Products/Images/8790/226876/bhx/dui-toi-ga-cp-500g-4-6-dui-202308171328113514_300x300.jpg', 'Đùi tỏi gà C.P 500g', 58000, 0, 58000, 'khay', '500g', 'Combo Đùi Tỏi Gà CP 500G & xương que heo đông lạnh 500g là nguyên liệu cần thiết cho mọi bữa ăn. Thịt gà, thịt heo cung cấp nhiều chất dinh dưỡng cho cơ thể. Có thể chế biến thịt theo nhiều cách như chiên, kho, nấu súp,.. giúp bữa ăn thêm đa dạng.', '2023-11-28 13:58:24', NULL, 0, NULL, 3, 2),
(116, 'https://cdn.tgdd.vn/Products/Images/8790/226948/bhx/dui-ga-goc-tu-cp-500g-1-3-mieng-202308171331086977_300x300.jpg', 'Đùi gà góc tư C.P 500g', 44000, 0, 44000, 'khay', '500g', 'Thịt đùi heo CP đạt các tiêu chuẩn về an toàn toàn thực phẩm, đảm bảo chất lượng, độ tươi ngon. Thịt đùi heo chủ yêu là phần nạc nên rất phù hợp cho người có chế độ ăn kiêng, giảm cân giữ dáng. Thịt heo có thể luộc, xào, chiên hoặc kho tuỳ thích. Quét mã QR trên tem sản phẩm để kiểm tra nguồn gốc', '2023-11-28 13:58:24', NULL, 0, NULL, 3, 2),
(117, 'https://cdn.tgdd.vn/Products/Images/8790/239602/bhx/long-ga-cp-500g-202309231802446414_300x300.jpg', 'Lòng gà C.P 500g', 42500, 0, 42500, 'khay', '500g', 'Lòng gà được sản xuất trên dây chuyền khép kín, an toàn vệ sinh thực phẩm. Lòng gà tươi sạch C.P khay 500g gồm gan, tim, mề là bộ phận ngon và nhiều chất dinh dưỡng của con gà. Sản phẩm có 2 mã QR để khách hàng có thể truy xuất nguồn gốc thịt, vô cùng an tâm', '2023-11-28 13:58:24', NULL, 0, NULL, 3, 2),
(118, 'https://cdn.tgdd.vn/Products/Images/8790/239601/bhx/me-ga-tuoi-cp-500g-202309231759558030_300x300.jpg', 'Mề gà tươi C.P 500g', 50500, 0, 50500, 'khay', '500g', 'Lòng gà được sản xuất trên dây chuyền khép kín, an toàn vệ sinh thực phẩm. Lòng gà tươi sạch C.P khay 500g gồm gan, tim, mề là bộ phận ngon và nhiều chất dinh dưỡng của con gà. Sản phẩm có 2 mã QR để khách hàng có thể truy xuất nguồn gốc thịt, vô cùng an tâm', '2023-11-28 13:58:24', NULL, 0, NULL, 3, 2),
(119, 'https://cdn.tgdd.vn/Products/Images/8790/226950/bhx/chan-ga-cp-500g-10-12-cai-202309231751272260_300x300.jpg', 'Chân gà C.P 500g', 38000, 0, 38000, 'khay', '500g', 'Chân giò heo trước CP đạt các tiêu chuẩn về an toàn toàn thực phẩm. Giò heo (có móng hoặc không) săn chắc, thịt có sự kết hợp với gân mỡ nên ăn béo ngậy và thơm, thích hợp để hầm canh, nấu các món nước,... Có thể dùng điện thoại quét mã QR trên tem sản phẩm để kiểm tra nguồn gốc.', '2023-11-28 13:58:24', NULL, 0, NULL, 3, 2),
(120, 'https://cdn.tgdd.vn/Products/Images/8790/270860/bhx/xuong-ga-cp-1kg-202306131639186508_300x300.jpg', 'Xương gà C.P 1kg', 31000, 13, 27000, 'gói', '1kg', '', '2023-11-28 13:58:24', NULL, 0, NULL, 3, 2),
(121, 'https://cdn.tgdd.vn/Products/Images/8790/286856/bhx/ga-ta-nguyen-con-cp-goi-11kg-15kg-con-202208251429276036_300x300.jpg', 'Gà ta C.P từ 1.3kg/con', 145000, 0, 145000, 'túi 1.3kg', '1.3kg', 'Trứng gà ta Nguyễn Hồ hộp 6 quả có thành phần trứng gà ta 100%, nuôi tại trang trại, đạt những tiêu chuẩn nghiêm ngặt về vệ sinh và an toàn thực phẩm, đảm bảo chất lượng. Trứng tròn, đều và có thể luộc chín ăn trực tiếp hoặc chế biến thành một số món ăn khác như: thịt kho trứng, cơm chiên trứng,...', '2023-11-28 13:58:24', NULL, 0, NULL, 3, 2),
(122, 'https://cdn.tgdd.vn/Products/Images/8790/303471/bhx/vit-nua-con-cp-11kg-14kg-202304060831362436_300x300.jpg', 'Vịt nửa con C.P 1.2kg', 119000, 0, 119000, 'túi 1.2kg', '1.2kg', 'Ức gà tươi phi lê CP đạt các tiêu chuẩn về an toàn thực phẩm, đảm bảo về chất lượng, độ tươi và ngon. Thịt gà C.P xuất xứ rõ ràng, được dùng nhiều trong chế độ ăn uống khoa học như giảm cân, tăng cơ bắp. Ức gà có 2 mã QR để khách hàng có thể truy xuất nguồn gốc thịt, vô cùng an tâm.', '2023-11-28 13:58:24', NULL, 0, NULL, 3, 2),
(123, 'https://cdn.tgdd.vn/Products/Images/8790/305707/bhx/sun-uc-ga-cp-500g-202306161421350110_300x300.jpg', 'Sụn ức gà C.P 500g', 59000, 0, 59000, 'khay', '500g', 'Sụn gà 500g được đóng gói và bảo quản theo những tiêu chuẩn nghiêm ngặt về vệ sinh và an toàn thực phẩm, đảm bảo về chất lượng, độ tươi và ngon của thực phẩm, xuất xứ rõ ràng. Sụn gà ăn có độ sựt, giòn còn thịt bám trên sụn thường dùng để chế biến món sụn gà lăn bột chiên giòn.', '2023-11-28 13:58:24', NULL, 0, NULL, 3, 2),
(124, 'https://cdn.tgdd.vn/Products/Images/8790/239603/bhx/dui-ga-thao-khop-cp-500g-1-3-dui-202308171333518792_300x300.jpg', 'Đùi gà tháo khớp C.P 500g', 44000, 0, 44000, 'khay', '500g', 'Thịt đùi heo CP đạt các tiêu chuẩn về an toàn toàn thực phẩm, đảm bảo chất lượng, độ tươi ngon. Thịt đùi heo chủ yêu là phần nạc nên rất phù hợp cho người có chế độ ăn kiêng, giảm cân giữ dáng. Thịt heo có thể luộc, xào, chiên hoặc kho tuỳ thích. Quét mã QR trên tem sản phẩm để kiểm tra nguồn gốc', '2023-11-28 13:58:24', NULL, 0, NULL, 3, 2),
(125, 'https://cdn.tgdd.vn/Products/Images/12718/315079/bhx/chan-ga-rut-xuong-xot-thai-vi-cay-nhe-250g-202310031426492232_300x300.jpg', 'Chân gà rút xương xốt Thái 250g vị cay nhẹ ', 59000, 19, 48000, 'hộp', '250g', 'Chân gà rút xương xốt Thái vị cay nhẹ hộp 250g là một món ăn vặt thơm ngon, giàu dinh dưỡng. Chân gà đã được rút xương sẵn, tiện lợi, vị cay nhẹ phù hợp với mọi người. Sản phẩm đảm bảo từ khâu sơ chế đến đóng gói, cam kết đến tay khách hàng các sản phẩm chất lượng, thơm ngon nhất.', '2023-11-28 14:06:18', NULL, 0, NULL, 3, 7),
(126, 'https://cdn.tgdd.vn/Products/Images/12718/314979/bhx/chan-ga-rut-xuong-sa-tac-hop-250g-202310031406003198_300x300.jpg', 'Chân gà rút xương sả tắc 250g', 58000, 22, 45000, 'hộp', '250g', 'Chân gà rút xương sả tắc là một món ăn vặt được nhiều người yêu thích. Chân gà được rút xương sẵn, sơ chế sạch sẽ, tẩm ướp đậm đà, chân gà sả tắc chua và cay nhẹ, thích hợp để nhâm nhi cùng gia đình, bạn bè,...', '2023-11-28 14:06:18', NULL, 0, NULL, 3, 7),
(127, 'https://cdn.tgdd.vn/Products/Images/12718/315091/bhx/chan-ga-rut-xuong-xot-thai-vi-cay-nong-300g-202310031420197794_300x300.jpg', 'Chân gà rút xương xốt Thái 300g vị cay nồng', 69000, 18, 56500, 'hộp', '300g', 'Chân gà rút xương xốt Thái vị cay nồng 300g là một món ăn vặt thơm ngon, giàu dinh dưỡng. Chân gà đã được rút xương sẵn, tiện lợi, vị cay nồng phù hợp với người thích ăn cay. Sản phẩm đảm bảo từ khâu sơ chế đến đóng gói, cam kết đến tay khách hàng các sản phẩm chất lượng, thơm ngon nhất.', '2023-11-28 14:06:18', NULL, 0, NULL, 3, 7),
(128, 'https://cdn.tgdd.vn/Products/Images/12718/315094/bhx/chan-ga-rut-xuong-xot-thai-vi-cay-nong-450g-202310031452076543_300x300.jpg', 'Chân gà rút xương xốt Thái 450g vị cay nồng', 85000, 16, 71000, 'hộp', '450g', 'Chân gà rút xương xốt Thái vị cay nồng 450g là một món ăn vặt thơm ngon, giàu dinh dưỡng. Chân gà đã được rút xương sẵn, tiện lợi, vị cay nồng phù hợp với người thích ăn cay. Sản phẩm đảm bảo từ khâu sơ chế đến đóng gói, cam kết đến tay khách hàng các sản phẩm chất lượng, thơm ngon nhất.', '2023-11-28 14:06:18', NULL, 0, NULL, 3, 7),
(129, 'https://cdn.tgdd.vn/Products/Images/12718/315089/bhx/chan-ga-rut-xuong-xot-thai-vi-cay-nong-250g-202310031422596595_300x300.jpg', 'Chân gà rút xương xốt Thái 250g vị cay nồng', 59000, 19, 48000, 'hộp', '250g', 'Chân gà rút xương xốt Thái vị cay nồng 250g là một món ăn vặt thơm ngon, giàu dinh dưỡng. Chân gà đã được rút xương sẵn, tiện lợi, vị cay nồng phù hợp với người thích ăn cay. Sản phẩm đảm bảo từ khâu sơ chế đến đóng gói, cam kết đến tay khách hàng các sản phẩm chất lượng, thơm ngon nhất.', '2023-11-28 14:06:18', NULL, 0, NULL, 3, 7),
(130, 'https://cdn.tgdd.vn/Products/Images/12718/314980/bhx/chan-ga-rut-xuong-sa-tac-hop-300g-202310310919371670_300x300.jpg', 'Chân gà rút xương sả tắc hộp 300g', 65000, 17, 54000, 'hộp', '300g', 'Chân gà sả tắc chua chua, cay cay không chỉ là một món ăn vặt hấp dẫn mọi lứa tuổi mà còn chứa nhiều dinh dưỡng tốt cho sức khỏe: Giúp hỗ trợ chuyển hóa chất béo, giảm cân hiệu quả, hỗ trợ sản sinh tế bào mới,...', '2023-11-28 14:06:18', NULL, 0, NULL, 3, 7),
(131, 'https://cdn.tgdd.vn/Products/Images/8782/302665/bhx/cua-thit-ca-mau-1-con-230g-280g-202304130935250914_300x300.jpg', 'Cua thịt cà mau 220g - 300g', 149000, 20, 119000, 'con', '220gr - 300gr', 'Cua thịt nguyên con, tươi ngon, thịt cua chắc, ngọt thịt. Cua thịt giàu dinh dưỡng, hương vị thơm ngon, hấp dẫn, được nhiều người yêu thích lựa chọn. Cua thịt tại Bách hóa XANH chất lượng, đảm bảo độ tươi, mang đến sự hài lòng của khách hàng.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(132, 'https://cdn.tgdd.vn/Products/Images/8782/315962/bhx/cha-ca-that-lat-tuoi-200g-202311270947230114_300x300.jpg', 'Chả cá thát lát tươi 200g', 62000, 10, 56000, 'gói', '200g', 'Chả cá thát lát 200g là nguyên liệu phổ biến trong bữa ăn của mọi gia đình. Chả cá được chế biến từ cá thát lát tươi, giàu dinh dưỡng. Chả cá có mùi thơm và độ dai tự nhiên từ thịt cá, cung cấp nhiều dưỡng chất như: protein, vitamin, canxi…', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(133, 'https://cdn.tgdd.vn/Products/Images/8782/315961/bhx/cha-tom-200g-202310201713257967_300x300.jpg', 'Chả tôm 200g', 74000, 10, 66900, 'gói', '200g', 'Chả tôm 200g được chế biến từ tôm tươi, giàu dinh dưỡng. Chả tôm có mùi thơm, ngọt tự nhiên từ thịt tôm và cung cấp nhiều chất dinh dưỡng như protein, vitamin, canxi… Thích hợp dùng để chiên, hấp, lẩu, bún, hoặc chế biến các món ăn tùy thích.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(134, 'https://cdn.tgdd.vn/Products/Images/8782/309843/bhx/cua-com-cua-2-da-09kg-11kg-4-6-con-202309071456432878_300x300.jpg', 'Cua cốm (cua 2 da) 1kg (4 - 6 con)', 700000, 5, 665000, 'túi', '1kg', 'Cua cốm hay còn gọi là cua lột hay cua 2 da chắc thịt, có gạch bên trong. Cua thơm ngon, béo, ngọt và chứa nhiều dưỡng chất thiết yếu cho cơ thể. Cua cốm tươi ngon, là sự lựa chọn tuyệt vời dành cho gia đình.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(135, 'https://cdn.tgdd.vn/Products/Images/8782/313772/bhx/hau-sashimi-09kg-11kg-8-12-con-202309071455218732_300x300.jpg', 'Hàu sashimi 0.9kg - 1.1kg (8 - 12 con)', 220000, 0, 220000, 'túi', '0.9-1.1kg', 'Hàu sashimi có vỏ cứng bên ngoài, thịt mềm, ngon, ngọt và chứa nhiều sữa béo ngậy, 0.9kg - 1.1kg có khoảng 8 - 12 con hàu. Hàu là hải sản chứa nhiều chất dinh dưỡng tốt cho cơ thể như chất đạm, chất béo, vitamin A, vitamin D,...', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(136, 'https://cdn.tgdd.vn/Products/Images/8782/313771/bhx/cua-hoang-de-con-17kg-22kg-202309071456257937_300x300.jpg', 'Cua hoàng đế con 2.2kg', 4400000, 0, 4400000, 'con', '2.2kg', 'Cua hoàng đế là loại hải sản cao cấp với phần thịt chắc, dai, thơm thoảng hương biển và đặc biệt giàu giá trị dinh dưỡng. Cua hoàng đế đảm bảo còn tươi sống, mỗi con trọng lượng từ 1.7 - 2.2kg, có thể chế biến bằng cách hấp, luộc, nướng,...', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(137, 'https://cdn.tgdd.vn/Products/Images/8782/319259/bhx/ca-basa-cat-khuc-dong-lanh-450-550g-nuoc-mam-maggi-hao-hang-18-do-dam-chai-490ml-202311210809367911_300x300.jpg', 'Cá basa cắt khúc đông lạnh 450-550g & Nước mắm Maggi chai 490ml', 110500, 27, 81150, 'chai', '', 'Xem thêm', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(138, 'https://cdn.tgdd.vn/Products/Images/8782/249433/bhx/tom-cang-xanh-500g-8-15-con-202311202035354278_300x300.jpg', 'Tôm càng xanh 500g (8 - 15 con)', 150000, 0, 150000, 'túi 500gr', '500g', 'Tôm là nguồn dinh dưỡng dồi dào, cung cấp hàm lượng canxi và sắt rất cao cho chế độ ăn hằng ngày. Khi thưởng thức, bạn sẽ cảm nhận phần thịt ngọt nước và hơi dai. Ngoài ra, tôm càng với kích thước to nên thường được dùng để trang trí các món ăn trong bữa tiệc hoặc bữa cơm gia đình.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(139, 'https://cdn.tgdd.vn/Products/Images/8782/305739/bhx/tep-rong-500g-202311202038262966_300x300.jpg', 'Tép rong 500g', 93000, 5, 88000, 'túi', '500g', 'Tép rong có nguồn gốc ở đồng bằng sông Cửu Long. Tép có kích thước khá nhỏ hơn nhiều so với tôm nên có thể ăn tép rong nguyên con, không cần lột vỏ như các con tôm lớn. Vị của chúng của khá ngọt, thích hợp để chế biến thành nhiều món ăn đơn giản trong các bữa cơm gia đình.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(140, 'https://cdn.tgdd.vn/Products/Images/8782/285416/bhx/tom-su-nguyen-con-500g-10-13-con-202304220918426447_300x300.jpg', 'Tôm sú nguyên con 500g (10 - 13 con)', 163000, 10, 146700, 'khay', '500g', 'Tôm sú là loại thực phẩm quen thuộc, có thể chế biến thành nhiều món ăn ngon như luộc, hấp, nướng, các món lẩu,.... Thịt tôm sú dai dai, có vị ngọt rất hấp dẫn. Tôm sú tại Bách hoá XANH rất tươi ngon và được nhiều bà nội trợ chọn mua.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(141, 'https://cdn.tgdd.vn/Products/Images/8782/281942/bhx/tom-the-nguyen-con-250g-8-12-con-202311202037326222_300x300.jpg', 'Tôm thẻ nguyên con 250g (8 - 12 con)', 50000, 0, 50000, 'túi 250gr', '250g', 'Tôm thẻ khay tại Bách hoá XANH tươi ngon vô cùng, tôm to, thịt ngọt và cầm rất chắc tay, dùng làm nguyên liệu chính cho nhiều món ăn. Tôm thẻ chứa nhiều năng lượng và protein tốt cho cơ thể, từ trẻ em cho đến người già ai cũng có thể ăn tôm thẻ.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(142, 'https://cdn.tgdd.vn/Products/Images/8782/304051/bhx/ca-bong-tuong-lam-sach-500g-550g-3-6-con-202311202032129187_300x300.jpg', 'Cá bống tượng 500g-550g (3-6 con)', 99000, 5, 94000, 'túi', '500-550g', 'Cá bống tượng là loại cá có nhiều nhớt, màu lưng hơi xám, da bóng, rất thích hợp cho các món cá bống tượng kho tiêu, cá bống tượng kho thơm. Thịt cá bống tượng ngọt, ngon, được các bà nội trợ rất yêu thích.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(143, 'https://cdn.tgdd.vn/Products/Images/8782/305885/bhx/ca-chim-nuoc-ngot-lam-sach-450-550g-202311202026022115_300x300.jpg', 'Cá chim nước ngọt làm sạch 450g - 550g', 37000, 0, 37000, 'con', '450-550g', 'Cá chim ở nước ngọt cho thịt ngon, thịt cá dai, có vị ngọt thanh tự nhiên và chứa nhiều dưỡng chất tốt cho sức khỏe. Cá chim được sơ chế, sạch sẽ, an toàn vệ sinh thực phẩm. Chế biến nhiều món ngon như chiên giòn, kho, nướng, hấp nước tương,...', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(144, 'https://cdn.tgdd.vn/Products/Images/8782/307907/bhx/ca-basa-cat-khuc-dong-lanh-450-550g-202311251124491835_300x300.jpg', 'Cá basa cắt khúc đông lạnh 450g - 550g', 36000, 19, 29000, 'túi', '450-550g', 'Cá basa tiêu chuẩn xuất khẩu EU, thịt cá ngọt, bổ dưỡng và ai cũng có thể ăn được. Các món ngon không thể bỏ qua với cá basa như cá basa chiên giòn, cá basa nhúng giấm, ăn cùng với lẩu,... Cá được sơ chế và đóng gói tiện lợi, tiết kiệm thời gian đi chợ.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(145, 'https://cdn.tgdd.vn/Products/Images/8782/305738/bhx/ca-me-dinh-lam-sach-450-550g-2-7-con-202311202028474054_300x300.jpg', 'Cá mè dinh làm sạch 450g - 550g (2-7 con)', 55000, 5, 52000, 'túi', '450-550g', 'Cá mè dinh là loại cá, đa dạng cách chế biến mà cũng rất dồi dào dinh dưỡng cho cơ thể chúng ta. Thịt cá mè dinh là nguồn cung cấp đạm dồi dào nhưng lại ít chất béo, phù hợp cho những ai muốn bổ sung đạm, dinh dưỡng hoặc giữ cân, tăng cơ.\r\n', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(146, 'https://cdn.tgdd.vn/Products/Images/8782/305747/bhx/ca-chach-que-lam-sach-500g-4-9-con-202311202030210990_300x300.jpg', 'Cá chạch quế 500g (4-9 con)', 49000, 5, 46500, 'túi', '500g', 'Cá chạch quế thân tròn, dẹt bên, nhất là gần đuôi, da trơn, mỏng. Cá có màu vàng, nâu hoặc xám đen, màu lưng xẫm hơn bụng. Trên thân có nhiều chấm, mỗi chấm do rất nhiều chấm nhỏ hợp thành. Cá chạch quế nấu món ngon như cá chạch kho tiêu, cá chạch quế chiên giòn,...\r\n', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(147, 'https://cdn.tgdd.vn/Products/Images/8782/300034/bhx/ca-dieu-hong-lam-sach-300g-450g-con-202311202027013131_300x300.jpg', 'Cá diêu hồng làm sạch (300g - 450g /con)', 45000, 5, 42750, 'con', '300-450g', 'Cá diêu hồng loại cá phổ biến có thịt nhiều, ít xương, thịt trắng, ngọt và lành tính, cá diêu hồng chế biến thành rất nhiều món ngon trong bữa cơm gia đình như cá diêu hồng kho, cá diêu hồng nấu canh chua, cá diêu hồng chiên giòn, cá diêu hồng sốt cà chua,...', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(148, 'https://cdn.tgdd.vn/Products/Images/8782/290278/bhx/ca-hu-nguyen-con-lam-sach-12kg-202311202031088945_300x300.jpg', 'Cá hú làm sạch 1.2kg', 135000, 5, 128200, 'con', '1.2kg', 'Với đặc điểm chắc thịt và ít xương, cá hú là một trong những loại cá da trơn được nhiều người yêu thích và lựa chọn. Cá hú tại Bách hoá XANH luôn tươi ngon mỗi ngày, thích hợp chế biến nhiều món ăn ngon cho gia đình, với các món chiên, kho, nấu canh đậm đà.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(149, 'https://cdn.tgdd.vn/Products/Images/8782/300033/bhx/ca-loc-lam-sach-300g-450g-con-202311202026302058_300x300.jpg', 'Cá lóc làm sạch (300g - 450g/con)', 47000, 0, 47000, 'con', '300-450g', 'Cá lóc hay còn được gọi là cá quả, là một nguyên liệu quen thuộc thường xuất hiện trên bàn ăn của mỗi gia đình. Cá lóc có thịt ngọt, rất ngon, thích hợp làm nhiều món ăn hấp dẫn như bánh canh cá lóc, canh chua cá lóc, cá lóc kho tộ,... đảm bảo sẽ khiến cả nhà mê tít', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(150, 'https://cdn.tgdd.vn/Products/Images/8782/223037/bhx/ca-keo-450g-550g-20-23-con-202311202025336101_300x300.jpg', 'Cá kèo 450g - 550g', 155000, 5, 147250, 'túi', '450-550g', 'Từng con cá kèo tươi rói, nhìn ngon mắt vô cùng. Cá kèo đã được làm sạch, chỉ cần mua về rửa sạch lại rồi đem đi chế biến các món ăn ngon như lẩu cá kèo, cá kèo kho tiêu. Cá kèo Bách hoá XANH ít béo, giàu protein, đảm bảo là nguyên liệu tuyệt vời cho bữa cơm của bạn', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(151, 'https://cdn.tgdd.vn/Products/Images/8782/305746/bhx/ca-long-tong-lam-sach-500g-202311202029535464_300x300.jpg', 'Cá lòng tong 500g', 94000, 5, 89300, 'túi', '500g', 'Cá lòng tong là loại cá khá nhỏ, là món ăn quen thuộc trong các gia đình tại miền Tây. Dù được chế biến thành món ăn gì, cá lòng tong vẫn là món ăn hấp dẫn nhờ thịt cá mềm, ăn không thấy ngán. Một số món ăn từ cá lòng tong như kho tiêu, chiên giòn,...', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(152, 'https://cdn.tgdd.vn/Products/Images/8782/304052/bhx/ca-ro-dong-lam-sach-450-550g-2-4-con-202311202032220966_300x300.jpg', 'Cá rô đồng 450g - 550g (2-4 con)', 38000, 5, 36000, 'túi', '450-550g', 'Đảm bảo tươi ngon, thịt ngọt và dai. Cá rô đồng thường dùng để chế biến những món ăn thơm ngon trong các bữa ăn gia đình như cá kho, canh chua,... Cá rô đồng Bách hoá XANH tươi ngon, được các bà nội trợ chọn mua mỗi ngày', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(153, 'https://cdn.tgdd.vn/Products/Images/8782/311245/bhx/ca-basa-phi-le-250g-202311202033557945_300x300.jpg', 'Cá basa phi lê 250g', 27000, 0, 27000, 'túi', '250g', 'Cá basa phi lê được rút hết xương, thịt cá ngọt, bổ dưỡng và ai cũng có thể ăn được. Các món ngon không thể bỏ qua với cá basa phi lê như cá basa chiên giòn, cá basa nhúng giấm, ăn cùng với lẩu,... Cá được sơ chế và đóng gói tiện lợi, tiết kiệm thời gian đi chợ.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(154, 'https://cdn.tgdd.vn/Products/Images/8782/304073/bhx/ca-sac-ran-lam-sach-500g-550g-3-5-con-202311202031377791_300x300.jpg', 'Cá sặc rằn 500g - 550g (3 - 5 con)', 55000, 5, 52000, 'túi', '500-550g', 'Cá sặc rằn là loại cá nước ngọt, thịt ngọt, thân mình dẹt, ít xương. Cá sặc rằn thích hợp cho các món như chiên nước mắm, chiên giòn hoặc các sặc rằn kho. Cá sặc rằn tươi ngon, chất lượng, được nhiều người chọn mua.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(155, 'https://cdn.tgdd.vn/Products/Images/8782/279491/bhx/ca-lang-nguyen-con-lam-sach-1kg-12kg-202309081612513862_300x300.jpg', 'Cá lăng làm sạch 1.2kg', 159000, 9, 144500, 'con', '1.2kg', 'Cá lăng là một trong những loại thực phẩm tốt cho sức khoẻ, có thể chế biến thành nhiều món ngon dân dã. Cá lăng tại Bách hoá XANH luôn được chế biến hằng ngày từ những con cá tươi ngon với giá thành phải chăng, thích hợp với các món ăn ngon và điều kiện gia đình.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(156, 'https://cdn.tgdd.vn/Products/Images/8782/314793/bhx/ca-linh-non-lam-sach-500g-60-70-con-202311202034549269_300x300.jpg', 'Cá linh non làm sạch 500g (60 - 70 con)', 90000, 0, 90000, 'túi', '500g', 'Cá linh non là loại cá linh đầu mùa, thịt cá tươi, ngọt ngon, lành tính và xương mềm. Cá linh là loại cá nước ngọt được đánh bắt tại An Giang, 500g cá từ 60 - 70 con. Cá được làm sạch sẵn, giúp chế biến món ăn nhanh chóng, tiện lợi.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(157, 'https://cdn.tgdd.vn/Products/Images/8782/305737/bhx/ca-he-lam-sach-450-550g-3-7-con-202311202028203908_300x300.jpg', 'Cá he làm sạch 450g - 550g (3 - 7 con)', 59000, 5, 56000, 'túi', '450-550g', 'Cá he là loại cá có màu đỏ hoặc màu vàng nghệ, vẩy trắng có ánh kim, thịt cá mềm mịn. Cá he không chỉ là một món ăn ngon mà còn là một loại thực phẩm đầy dưỡng chất. Thịt cá he chứa rất nhiều chất dinh dưỡng thiết yếu cho cơ thể chúng ta như protein, chất béo, chất sắt,...', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(158, 'https://cdn.tgdd.vn/Products/Images/8782/305741/bhx/ca-bong-duc-lam-sach-500g-202311202014006778_300x300.jpg', 'Cá bống đục làm sạch 500g', 59000, 5, 56000, 'túi', '500g', 'Cá bống đục là loại cá có lớp vảy ánh lên màu bạc, sáng lấp lánh thì cá mới tươi ngon. Cá làm sạch, để ráo rồi chiên với dầu phộng. Khi cá chín, lớp vảy chuyển sang màu vàng rộm, dậy lên hương thơm ngào ngạt. Cá đục chiên có vị giòn, thơm, béo ăn kèm với nước mắm chanh, tỏi, ớt rất “hao” cơm.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(159, 'https://cdn.tgdd.vn/Products/Images/8782/273883/bhx/ca-mo-lam-sach-500g-550g-8-10-con-202311202025084841_300x300.jpg', 'Cá mó 500g-550g', 69000, 5, 65500, 'túi', '500-550g', 'Cá mó có thân màu trắng hồng, có vảy bạc, mình dẹp, có nhiều thịt, ít xương, thơm ngon hơn cá lưỡi trâu nên được các bà nội trợ ưa thích. Cá mó thường được cá bà nội trợ tẩm ướp và chiên. Một số món cá mó chiên như cá mó chiên giòn, cá mó chiên sả ớt,....', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(160, 'https://cdn.tgdd.vn/Products/Images/8782/285420/bhx/ca-ngu-bo-nguyen-con-lam-sach-11kg-202311202015009276_300x300.jpg', 'Cá ngừ bò làm sạch 1.1kg', 138000, 5, 131500, 'con', '1.1kg', 'Cá ngừ bò là loại cá biển có thịt chắc, dai, ngon, chất lượng. Cá ngừ bò được làm sẵn, tiện lợi, giúp khách hàng tiết kiệm thời gian. Cá ngừ bò có thể chế biến thành nhiều món ăn ngon, dinh dưỡng và hấp dẫn\r\n', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(161, 'https://cdn.tgdd.vn/Products/Images/8782/248996/bhx/ca-trac-lam-sach-450-550g-2-5-con-202311202021019399_300x300.jpg', 'Cá trác 450g - 550g', 49000, 5, 46500, 'túi', '450-550g', 'Cá trác có tính lành, thơm ngon nên thích hợp cho gia đình nào đang có mẹ bầu hay người thân cần bổ sung omega 3 & các chất dinh dưỡng cần thiết. Cá trác tươi ngon, giữ được độ săn chắc của cá biển, giúp bảo quản lâu hơn, mang đến vị đậm đà cho món ăn', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(162, 'https://cdn.tgdd.vn/Products/Images/8782/274570/bhx/ca-tai-tuong-nguyen-con-1kg-12kg-1-2-con-202311202030481561_300x300.jpg', 'Cá tai tượng 1kg - 1.2kg (1-2 con)', 124000, 0, 124000, 'con', '1-1.2kg', 'Cá tai tượng là dòng cá nước ngọt, nhiều người còn gọi nó là cá phát tài. Cá tai tượng được chế biến thành rất nhiều món ăn ngon và tốt cho sức khoẻ. Cá tai tượng có thể đem hấp hành ngon ngọt hay đem chiên xù giòn rụm ngon vô cùng.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(163, 'https://cdn.tgdd.vn/Products/Images/8782/303285/bhx/ca-luoi-trau-lam-sach-500g-550g-202311202021236722_300x300.jpg', 'Cá lưỡi trâu 500g-550g (5-7 con)', 69000, 6, 65000, 'túi', '500-550g', 'Cá lưới trâu đảm bảo tươi ngon, đóng gói kín đáo sạch sẽ là loài cá nhỏ và thân dẹt có hình oval, chứ nhiều dinh dưỡng. Có thể chế biến được thành nhiều món ăn ngon cho gia đình như cá chiên xả, cá kho tiêu đường, Cá chiên tươi,…', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(164, 'https://cdn.tgdd.vn/Products/Images/8782/303289/bhx/ca-nau-lam-sach-500g-550g-3-6-con-202311202021434700_300x300.jpg', 'Cá nâu 500g-550g (3 - 6 con)', 105000, 5, 100000, 'túi', '500-550g', 'Cá nâu túi 500g là loại cá thịt săn chắc, thơm ngon, nhiều thịt, ít xương. Cá nâu hay còn gọi là dĩa thái hay cá hói sống được trong cả môi trường nước mặn và lợ. Cá nâu nhiều dinh dưỡng, phù hợp nấu các món kho, nấu canh chua, chiên sả, nướng…', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(165, 'https://cdn.tgdd.vn/Products/Images/8782/285415/bhx/muc-nut-nguyen-con-500g-5-8-con-202311202037589508_300x300.jpg', 'Mực nút nguyên con 500g', 115000, 5, 109250, 'túi 500gr', '500g', 'Mực nút tươi ngon, dai ngọt chất lượng. Các món ăn ngon với đầu mực là xào sa tế, đầu mực xào chua ngọt, có thể ăn kèm lẩu,... Mực nút còn là thực phẩm chứa nhiều dưỡng chất cần thiết cho sức khỏe.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(166, 'https://cdn.tgdd.vn/Products/Images/8782/285413/bhx/muc-nang-nguyen-con-1kg-2-3-con-202311202041164407_300x300.jpg', 'Mực nang nguyên con 1kg', 275000, 0, 275000, 'túi 1kg', '1kg', 'Mực nang có thân to, thớ thịt dày, có vị ngọt và giòn hơn các loại mực khác. Vì thế mực nang là nguyên liệu chế biến nhiều món ăn ngon, một số món đặc biệt trong gia đình là mực xào chua ngọt, mực xào sa tế, mực chiên giòn,.... Mua về chế biến cho cả nhà ăn thử ngay nhé.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(167, 'https://cdn.tgdd.vn/Products/Images/8782/273937/bhx/muc-ong-nguyen-con-500g-10-13-con-202311202036555514_300x300.jpg', 'Mực ống 500g', 120000, 0, 120000, 'khay', '500g', 'Mực ống tại Bách hoá XANH tươi ngon vô cùng, mực ống to, cầm chắc tay, có thể mua về làm nguyên liệu chính cho nhiều món ăn trong mâm cơm gia đình như mực xào cần, mực xào sa tế, lẩu mực và hải sản,... thơm ngon vô cùng, thịt mực tươi nên mang lại vị ngọt thanh cho món ăn của bạn.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(168, 'https://cdn.tgdd.vn/Products/Images/8782/286030/bhx/muc-la-nguyen-con-1kg-2-3-con-202311202039522698_300x300.jpg', 'Mực lá nguyên con 1kg', 429000, 8, 394000, 'túi 1kg', '1kg', 'Mực lá là loại hải sản có vị ngọt, giòn, dễ ăn và dinh dưỡng vô cùng. Mực lá thường được chế biến thành rất nhiều món ăn khác nhau như cháo mực, mực nướng, mực xào sa tế,... Mực lá Bách hoá XANH tươi ngon, hàng nhập mới mỗi ngày', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(169, 'https://cdn.tgdd.vn/Products/Images/8782/304602/bhx/rau-muc-nhap-khau-dong-lanh-450-550g-202311271131390929.jpg', 'Râu mực nhập khẩu đông lạnh 450-550g', 78000, 0, 78000, 'túi', '450-550g', 'Râu mực tươi ngon, có vị dai giòn, sật sật ăn đã miệng vô cùng. Râu mực là hải sản tạo nên nhiều món ăn thơm ngon vô cùng, được các bà nội trợ ưa chuộng và tin dùng, dùng làm nguyên liệu cho bữa ăn của cả nhà', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(170, 'https://cdn.tgdd.vn/Products/Images/8782/273934/bhx/bach-tuoc-450-550g-10-13-con-202311202036252575_300x300.jpg', 'Bạch tuộc 450g - 550g (10-13 con)', 88000, 10, 79000, 'khay', '450-550g', 'Là loại hải sản vô cùng giàu dinh dưỡng. Bạch tuộc Bách hoá XANH giàu vitamin thiết yếu, được các bà nội trợ ưa thích chọn làm nguyên liệu cho các món ăn của gia đình. Bạch tuộc có thể chế biến thành nhiều món ăn khác nhau như bạch tuộc hấp, bạch tuộc xào thập cẩm với vị giòn dai tuyệt vời', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(171, 'https://cdn.tgdd.vn/Products/Images/8782/312721/bhx/bao-ngu-han-quoc-400g-500g-tui-5-con-202309071457580433_300x300.jpg', 'Bào ngư Hàn Quốc 400g-500g (5 con)', 375000, 0, 375000, 'túi', '400-500g', 'Bào ngư là loại hải sản có phần thịt dai giòn, ngọt béo, giàu giá trị dinh dưỡng, được dùng để chế biến các món ăn ngon như súp, cháo,... Bào ngư Hàn Quốc túi 5 con tại Bách hóa XANH là loại bào ngư tươi sống, vỏ xanh, viền chấm đen, bên trong có màu vàng nhạt.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(172, 'https://cdn.tgdd.vn/Products/Images/8782/313735/bhx/ghe-tuoi-10-con-100-130gr-con-202311202040189530_300x300.jpg', 'Ghẹ tươi 10 con (100 - 130g/con)', 590000, 0, 590000, 'túi', '10 con', 'Ghẹ là loài hải sản được nhiều người yêu thích. Ghẹ có thân mỏng và mềm hơn cua, tươi ngon, thịt dai, ngọt và giòn, mỗi con từ 100g - 130g. Ngoài hấp, nướng thì ghẹ thường được các bà nội trợ chọn làm nguyên liệu nấu ăn giúp làm ngọt nước dùng.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(173, 'https://cdn.tgdd.vn/Products/Images/8782/258463/bhx/ngheu-song-1kg-40-50-con-202311202036041182_300x300.jpg', 'Nghêu sống 1kg (40 - 50 con)', 65000, 5, 61500, 'túi 1kg', '1kg', 'Nghêu là một trong những loại hải sản tươi ngon, giàu dinh dưỡng và khi chế biến sẽ cho ra vị ngọt tự nhiên rất đặc trưng. Nghêu sống tại Bách hoá XANH được thu hoạch từ nhiều nguồn cung đảm bảo, an toàn và tươi ngon, mang đến bữa ăn gia đình của các bà nội trợ thêm phần trọn vẹn.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(174, 'https://cdn.tgdd.vn/Products/Images/8782/305370/bhx/so-huyet-500g-60-70-con-202311202039085289_300x300.jpg', 'Sò huyết 500g (60-70 con)', 112000, 4, 106500, 'túi 500gr', '500g', 'Sò huyết là loại hải sản giàu dưỡng chất, thịt sò huyết có vị ngọt, mặn, rất hấp dẫn khi ăn. Sò huyết còn là thực phẩm được sử dụng nhiều trong việc bổ máu, chữa bệnh tăng huyết áp,...', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(175, 'https://cdn.tgdd.vn/Products/Images/8782/311246/bhx/thit-oc-buou-lam-sach-250g-202311202033049978_300x300.jpg', 'Thịt ốc bươu làm sạch 250g', 17000, 5, 16150, 'túi', '250g', 'Thịt ốc bươu làm sạch là một món ngon quen thuộc với người dân Việt Nam. Thịt ốc bươu mát, ngon, khi hấp lên có vị giòn giòn ăn không ngán. Thịt ốc bươu khay được làm sạch sẽ vô cùng, chỉ cần mua về rửa sạch là có thể chế biến tuỳ thích', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(176, 'https://cdn.tgdd.vn/Products/Images/8782/313732/bhx/oc-bulot-09kg-11kg-20-30-con-202311202040451895_300x300.jpg', 'Ốc bulot 0.9kg - 1.1kg (20 - 30 con)', 220000, 0, 220000, 'túi', '0.9-1.1kg', 'Ốc Bulot là loại hải sản giàu dinh dưỡng, chứa nhiều khoáng chất tốt cho xương, da, mắt và hệ thần kinh. Ốc Bulot đảm bảo tươi sống, chắc thịt, 0.9 - 1.1kg ốc có khoảng 20 - 30 con. Có thể chế biến thành nhiều món ăn ngon như: Ốc Bulot xào bơ tỏi, ốc Bulot hấp sả gừng,...', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(177, 'https://cdn.tgdd.vn/Products/Images/8782/309920/bhx/nhong-tam-500g-202311202039311902_300x300.jpg', 'Nhộng tằm 500g', 55000, 9, 50000, 'túi', '500g', 'Nhộng tằm có xuất xứ Thái Bình, là loại thức ăn dân dã, ngày càng phổ biến trong đời sống của người dân. Nhộng tằm béo, thơm ngon và chứa nhiều dưỡng chất dinh dưỡng. Nhộng tằm chưa được làm sạch. Nhộng tằm có thể chế biến nhiều món ăn ngon như nhộng tằm xào bơ tỏi, nhộng tằm xào chua ngọt,...', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(178, 'https://cdn.tgdd.vn/Products/Images/8782/311242/bhx/thit-hen-lam-sach-250g-202311202032297698_300x300.jpg', 'Thịt hến làm sạch 250g', 25000, 0, 25000, 'túi', '250g', 'Hến là thực phẩm dồi dào các chất dinh dưỡng như mangan, phốt pho, canxi,... cực kỳ tốt cho cơ thể. Thịt hến dễ dàng chế biến thành các món ngon gây nghiện như hến xúc bánh đa, canh hến,... thích hợp từ trẻ nhỏ cho tới người lớn tuổi. Thịt hến Bách hoá XANH được làm sạch, tươi ngon mỗi ngày.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(179, 'https://cdn.tgdd.vn/Products/Images/8782/311243/bhx/bao-tu-ca-basa-250g-202311202033289482_300x300.jpg', 'Bao tử cá basa 250g', 28000, 5, 26600, 'túi', '250g', 'Bao tử cá basa chất lượng, tiện lợi, sạch sẽ. Bao tử cá có thể chế biến thành nhiều món ăn ngon, hấp dẫn như bao tử cá basa xào tỏi ớt, bao tử cá basa xào chua ngọt,... rất hấp dẫn và đơn giản', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(180, 'https://cdn.tgdd.vn/Products/Images/8782/303078/bhx/luon-lam-sach-cat-khuc-tu-200g-202311202027386231_300x300.jpg', 'Lươn làm sạch cắt khúc 200g trở lên', 54000, 5, 51300, 'con', '200g trở lên', 'Lươn có phần thịt ngọt và săn chắc, được làm sạch sẵn, vệ sinh. Những món ăn có thể được chế biến từ lươn không chỉ mang đến hương vị thơm ngon mà còn rất giàu dinh dưỡng như cháo, kho, nướng,...', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(181, 'https://cdn.tgdd.vn/Products/Images/8782/297366/bhx/ca-hoi-dong-lanh-cat-khuc-300gr-202311251058288171_300x300.jpg', 'Cá hồi đông lạnh cắt khúc 300g', 99000, 10, 89000, 'túi', '300g', 'Cá hồi cắt khúc đông lạnh vẫn giữ được độ tươi ngon, màu sắc bắt mắt, được sơ chế sạch sẽ an toàn, đặt mua giao hàng trong ngày tại Bách hoá XANH. Cá hồi xuất xứ Chi Lê, Na Uy chứa nhiều chất dinh dưỡng, được nhiều chọn mua cung cấp cho bữa ăn gia đình', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(182, 'https://cdn.tgdd.vn/Products/Images/8782/303110/bhx/ca-hoi-nguyen-con-dong-lanh-47kg-202311251058152883_300x300.jpg', 'Cá hồi nguyên con đông lạnh 4.7kg', 1641000, 0, 1641000, 'con', '4.7kg', 'Cá hồi nguyên con (không có đầu) được sơ chế sạch sẽ an toàn, thịt cá hồi dai ngon, béo, màu sắc bắt mắt. Cá hồi đông lạnh xuất xứ Chi Lê và Na Uy, chứa nhiều chất dinh dưỡng, được nhiều chọn mua cung cấp cho bữa ăn gia đình.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(183, 'https://cdn.tgdd.vn/Products/Images/8782/317020/bhx/dau-ca-hoi-dong-lanh-nhap-khau-450g-550g-1-2-dau-202311251058464365_300x300.jpg', 'Đầu cá hồi đông lạnh nhập khẩu 450g - 550g (1 - 2 đầu)', 36000, 31, 25000, 'túi', '450-550g', 'Đầu cá hồi có xương mềm, béo có thể nấu canh chua, nấu lẩu,... đầu cá mua về có thể dùng muối và chanh để khử mùi tanh. Đầu cá hồi tươi đông lạnh có thể kéo dài thời gian bảo quản, thích hợp cho nhu cầu gia đình trong việc chế biến và mang đến những món ăn bổ dưỡng.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(184, 'https://cdn.tgdd.vn/Products/Images/8782/318603/bhx/dau-ca-hoi-dong-lanh-nhap-khau-450-550g-1-2-dau-202311111024262180.jpg', '3 túi Đầu cá hồi đông lạnh nhập khẩu 450g - 550g (1 - 2 đầu)', 108000, 45, 59000, 'túi', '', 'Đầu cá hồi có xương mềm, béo có thể nấu canh chua, nấu lẩu,... đầu cá mua về có thể dùng muối và chanh để khử mùi tanh. Đầu cá hồi tươi đông lạnh có thể kéo dài thời gian bảo quản, thích hợp cho nhu cầu gia đình trong việc chế biến và mang đến những món ăn bổ dưỡng.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(185, 'https://cdn.tgdd.vn/Products/Images/8782/317172/bhx/2-tui-dau-ca-hoi-dong-lanh-500g-nhap-khau-2-4-dau-202311241330153332.jpg', '2 túi đầu cá hồi đông lạnh nhập khẩu 500g', 72000, 39, 44000, 'túi', '1kg', 'Đầu cá hồi có thịt mềm và giàu dưỡng chất, rất thích hợp để nấu canh chua, lẩu hoặc các món hấp dẫn khác. Trước khi sử dụng, bạn nên rửa đầu cá bằng muối và chanh để loại bỏ mùi tanh. 2 túi đầu cá hồi đông lạnh nhập khẩu 500g mang đến sự tiện lợi, phù hợp cho mỗi lần nấu', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(186, 'https://cdn.tgdd.vn/Products/Images/8782/298813/bhx/ca-cam-nguyen-con-dong-lanh-700g-202311251119237404_300x300.jpg', 'Cá cam đông lạnh 700g', 69000, 0, 69000, 'túi', '700g', 'Là loại cá biển bổ dưỡng, được nhiều người yêu thích, chứa nhiều chất dinh dưỡng tốt cho sức khoẻ như omega-3, protein, vitamin E, A... Cá cam tươi đông lạnh giúp bảo quản lâu hơn mà thịt cá vẫn chắc, không bở mà vẫn giữ nguyên vị đậm đà.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(187, 'https://cdn.tgdd.vn/Products/Images/8782/313391/bhx/ca-cam-nguyen-con-dong-lanh-11kg-1-2-con-202311251120279256_300x300.jpg', 'Cá cam nguyên con đông lạnh 1-1.2kg (1-2con)', 109000, 0, 109000, 'túi', '1.1kg', 'Là loại cá biển bổ dưỡng, được nhiều người yêu thích, chứa nhiều chất dinh dưỡng tốt cho sức khoẻ như omega-3, protein, vitamin E, A... Cá cam tươi đông lạnh giúp bảo quản lâu hơn mà thịt cá vẫn chắc, không bở mà vẫn giữ nguyên vị đậm đà.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(188, 'https://cdn.tgdd.vn/Products/Images/8782/287695/bhx/ca-huong-lam-sach-500g-550g-3-5-con-202311202022071648_300x300.jpg', 'Cá hường làm sạch 500g-550g (3-5 con)', 51000, 5, 48500, 'túi', '500-550g', 'Cá hường hay còn gọi là cá mùi, cá có thịt chắc ngọt, ít xương, cũng là loại cá phổ biến được nhiều bà nội trợ chọn mua. Cá hường giữ được độ tươi ngon từ cá tươi, giúp bảo quản lâu hơn mà thịt cá vẫn chắc, không bở mà vẫn giữ nguyên vị đậm đà.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(189, 'https://cdn.tgdd.vn/Products/Images/8782/304898/bhx/ca-song-dong-lanh-09kg-11kg-202311251124374200_300x300.jpg', 'Cá sòng đông lạnh 0.9kg - 1.1kg (3-6 con)', 59000, 17, 49000, 'túi', '0.9-1.1kg', 'Cá sòng cá loài cá biển phổ biến ở vùng duyên hải Nam Trung Bộ. Thịt cá thơm ngon, thịt ngọt béo và ít tanh, là loài cá chứa nhiều dinh dưỡng như đạm, béo, chất xơ, vitamin, khoáng chất,... Cá sòng đông lạnh túi 1kg tại Bách hóa XANH được làm sạch, đóng gói tiện lợi, dễ bảo quản', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(190, 'https://cdn.tgdd.vn/Products/Images/8782/309729/bhx/ca-song-dong-lanh-500g-202311251124435822_300x300.jpg', 'Cá sòng đông lạnh 500g', 32000, 0, 32000, 'túi', '500g', 'Cá sòng cá loài cá biển phổ biến ở vùng duyên hải Nam Trung Bộ. Thịt cá thơm ngon, thịt ngọt béo và ít tanh, là loài cá chứa nhiều dinh dưỡng như đạm, béo, chất xơ, vitamin, khoáng chất,... Cá sòng đông lạnh túi 500g tại Bách hóa XANH được làm sạch, đóng gói tiện lợi, dễ bảo quản', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(191, 'https://cdn.tgdd.vn/Products/Images/8782/248995/bhx/ca-song-lam-sach-500g-550g-1-2-con-202311202024446420_300x300.jpg', 'Cá sòng 500g-550g (1 - 2 con)', 36000, 5, 34200, 'túi', '500-550g', 'Là loại cá thơm ngon từ thịt tới ruột cá, phần béo ngon nhất là ruột và lườn cá. Cá sòng giữ được độ tươi ngon từ cá biển tươi, giúp bảo quản lâu hơn mà thịt cá vẫn chắc, không bở mà vẫn giữ nguyên vị đậm đà cho việc chế biến món ăn', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(192, 'https://cdn.tgdd.vn/Products/Images/8782/305744/bhx/ca-chem-lam-sach-12kg-202311202029295521_300x300.jpg', 'Cá chẽm làm sạch 1.2kg/con', 141000, 5, 134000, 'con', '1.2kg', 'Cá chẽm là loại cá có thịt ngọt, chắc và chứa nhiều dưỡng chất cần thiết. Trong thịt cá có chứa rất nhiều vitamin A, đây được xem là chất chống oxy hóa tác động lên mắt và các vấn đề thị lực như duy trì thị lực và bảo vệ mắt, giúp mắt sáng khỏe.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(193, 'https://cdn.tgdd.vn/Products/Images/8782/248994/bhx/ca-nuc-lam-sach-500g-550g-5-7-con-202311202022542509_300x300.jpg', 'Cá nục làm sạch 500g-550g', 49000, 5, 46500, 'túi', '500-550g', 'Là loại cá mang đến nhiều dưỡng chất có lợi và công dụng tuyệt vời cho sức khoẻ. Cá nục vẫn giữ được độ tươi ngon từ cá biển tươi, giúp bảo quản lâu hơn mà thịt cá vẫn chắc, không bở mà vẫn giữ nguyên vị đậm đà cho việc chế biến món ăn', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(194, 'https://cdn.tgdd.vn/Products/Images/8782/282851/bhx/ca-nuc-bong-hap-300g-1-3-con-202308172041464152_300x300.jpg', 'Cá nục bông hấp 300g (1 - 3 con)', 42000, 0, 42000, 'vỉ', '300g', 'Cá nục bông hấp là món ăn được chế biến hoàn toàn từ những con cá nục tươi ngon, qua quá trình hấp chín, đảm bảo chất lượng sản phẩm. Cá nục bông hấp tại Bách hoá XANH hoàn toàn an toàn cho sức khoẻ, giúp các bà nội trợ có thể chế biến nhanh chóng thành các món ăn khác.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(195, 'https://cdn.tgdd.vn/Products/Images/8782/301614/bhx/ca-nuc-dong-lanh-450-550g-4-7-con-202311251123595638_300x300.jpg', 'Cá nục đông lạnh 450g - 550g (4-7 con)', 39000, 10, 35000, 'túi', '450-550g', 'Là loại cá mang đến nhiều dưỡng chất có lợi và công dụng tuyệt vời cho sức khoẻ. Cá nục đông lạnh vẫn giữ được độ tươi ngon từ cá biển tươi, giúp bảo quản lâu hơn mà thịt cá vẫn chắc, không bở mà vẫn giữ nguyên vị đậm đà cho việc chế biến món ăn', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(196, 'https://cdn.tgdd.vn/Products/Images/8782/274403/bhx/ca-thu-cat-khuc-270-330g-giao-khuc-giua-202309081611542757_300x300.jpg', 'Cá thu cắt khúc 270g - 330g (giao khúc giữa)', 135000, 5, 128000, 'vỉ 300gr', '270-330g', 'Là một loại cá biển thơm ngon với thịt thơm và đầy bổ dưỡng. Cá thu giàu chất béo, chất đạm, giàu vitamin và khoáng chất cần thiết cho cơ thể. Cá thu được dùng nấu nhiều món ăn ngon như cá thu kho thơm, cá thu kho tiêu, cá thu kho nước dừa hấp dẫn. Cá thu Bách hoá XANH tươi ngon, nhập mới mỗi ngày.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(197, 'https://cdn.tgdd.vn/Products/Images/8782/302538/bhx/ca-ngan-lam-sach-500g-550g-202311202024233596_300x300.jpg', 'Cá ngân làm sạch 500g-550g (4-6 con)', 69000, 5, 65500, 'túi', '500-550g', 'Cá ngân có thịt mềm, ăn ngọt và dễ chế biến thành nhiều món ăn ngon khác nhau đặc biệt là phù hợp với bữa cơm gia đình như chiên, ấu canh, kho tiêu, sốt cà,.. Cá ngân được làm sẵn, an toàn vệ sinh thực phẩm, đóng gói sạch sẽ', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(198, 'https://cdn.tgdd.vn/Products/Images/8782/291428/bhx/ca-chim-trang-bien-nguyen-con-lam-sach-600g-202311202015217473_300x300.jpg', 'Cá chim trắng biển làm sạch 600g', 169000, 5, 161000, 'con', '600g', 'Thịt cá chim trắng biển dai ngon, hàng tươi ngon, được làm sẵn là nguyên liệu thích hợp cho bữa ăn trong gia đình với các món ăn như: cá chim chiên, cá chim nướng,... Cá chim trắng Bách hoá XANH tươi ngon, hàng mới về mỗi ngày', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(199, 'https://cdn.tgdd.vn/Products/Images/8782/286029/bhx/ca-bop-cat-khuc-450-550g-4-5-mieng-202309081610487499_300x300.jpg', 'Cá bớp làm sạch 450g - 550g', 263000, 4, 250000, 'túi', '450-550g', 'Là món cá không thể thiếu trong bữa ăn, dễ dàng chế biến các món ăn bổ dưỡng cho các thành viên gia đình như canh chua cá bớp, cá bớp nấu măng,... Cá bớp đông lạnh vẫn giữ được độ săn chắc của cá biển, giúp bảo quản lâu hơn, mang đến vị đậm đà cho món ăn.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(200, 'https://cdn.tgdd.vn/Products/Images/8782/248988/bhx/ca-bac-ma-lam-sach-500g-550g-3-5-con-202311202022329036_300x300.jpg', 'Cá bạc má 500g-550g', 51000, 5, 48500, 'túi', '500-550g', 'Cá bạc má có thịt trắng và chắc ngọt, dễ chế biến thành nhiều món ăn ngon, đây là một trong những loại cá biển quen thuộc với bà nội trợ. Cá bạc má vẫn giữ được độ tươi ngon từ cá tươi, giúp bảo quản lâu hơn mà thịt cá vẫn chắc, không bở mà vẫn giữ nguyên vị đậm đà.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(201, 'https://cdn.tgdd.vn/Products/Images/8782/313773/bhx/ca-bop-2kg-25kg-202309081611134522_300x300.jpg', 'Cá bớp 2.3kg', 485000, 0, 485000, 'túi', '2.3kg', 'Cá bớp hay cá bóp là loại cá biển có kích thước lớn, thịt béo ngọt và thường được dùng để chế biến thành nhiều món ăn ngon như: món chiên, món lẩu, món canh,.... Mỗi túi 2.3kg sẽ có khoảng 2 - 3 con cá bớp nguyên con.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(202, 'https://cdn.tgdd.vn/Products/Images/8782/279685/bhx/ca-ngu-o-nuong-300g-202305150814239386_300x300.jpg', 'Cá ngừ ồ nướng 300g', 55000, 0, 55000, 'vỉ', '300g', 'Cá ngừ ồ hay còn được gọi là cá ồ, là loại cá nước mặn, có lớp da ngoài trơn, màu đen và trắng bạc. Thịt cá được nướng chín tới bên trong nhiều, thơm ngon, chứa ít chất béo và calo nhưng rất giàu protein, tốt cho sức khỏe. Cá ngừ nướng có hương thơm đặc trưng, ăn thịt tươi và thấm vị', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(203, 'https://cdn.tgdd.vn/Products/Images/8782/279674/bhx/ca-ngu-nuong-300g-202305050818274118_300x300.jpg', 'Cá ngừ nướng 300g', 60000, 0, 60000, 'vỉ', '300g', 'Cá ngừ có phần nạc nhiều, ít béo, giàu chất dinh dưỡng và các muối khoáng cần thiết cho sức khỏe nên được nhiều người lựa chọn. Cá ngừ nướng vỉ làm sẵn tiện lợi, dễ sử dụng, hương vị thơm ngon, phù hợp cho cả gia đình', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 1),
(204, 'https://cdn.tgdd.vn/Products/Images/8782/222832/bhx/sua-cat-soi-350g-202306211700260740_300x300.jpg', 'Sứa cắt sợi Nhất Tâm 350g', 32000, 0, 32000, 'gói', '350g', 'Hải sản đông lạnh Nhất Tâm là hãng hải sản đông lạnh với chất lượng tuyệt vời, đa dạng các loại thịt cũng như hải sản tươi ngon. Sứa cắt sợi Nhất Tâm gói 350g với thịt sứa tự nhiên, thơm ngon khó cưỡng, được rất nhiều khách hàng tin dùng và lựa chọn, chế biến nhiều món ăn thơm ngon.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 9),
(205, 'https://cdn.tgdd.vn/Products/Images/8782/232388/bhx/cua-dong-xay-san-goi-250g-202207200838252927_300x300.jpg', 'Cua đồng xay sẵn 250g', 27000, 0, 27000, 'gói', '250g', 'Cua đồng rất giàu dinh dưỡng vì thế được các bà nội trợ chọn mua cho bữa cơm gia đình, nhất là vào thời tiết nắng nóng. Cua đồng xay có thể nấu canh, bún riêu cua, lẩu riêu cua,... các món ăn với cua đồng đều rất thanh mát, khiến ai cũng thích ăn.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 9),
(206, 'https://cdn.tgdd.vn/Products/Images/8782/285036/bhx/cha-ca-basa-tuoi-goi-200gr-202208120810143799_300x300.jpg', 'Chả cá basa tươi 200g', 20000, 0, 20000, 'gói', '200g', 'Chả cá basa tươi gói 200g với phần thịt cá dai ngon vô cùng, đảm bảo không chứa hàn the hay các chất khác, mang tới hương vị tươi ngon, ngọt thịt tới cho món chả cá nạo. Có thể dùng làm nhiều món ngon như khổ qua nhồi chả cá, chả cá sốt cà,...', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 9),
(207, 'https://cdn.tgdd.vn/Products/Images/7170/301999/bhx/cha-basa-chien-nhat-tam-goi-200g-202301141519234536_300x300.jpg', 'Chả basa chiên nhất tâm 200g', 26000, 0, 26000, 'gói', '200g', 'Chả basa chiên Nhất Tâm gói 200g dinh dưỡng, chất lượng thơm ngon. Chả cá basa có thể chế biến thành nhiều món ăn ngon, hợp khẩu vị. Chả cá Nhất Tâm là thương hiệu uy tín, sạch sẽ, được nhiều người lựa chọn.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 9),
(208, 'https://cdn.tgdd.vn/Products/Images/7170/299844/bhx/cha-basa-vien-tom-nhat-tam-goi-200g-202301111043466773_300x300.jpg', 'Chả basa viên tôm Nhất Tâm 200g', 25000, 0, 25000, 'gói', '200g', 'Cá viên có thể dùng chiên, sốt cà chua hay ăn lẩu, nấu bún đều rất dễ dàng và cho hương vị thơm ngon từ cá viên Nhất Tâm. Chả basa viên tôm Nhất Tâm gói 200g được làm từ cá basa tươi ngon và cùng tôm cho vị ngon thơm bùi khó cưỡng, bắt vị chứa nhiều chất dinh dưỡng.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 9),
(209, 'https://cdn.tgdd.vn/Products/Images/8782/316462/bhx/ruoc-kho-200g-202310041053061462_300x300.jpg', 'Ruốc khô 200g', 46000, 0, 46000, 'gói', '200g', 'Ruốc khô thương hiệu Song Phương được đóng gói trong túi kín, đảm bảo vệ sinh an toàn thực phẩm. Sản phẩm có thể dùng nấu canh, xào với rau cải ngọt, củ sắn rất ngon hoặc chế biến đơn giản như trứng chiên ruốc khô, ruốc trộn gỏi các loại, gỏi xoài, gỏi cóc, gỏi sen,...', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 8);
INSERT INTO `product` (`id`, `thumbnail`, `name`, `reg_price`, `discount_percent`, `discount_price`, `unit`, `canonical`, `description`, `created_at`, `updated_at`, `deleted`, `rating`, `category_id`, `brand_id`) VALUES
(210, 'https://cdn.tgdd.vn/Products/Images/8782/316450/bhx/kho-ca-du-xe-tam-200g-202310041035252496_300x300.jpg', 'Khô cá đù xẻ tẩm 200g', 71000, 0, 71000, 'gói', '200g', 'Khô cá đù xẻ tẩm 200g cay cay, thơm, thịt cá dai ngon, chất lượng, không sợ cá bị tanh. Khô cá được đóng gói trong khay hút chân không giúp bảo quản cá tiện lợi hơn.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 8),
(211, 'https://cdn.tgdd.vn/Products/Images/8782/316479/bhx/muc-mot-nang-200g-202310041103586760_300x300.jpg', 'Mực một nắng 500g', 318000, 0, 318000, 'gói', '500g', 'Mực to, dày thịt, ngọt phù hợp để nướng hoặc chiên đều ngon. Mực một nắng thương hiệu Song Phương được phơi một nắng và đóng gói tiện lợi dễ dàng bảo quản', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 8),
(212, 'https://cdn.tgdd.vn/Products/Images/8782/291536/bhx/kho-ca-du-sua-tam-ot-200g-30-36-con-202308171610087247_300x300.jpg', 'Khô cá đù sữa tẩm ớt 200g', 50000, 0, 50000, 'vỉ', '200g', 'Khô cá đù sữa tẩm ớt khay 200g cay cay, thơm ,thịt cá dai ngon, chất lượng, không sợ cá bị tanh. Khô cá được đóng gói trong khay hút chân không giúp bảo quản cá tiện lợi hơn. Khô cá đù Song Phương có thể chế biến thành nhiều món ăn ngon hấp dẫn.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 8),
(213, 'https://cdn.tgdd.vn/Products/Images/8782/291597/bhx/kho-ca-chi-vang-tam-gia-vi-200g-36-40-con-202308171555287742_300x300.jpg', 'Khô cá chỉ vàng tẩm 200g', 53000, 0, 53000, 'vỉ', '200g', 'Khô cá chỉ vàng tẩm gia vị khay 200g được tẩm ướp gia vị thơm ngon, hấp dẫn, cá có thịt dai, ngon và ngọt thịt. Khô cá chỉ được đóng khay tiện lợi, bảo quản tốt hơn. Khô cá chỉ vàng Song Phương có thể chế biến thành nhiều món ăn ngon.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 8),
(214, 'https://cdn.tgdd.vn/Products/Images/8782/291588/bhx/kho-ca-chi-vang-200g-36-40-con-202308171602203070_300x300.jpg', 'Khô cá chỉ vàng 200g', 53000, 0, 53000, 'vỉ', '200g', 'Khô cá chỉ vàng khay 200g có thịt dai ngon, vị ngọt, thịt thơm được rất nhiều người yêu thích. Khô cá chỉ vàng được đóng khay tiện lợi, hút chân không đảm bảo vệ sinh an toàn. Khô cá chỉ vàng Song Phương chế biến được rất nhiều món ăn ngon và là mồi nhậu bén.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 8),
(215, 'https://cdn.tgdd.vn/Products/Images/8782/291598/bhx/kho-ca-tra-250g-1-2-con-202308171612292232_300x300.jpg', 'Khô cá tra 250g', 79000, 0, 79000, 'vỉ', '250g', 'Khô cá tra khay 250g có thịt dai, ngọt, chất lượng. Khô cá tra được đóng khay, hút chân không tiện lợi, bảo quản tốt hơn. Khô cá tra Song Phương có thể chế biến thành nhiều món ăn ngon, hấp dẫn.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 8),
(216, 'https://cdn.tgdd.vn/Products/Images/8782/309193/bhx/kho-ca-sac-250gr-3-5-con-202306161047202072_300x300.jpg', 'Khô cá sặc 250g', 75000, 0, 75000, 'gói', '250g', 'Khô cá sặc tươi ngon, chất lượng được ướp muối đậm đà. Khô cá sặc có thể chiên giòn chấm mắm me, nướng, hoặc chế biến nhiều món ăn ngon. Khô cá được đóng gói cẩn thận, sạch sẽ và tiện lợi.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 8),
(217, 'https://cdn.tgdd.vn/Products/Images/8782/309192/bhx/kho-ca-loc-250g-1-2-con-202306161039109971_300x300.jpg', 'Khô cá lóc 250g', 86500, 0, 86500, 'gói', '250g', 'Khô cá lóc tươi ngon, chất lượng, có thể chế biến nhiều món ăn ngon như khô cá lóc chiên, khô cá lóc nướng,... Khô cá được đóng gói cẩn thận, vệ sinh, được nhiều người chọn lựa cho gia đình.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 8),
(218, 'https://cdn.tgdd.vn/Products/Images/8782/285044/bhx/tom-kho-song-phuong-goi-100g-202210121558088432_300x300.png', 'Tôm khô Song Phương 100g', 106000, 0, 106000, 'vỉ', '100g', 'Hải sản đông lạnh Song Phương là thương hiệu hải sản đông lạnh khá có tiếng tại Việt Nam với nhiều sản phẩm chất lượng. Tôm khô Song Phương gói 100g đóng gói vệ sinh, tôm ngon ngọt, kết hợp được với rất nhiều món ăn thơm ngon khó cưỡng như: canh, làm mồi nhậu, món nước lèo,...', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 8),
(219, 'https://cdn.tgdd.vn/Products/Images/8782/316474/bhx/kho-muc-200g-202310121128053212_300x300.jpg', 'Khô mực 200g', 239000, 0, 239000, 'gói', '200g', 'Mực khô có vị ngọt, dẻo, vừa dai và giòn, là món ngon không thể bỏ qua cho các buổi sum họp gia đình. Khô mực nướng, khô mực xào bơ tỏi, khô mực chiên giòn,... là những món ăn vặt mà bạn không thể bỏ qua.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 8),
(220, 'https://cdn.tgdd.vn/Products/Images/8782/316453/bhx/kho-ca-com-200g-202310041040249058_300x300.jpg', 'Khô cá cơm 200g', 63000, 0, 63000, 'gói', '200g', 'Khô cá cơm thơm ngon, béo ngậy lại còn dai dai, được đóng gói tiện lợi, sạch sẽ. Khô cá cơm được chế biến sẵn giúp không bị tanh, giúp bạn chế biến những món ăn hấp dẫn thơm ngon', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 8),
(221, 'https://cdn.tgdd.vn/Products/Images/8782/309198/bhx/ca-phen-mot-nang-250g-6-8-con-202306161048540072_300x300.jpg', 'Cá phèn một nắng 250g', 49000, 0, 49000, 'gói', '250g', 'Cá phèn một nắng tươi ngon, chất lượng, được đóng gói cẩn thận, hợp vệ sinh. Cá phèn nhiều thịt, dai ngon, được rất nhiều người yêu thích chọn lựa. Cá phèn một nắng có thể nướng hoặc chiên tùy thích.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 8),
(222, 'https://cdn.tgdd.vn/Products/Images/8782/309196/bhx/kho-ca-tra-soi-250g-2-3-soi-202306161052573334_300x300.jpg', 'Khô cá tra sợi 250g', 55500, 0, 55500, 'gói', '250g', 'Khô cá tra là một trong những loại cá khô được rất nhiều người yêu thích. Khô cá tra tươi ngon, vị đậm đà, cắt thành miếng, có thể chế biến nhiều món ăn ngon như chiên, nướng,...Khô cá được đóng gói cẩn thận, vệ sinh.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 8),
(223, 'https://cdn.tgdd.vn/Products/Images/8782/309195/bhx/kho-ca-dua-250g-202306161043478228_300x300.jpg', 'Khô cá dứa 250g', 155000, 0, 155000, 'gói', '250g', 'Khô cá dứa tươi ngon, chất lượng, đậm đà, được đóng gói hút chân không cẩn thận, vệ sinh, được nhiều người yêu thích lựa chọn chế biến các món ngon như khô cá dứa nướng hoặc khô cá dứa chiên giòn rất hấp dẫn.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 8),
(224, 'https://cdn.tgdd.vn/Products/Images/8782/309199/bhx/ca-thu-mot-nang-500g-202306161051059028_300x300.jpg', 'Cá thu một nắng 500g', 143000, 0, 143000, 'gói', '500g', 'Cá thu một nắng thịt nhiều, chắc ăn dai ngon vô cùng. Cá thu đậm đà, được đóng gói cẩn thận, vệ sinh, chất lượng. Cá thu một nắng có thể chế biến thành nhiều món ăn ngon như nướng, chiên,... rất hấp dẫn.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 8),
(225, 'https://cdn.tgdd.vn/Products/Images/8782/309197/bhx/kho-ca-moi-200g-3-5-con-202310061510574487_300x300.jpg', 'Khô cá mối 200g', 49000, 0, 49000, 'gói', '200g', 'Khô cá mối tươi ngon, chất lượng, nhiều thịt, được rất nhiều người yêu thích chọn mua. Khô cá mối được đóng gói cẩn thận, vệ sinh. Khô cá mối có thể chiên hoặc nướng, chấm mắm me ăn rất ngon.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 8),
(226, 'https://cdn.tgdd.vn/Products/Images/8782/309190/bhx/kho-ca-dieu-hong-200g-1-2-con-202310061407038273_300x300.jpg', 'Khô cá diêu hồng Song Phương 200g', 56000, 0, 56000, 'gói', '200g', 'Khô cá diêu hồng được làm sạch xương, tẩm gia vị đậm đà, tươi ngon. Khô cá có thể chiên hoặc nước chấm mắm me ăn rất ngon hoặc có thể chế biến thành các món ăn yêu thích. Khô cá diêu hồng được nhiều người yêu thích chọn mua cho gia đình, tiện lợi.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 8),
(227, 'https://cdn.tgdd.vn/Products/Images/8782/309191/bhx/kho-ca-dong-200gr-6-10-con-202310061404011884_300x300.jpg', 'Khô cá đổng 200g', 45000, 0, 45000, 'gói', '200g', 'Khô cá đổng tươi ngon, chất lượng, ướp muối sẵn, có thể chế biến thành nhiều món ăn ngon như khô cá đổng nước, khô cá đổng chiên chấm mắm me,... Khô cá đổng được đóng gói sạch sẽ, vệ sinh, được nhiều người chọn mua.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 8),
(228, 'https://cdn.tgdd.vn/Products/Images/8782/291529/bhx/ca-dong-1-nang-250g-4-7-con-202308171538334913_300x300.jpg', 'Cá đổng một nắng 250g', 61000, 0, 61000, 'vỉ', '250g', 'Cá đổng 1 nắng khay 250g thịt dai ngon, chất lượng, ngọt được rất nhiều người yêu thích. Cá đổng một nắng được làm sạch và đóng gói hút chân không đảm bảo chất lượng sản phẩm. Cá đổng Song Phương có thể chế biến thành nhiều món ăn ngon hấp dẫn.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 8),
(229, 'https://cdn.tgdd.vn/Products/Images/8782/291527/bhx/ca-bac-ma-1-nang-250g-4-7-con-202308171536568087_300x300.jpg', 'Cá bạc má một nắng 250g', 45000, 0, 45000, 'vỉ', '250g', 'Cá bạc má 1 nắng khay 250g là loại có có độ dinh dưỡng cao, thịt dai, ngon và ngọt. Cá bạc má một nắng được sơ chế và đóng gói cẩn thận, đảm bảo vệ sinh và chất lượng sản phẩm. Cá Song Phương có thể chế biến được nhiều món ăn ngon như rim, chiên,...', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 8),
(230, 'https://cdn.tgdd.vn/Products/Images/8782/291517/bhx/ca-luoi-trau-1-nang-250g-8-10-con-202308171544540247_300x300.jpg', 'Cá lưỡi trâu một nắng 250g', 49000, 0, 49000, 'vỉ', '250g', 'Cá lưỡi trâu 1 nắng khay 250g tươi ngon, chất lượng và dinh dưỡng. Cá lưỡi trâu một nắng tiện lợi. Cá một nắng Song Phương có thể chế biến thành nhiều món ăn ngon như món như rim, chiên giòn,.. vừa ngon dinh dưỡng và đảm bảo chất lượng', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 8),
(231, 'https://cdn.tgdd.vn/Products/Images/8782/291534/bhx/ca-duc-1-nang-250g-15-20-con-202308171542271216_300x300.jpg', 'Cá đục một nắng 250g', 65000, 0, 65000, 'vỉ', '250g', 'Cá đục 1 nắng khay 250g là loại cá một nắng được rất nhiều người yêu thích và lựa chọn. Cá đục chứa nhiều dưỡng chất, hương vị thơm ngon. Cá đục Song Phương một nắng được đóng khay hút chân không bảo quản cá tốt nhất.', '2023-11-29 21:33:09', NULL, 0, NULL, 5, 8),
