(258, 'https://cdn.tgdd.vn/Products/Images/8782/315961/bhx/cha-tom-200g-202310201713257967_300x300.jpg', 'Chả tôm 200g', 74000, 10, 66900, 'gói', '200g', 'Chả tôm 200g được chế biến từ tôm tươi, giàu dinh dưỡng. Chả tôm có mùi thơm, ngọt tự nhiên từ thịt tôm và cung cấp nhiều chất dinh dưỡng như protein, vitamin, canxi… Thích hợp dùng để chiên, hấp, lẩu, bún, hoặc chế biến các món ăn tùy thích.', '2023-11-29 21:33:09', NULL, 0, NULL, 4, 1),
