(262, 'https://cdn.tgdd.vn/Products/Images/8783/319271/bhx/trung-vit-bac-thao-vuong-ngoc-bich-hop-4-qua-202311232051365775_300x300.jpg', 'Trứng vịt bắc thảo Vương Ngọc Bích hộp 4 quả', 26000, 0, 26000, 'hộp', '', 'Trứng vịt bắc thảo Vương Ngọc Bích hộp 4 quả là một loại trứng đặc biệt được tạo ra bằng cách ướp trứng vịt trong bùn đất, tro cốt và các loại thảo dược trong một thời gian dài. Đây là một món ăn truyền thống và có giá trị dinh dưỡng đáng kể. Chúng giàu protein, chất béo, vitamin A, B12, sắt, canxi và phốt pho.\r\n\r\n', '2023-11-29 21:33:09', NULL, 0, NULL, 6, 11),
