(265, 'https://cdn.tgdd.vn/Products/Images/8783/293917/bhx/trung-ga-happy-egg-hop-10-qua-202311232041242356_300x300.jpg', 'Trứng gà Happy Egg hộp 10 quả', 32000, 20, 25500, 'hộp', '', 'Hộp 10 trứng gà Happy Egg được đóng gói và bảo quản theo những tiêu chuẩn nghiêm ngặt về vệ sinh và an toàn thực phẩm, đảm bảo về chất lượng của thực phẩm. Trứng gà to tròn, đều. Trứng gà Happy Egg có thể luộc chín chế biến thành một số món ăn khác như: thịt kho trứng, cơm chiên trứng,...', '2023-11-29 21:33:09', NULL, 0, NULL, 6, 12),
(266, 'https://cdn.tgdd.vn/Products/Images/8783/305027/bhx/trung-ga-so-happy-egg-hop-10-tang-2-202311232047001748_300x300.jpg', 'Trứng gà so Happy Egg hộp 10 tặng 2', 28000, 0, 28000, 'hộp', '', 'Trứng gà so tươi ngon, chất lượng, chứa nhiều dưỡng chất cần thiết cho cơ thể. Trứng gà so Happy Egg có kích thước dưới 46g/ quả. Trứng gà có thể chế biến thành nhiều món ăn ngon như trứng gà luộc lòng đào, trứng gà ngâm tương, trứng chiên,...', '2023-11-29 21:33:09', NULL, 0, NULL, 6, 12),
(267, 'https://cdn.tgdd.vn/Products/Images/8783/299272/bhx/trung-ga-happy-egg-hop-30-qua-202311271150441365.jpg', 'Trứng gà Happy Egg hộp 30 quả', 99000, 0, 99000, 'hộp', '', 'Hộp 30 trứng gà Happy Egg là một trong những thực phẩm dinh dưỡng quen thuộc, được sử dụng nhiều trong đời sống hằng ngày, dễ chế biến, chứa nhiều dưỡng chất. Trứng gà Happy Egg là thương hiệu trứng quen thuộc, uy tín và chất lượng', '2023-11-29 21:33:09', NULL, 0, NULL, 6, 12),
(268, 'https://cdn.tgdd.vn/Products/Images/8783/302932/bhx/trung-ga-song-hy-happy-egg-hop-4-qua-202311241115469817_300x300.jpg', 'Trứng gà song hỷ Happy Egg hộp 4', 23000, 0, 23000, 'hộp', '', 'Trứng gà song hỷ là loại trứng gà có 2 lòng đào, được rất nhiều người yêu thích và lựa chọn. Trứng gà Happy Egg là thương hiệu uy tín, được nhiều người sử dụng, dùng để chế biến chín trước khi ăn.', '2023-11-29 21:33:09', NULL, 0, NULL, 6, 12),
(269, 'https://cdn.tgdd.vn/Products/Images/8783/313704/bhx/trung-cut-phuong-nam-hop-30-qua-202311232047280698_300x300.jpg', 'Trứng cút Phương Nam hộp 30', 26000, 0, 26000, 'hộp', '', 'Trứng cút Phương Nam được đóng hộp 30 trứng đảm bảo tươi mới, trứng cút tròn, đều nhau. Trứng được thu hoạch, đóng gói và bảo quản theo những tiêu chuẩn nghiêm ngặt, đảm bảo vệ sinh và an toàn thực phẩm.\r\n', '2023-11-29 21:33:09', NULL, 0, NULL, 6, 13),
(270, 'https://cdn.tgdd.vn/Products/Images/8783/316316/bhx/trung-vit-phuong-nam-hop-10-qua-202311232048235468_300x300.jpg', 'Trứng vịt Phương Nam hộp 10 quả', 38000, 13, 33000, 'hộp', '', 'Trứng vịt Phương Nam đảm bảo tươi mới, trứng to, tròn đều và đảm bảo chất lượng. Trứng vịt có thể dùng để chế biến thành các món ăn ngon như trứng luộc, hấp, chiên hoặc nấu canh,... dễ ăn lại tốt cho sức khỏe.', '2023-11-29 21:33:09', NULL, 0, NULL, 6, 13),
(271, 'https://cdn.tgdd.vn/Products/Images/8783/316319/bhx/trung-vit-muoi-phuong-nam-hop-4-qua-202311271133285752.jpg', 'Trứng vịt muối Phương Nam hộp 4 quả', 23000, 0, 23000, 'hộp', '', 'Trứng vịt muối Phương Nam là sản phẩm được đóng gói và bảo quản theo tiêu chuẩn nghiêm ngặt về vệ sinh và an toàn thực phẩm. Trứng vịt to tròn, cầm chắc tay, tươi mới và đảm bảo nguồn gốc xuất xứ.', '2023-11-29 21:33:09', NULL, 0, NULL, 6, 13),
(272, 'https://cdn.tgdd.vn/Products/Images/8783/316320/bhx/trung-vit-bac-thao-phuong-nam-hop-4-qua-202311271132509189.jpg', 'Trứng vịt bắc thảo Phương Nam hộp 4 quả', 26000, 0, 26000, 'hộp', '', 'Trứng vịt bắc thảo Phương Nam đảm bảo chất lượng, trứng to tròn, cầm chắc tay và giàu dinh dưỡng. Trứng vịt bắc thảo dùng để nấu soup cua, làm bánh, nấu cháo,... ăn rất ngon và bắt vị.', '2023-11-29 21:33:09', NULL, 0, NULL, 6, 13),
(273, 'https://cdn.tgdd.vn/Products/Images/8788/302709/bhx/dua-gang-trai-08kg-1kg-giao-ngau-nhien-song-hoac-chin-202310032231230074_300x300.jpg', 'Dưa gang trái 1kg', 15000, 5, 14250, 'trái', '1kg', 'Dưa gang là loại trái cây thơm ngon, vị ngọt bùi và thanh mát. Dưa gang có nguồn gốc từ Tiền Giang. Dưa có thể ăn trực tiếp hoặc ăn dầm đá đường, dầm sữa đường rất ngon và hấp dẫn. Dưa tươi ngon, không bị dập, giao ngẫu nhiên sống hoặc chín.', '2023-11-30 10:22:57', NULL, 0, NULL, 8, 1),
(274, 'https://cdn.tgdd.vn/Products/Images/8788/272179/bhx/dua-hau-khong-hat-trai-tu-28kg-tro-len-202303211520394309_300x300.jpg', 'Dưa hấu không hạt trái từ 2.3kg', 53000, 0, 53000, 'trái', '2.3kg', '1. Thông tin sản phẩm\r\nDưa hấu không hạt là trái cây giàu nước, vitamin A, vitamin C, khoáng chất cần thiết cho cơ thể như kali, kẽm, canxi, đặc biệt ít calo và chất béo.\r\nDưa hấu được trồng ở Tiền Giang, Long An. Dưa chắc ruột, ít ngọt hơn dưa hấu có hạt và ngọt khi trái tròn đều, cuốn héo, xanh đậm có đầu vàng. \r\nSản phẩm sạch, đạt tiêu chuẩn kiểm nghiệm VS ATTP thực phẩm theo tiêu chuẩn ISO/IEC 17025:2017\r\n\r\nSản phẩm đầu vào của Bách hoá XANH được cung cấp bởi các Nhà cung cấp khác nhau theo từng khu vực. Bách hoá XANH có thể cung cấp giấy kiểm định sản phẩm theo từng khu vực đặt hàng của Khách hàng khi có yêu cầu.\r\n\r\n2. Cam kết Hoàn tiền hoặc Đổi hàng ngay\r\n\r\nBách hóa XANH cam kết hoàn tiền hoặc đổi hàng ngay trong tất cả trường hợp khách nhận sản phẩm không đạt chất lượng gồm dưa dập, nứt, úng bên ngoài, ruột trắng, bị non hoặc vỏ quá dày\r\n\r\nLiên hệ tổng đài 1900.1908 để được hỗ trợ nhanh nhất, hoặc để lại thông tin sản phẩm hư hỏng trên web/app theo hướng dẫn tại đây\r\n\r\n\r\n\r\n3. Món ăn ngon từ dưa hấu không hạt\r\n\r\nDưa hấu giàu các loại axit amin như citrulline và lycopene. Thành phần citrulline có trong vỏ màu trắng bao quanh ruột dưa hấu có tác dụng làm giảm huyết áp và là chất cần thiết có các cơ quan như: thận, phổi, gan, hệ thống miễn dịch,... Ngoài dùng làm trái cây tráng miệng, bạn có thể chế biến dưa hấu thành nhiều món ngon như: \r\n\r\nKem dưa hấu sữa chua mát lạnh\r\n5 cách làm salad dưa hấu ngon và dễ làm\r\nSinh tố dưa hấu sữa tươi mát lạnh \r\nKem dưa hấu kiwi ngon ngất ngây\r\n\r\n4. Cách bảo quản dưa hấu không hạt tươi ngon\r\n\r\nDưa hấu nên được bảo quản ở nơi khô ráo, thoáng mát, tránh ánh nắng trực tiếp của mặt trời. Tránh va đập mạnh làm dập hoặc úng dưa hấu\r\n\r\nNgoài ra, bạn có thể rửa sạch dưa hấu bằng nước lạnh và lau khô bằng khăn sạch. Tiếp theo, cắt dưa hấu thành các miếng vừa ăn và bảo quản trong ngăn mát tủ lạnh. Dưa hấu có thể hấp thụ mùi của các thực phẩm khác trong tủ lạnh, do đó, hãy tránh bảo quản cùng với các loại thực phẩm có mùi đặc trưng khác.\r\n\r\nLưu ý: Sản phẩm nhận được có thể khác với hình ảnh về màu sắc và số lượng nhưng vẫn đảm bảo về mặt khối lượng và chất lượng.', '2023-11-30 10:22:57', NULL, 0, NULL, 8, 1),
(275, 'https://cdn.tgdd.vn/Products/Images/8788/270325/bhx/dua-hau-do-trai-tu-18kg-tro-len-202211071103198964_300x300.jpg', 'Dưa hấu đỏ trái từ 1.8kg', 36000, 14, 31000, 'trái', '1.8kg', '1. Thông tin sản phẩm\r\nDưa hấu đỏ là trái cây rất phổ biến tại Việt Nam và có quanh năm. Đặc điểm trái nhiều nước và vitamin, khoáng chất tốt cho sức khỏe, đặc biệt là ít calo và chất béo. Nước ép Dưa hấu có thể giải khát rất tốt trong mùa nóng nắng. Dưa hấu ngọt khi trái đủ độ chín, có vỏ xanh đậm, cuống héo nhẹ.\r\n\r\n         \r\n\r\nSản phẩm sạch, đạt tiêu chuẩn kiểm nghiệm VS ATTP thực phẩm theo tiêu chuẩn ISO/IEC 17025:2017\r\n         \r\n2. Cam kết Bao đổi trả\r\nBách hóa XANH cam kết hoàn tiền hoặc giao lại ngay sản phẩm dưa trong tất cả trường hợp khách nhận sản phẩm không đạt chất lượng gồm hư hỏng, dập úng, trắng ruột bên trong hoặc nứt vỡ, cấn dập bên ngoài\r\nLiên hệ tổng đài 1900.1908 để được hỗ trợ nhanh nhất, hoặc để lại thông tin sản phẩm hư hỏng trên web/app theo hướng dẫn tại đây\r\n\r\n         \r\n\r\n3. Có thể bạn muốn biết\r\nDưa hấu cuống héo sau thu hoạch 1-2 ngày sẽ đạt độ đường cao nhất, lúc này ăn sẽ rất ngọt\r\nDưa hấu ướp lạnh và chấm kèm muối khi ăn sẽ ngon hơn\r\nDưa hấu ruột đỏ sẽ ngọt hơn dưa hấu không hạt\r\nTrong 100g dưa hấu có khoảng 30.4 kcal, phù hợp với chế độ giảm cân\r\nRất nhiều món ngon từ Dưa hấu mà bạn sẽ muốn thử xem thêm\r\n\r\n        \r\n\r\nLưu ý: Sản phẩm nhận được có thể khác với hình ảnh về màu sắc và số lượng nhưng vẫn đảm bảo về mặt khối lượng và chất lượng.\r\n\r\n ', '2023-11-30 10:22:57', NULL, 0, NULL, 8, 1),
(276, 'https://cdn.tgdd.vn/Products/Images/8788/307147/bhx/buoi-nam-roi-ep-nuoc-trai-400g-800g-202308211354144415_300x300.jpg', 'Bưởi năm roi ép nước trái 800g', 11000, 0, 11000, 'trái', '800g', 'Bưởi năm roi là trái cây có nguồn xuất xứ Miền Tây (Vĩnh Long). Đây là loại bưởi chuyên dùng để ép nước, vỏ bưởi sần sùi, xám nhẹ,... Bưởi có mùi hương thanh mát, ngọt thanh. Bưởi tốt cho sức khoẻ, hệ miễn dịch và phù hợp cho người giảm cân và tiểu đường', '2023-11-30 10:22:57', NULL, 0, NULL, 8, 1),
(277, 'https://cdn.tgdd.vn/Products/Images/8788/309996/bhx/10-trai-buoi-nam-roi-ep-nuoc-400g-800g-202309071000228913_300x300.jpg', '10 trái bưởi năm roi ép nước 400-800g', 110000, 41, 65000, 'trái', '10 trái 400-800g', 'Bưởi năm roi là trái cây có nguồn xuất xứ Miền Tây (Vĩnh Long). Đây là loại bưởi chuyên dùng để ép nước, vỏ bưởi sần sùi, xám nhẹ,... Bưởi có mùi hương thanh mát, ngọt thanh. Bưởi tốt cho sức khoẻ, hệ miễn dịch và phù hợp cho người giảm cân và tiểu đường', '2023-11-30 10:22:57', NULL, 0, NULL, 8, 1),
(278, 'https://cdn.tgdd.vn/Products/Images/8788/310872/bhx/buoi-da-xanh-lao-trai-800g-1kg-202308211352189475_300x300.jpg', 'Bưởi da xanh lão trái 1kg', 33000, 40, 19900, 'trái', '1kg', 'Bưởi Da xanh là trái cây đặc sản nổi tiếng của Việt Nam. Bưởi da xanh xuất xứ Đồng Nai, có đặc điểm vỏ có màu xanh đến xanh hơi vàng khi chín.Tép bưởi màu hồng đỏ, vị ngọt thanh, màu sắc đẹp mắt, là loại trái cây cực tốt cho sức khoẻ với nhiều công dụng thần kỳ khác nhau đã được khoa học chứng minh.', '2023-11-30 10:22:57', NULL, 0, NULL, 8, 1),
(279, 'https://cdn.tgdd.vn/Products/Images/8788/273343/bhx/buoi-nam-roi-trai-09kg-11kg-202308211353511734_300x300.jpg', 'Bưởi năm roi trái 1.1kg', 31000, 0, 31000, 'trái', '1.1kg', 'Bưởi năm roi là một trong những trái cây đặc sản nổi tiếng của Việt Nam. Bưởi có mùi hương thanh mát, lúc ăn bạn sẽ cảm nhận được sự hoà quyện xen lẫn giữa vị chua và vị ngọt. Bưởi 5 roi không chỉ ngon mà còn nhiều dưỡng chất tốt cho sức khoẻ, hệ miễn dịch và phù hợp cho người giảm cân và tiểu đường', '2023-11-30 10:22:57', NULL, 0, NULL, 8, 1),
(280, 'https://cdn.tgdd.vn/Products/Images/8788/271694/bhx/buoi-da-xanh-trai-13kg-15kg-202308211353130081_300x300.jpg', 'Bưởi da xanh trái 1.5kg', 69000, 29, 49000, 'trái', '1.5kg', 'Bưởi Da xanh là trái cây đặc sản nổi tiếng của Việt Nam. Bưởi da xanh có đặc điểm vỏ có màu xanh đến xanh hơi vàng khi chín.Tép bưởi màu hồng đỏ, vị ngọt thanh, màu sắc đẹp mắt, là một trong những loại trái cây cực tốt cho sức khoẻ với nhiều công dụng thần kỳ khác nhau đã được khoa học chứng minh.', '2023-11-30 10:22:57', NULL, 0, NULL, 8, 1),
(281, 'https://cdn.tgdd.vn/Products/Images/8788/226982/bhx/quyt-duong-09-11kg-8-10-trai-202308231329584059_300x300.jpg', 'Quýt đường 1kg', 46000, 0, 46000, 'túi 1kg', '1kg', 'Quýt đường có ngọt thanh, chua nhẹ, chứa rất nhiều các chất dinh dưỡng từ thiên nhiên, cùng với đó là một lượng lớn khoáng chất, vitamin, nhiều nhất là vitamin C. Có thể ăn trực tiếp hoặc pha chế các loại đồ uống đều rất ngon.', '2023-11-30 10:22:57', NULL, 0, NULL, 8, 1),
(282, 'https://cdn.tgdd.vn/Products/Images/8788/318463/bhx/quyt-mini-1kg-10-18-trai-202311291506256070_300x300.jpg', 'Quýt mini 1kg', 39000, 10, 35000, 'túi 1kg', '1kg', 'Quýt mini là loại trái cây có vị chua ngọt, mọng nước và giàu chất dinh dưỡng, đặc biệt dồi dào vitamin C giúp tăng cường sức đề kháng cho cơ thể khỏe mạnh, ít đường và ít calo không lo tăng cân. Quýt mini có xuất xứ từ Trung Quốc, được tuyển chọn và đóng gói sạch sẽ an toàn, tiện lợi.', '2023-11-30 10:22:57', NULL, 0, NULL, 8, 1),
(283, 'https://cdn.tgdd.vn/Products/Images/8788/316290/bhx/cam-cara-uc-1kg-9-11-trai-202311290829044069.jpg', 'Cam Cara Úc 1kg (9 - 11 trái)', 89000, 0, 89000, 'túi 1kg', '1kg', 'Cam Cara nhập khẩu trực tiếp từ Úc, trái cam to, vỏ vàng tươi, ruột cam ngọt thanh và mọng nước. Cam Cara đóng túi 1kg từ 9 - 11 trái, không chỉ phù hợp để sử dụng hằng ngày mà còn có thể dùng tặng người thân, bạn bè.', '2023-11-30 10:22:57', NULL, 0, NULL, 8, 1),
(284, 'https://cdn.tgdd.vn/Products/Images/8788/319192/bhx/cam-vang-noi-dia-trung-09-11kg-3-5-trai-202311291410184690_300x300.jpg', 'Cam vàng nội địa Trung 0.9-1.1kg (3 - 5 trái)', 59000, 0, 59000, 'túi', '', 'Cam Vàng là trái cây nhập khẩu từ Trung Quốc. Đạt tiêu chuẩn xuất khẩu toàn cầu. Cam ngọt thanh, thơm đặc trưng, màu vàng bắt mắt, tép cam mọng nước ít xơ. Cam vàng Trung Quốc chứa nhiều Vitamin C, tốt cho da, chống lão hóa, giảm Cholesterol, phục sức khỏe, tạo hồng huyết cầu, giảm căng thẳng', '2023-11-30 10:22:57', NULL, 0, NULL, 8, 1),
(285, 'https://cdn.tgdd.vn/Products/Images/8788/318522/bhx/cam-sanh-tui-09-11kg-6-9-trai-202311271118564228.jpg', '2 túi Cam sành 0.9-1.1kg (6 - 9 trái)', 44000, 0, 44000, 'túi 1kg', '', 'Cam sành là một nguồn cung cấp chất dinh dưỡng quan trọng, đặc biệt là vitamin C, vitamin A và chất chống oxy hóa. Ngoài ra, 2 túi Cam sành 0.9-1.1kg (6 - 9 trái) cũng cung cấp chất xơ và các khoáng chất quan trọng như kali và folate.', '2023-11-30 10:22:57', NULL, 0, NULL, 8, 1),
(286, 'https://cdn.tgdd.vn/Products/Images/8788/310275/bhx/cam-sanh-09-11kg-6-9-trai-202309141352391842_300x300.jpg', 'Cam sành 0.9-1.1kg', 22000, 23, 17000, 'túi 1kg', '0.9-1.1kg ', '1. Thông tin sản phẩm\r\nCam sành là loại trái cây mọng nước, ngon ngọt, giàu vitamin, rất tốt cho sức khỏe và được nhiều người yêu thích. Cam sành có vỏ màu xanh và chuyển vàng khi chín, vỏ sần và dày, tép màu vàng cam đậm, mọng nước, vị ngọt chua và khá nhiều hạt. Thường được sử dụng để vắt lấy nước uống\r\n\r\nĐảm bảo nguồn gốc cam được trồng tại các tỉnh như Tiền Giang, Vĩnh Long,... tuỳ theo mùa vụ\r\n\r\nĐạt chuẩn 100% VS ATTP\r\nSản phẩm sạch, đạt tiêu chuẩn kiểm nghiệm VS ATTP thực phẩm theo tiêu chuẩn ISO/IEC 17025:2017\r\n\r\n2. Cam kết Hoàn tiền hoặc Đổi hàng ngay\r\n\r\nBách hóa XANH cam kết hoàn tiền hoặc đổi hàng ngay trong tất cả trường hợp khách nhận sản phẩm không đạt chất lượng gồm cam sâu vỏ, tép bị sượng, cam bị úng, dập do giao hàng\r\n\r\nLiên hệ tổng đài 1900.1908 để được hỗ trợ nhanh nhất, hoặc để lại thông tin sản phẩm hư hỏng trên web/app theo hướng dẫn tại đây\r\n\r\n3. Thức uống đa dạng từ cam sành\r\nNgoài nước ép cam nguyên chất, bạn có thể ép cam và táo hỗ trợ giảm cân hoặc nước ép cam và cà rốt thanh nhiệt, tăng sức đề kháng cho cơ thể\r\nLưu ý: Sản phẩm nhận được có thể khác với hình ảnh về màu sắc và số lượng nhưng vẫn đảm bảo về mặt khối lượng và chất lượng.', '2023-11-30 10:22:57', NULL, 0, NULL, 8, 1),
(287, 'https://cdn.tgdd.vn/Products/Images/8788/302675/bhx/cam-sanh-vat-nuoc-29kg-31kg-21-25-trai-202309071624188070_300x300.jpg', 'Cam sành vắt nước 2.9-3.1kg', 47000, 17, 39000, 'túi', '2.9-3.1kg', 'Cam sành là trái cây rất thông dụng trong đời sống, được ưu tiên chọn mua bởi tác dụng thần kỳ của nó mang lại cho sức khỏe chúng ta. Đặc điểm vỏ cam sành màu xanh đến xanh vàng khi chín, sần và dày, tép màu vàng cam đậm, nhiều nước, vị ngọt chua mùi rất thơm và khá nhiều hạt. Phù hợp để vắt nước.', '2023-11-30 10:22:57', NULL, 0, NULL, 8, 1),
(288, 'https://cdn.tgdd.vn/Products/Images/8788/270262/bhx/oi-dai-loan-09-11kg-202309110959320984_300x300.jpg', 'Ổi Đài Loan 1kg', 20000, 25, 15000, 'túi', '1kg', 'Ổi Đài Loan là giống trái cây có vị ngọt man mát, hơi xốp, giòn, thơm nhè nhẹ, đặc biệt rất ít hạt cho cảm giăc ăn vô cùng thích thú. Trong ổi chứa nhiều vitamin giúp tăng cường miễn dịch, đẹp da, giảm cân,...Ổi ngon, giòn nhất khi trái chắc, xanh sáng, cầm nặng tay.', '2023-11-30 10:22:57', NULL, 0, NULL, 8, 1),
(289, 'https://cdn.tgdd.vn/Products/Images/8788/286268/bhx/du-du-ruot-do-trai-700g-900g-giao-ngau-nhien-song-hoac-chin-202310032235013144_300x300.jpg', 'Đu đủ ruột đỏ trái 900g', 18000, 0, 18000, 'trái', '900g', 'Là giống trái cây nhiệt đới ngon, Quả đu đủ không những là loại quả có hương vị thơm ngon mà còn là phương thuốc quý. Đu đủ tại Bách hoá XANH tươi ngon, ngọt, không chỉ thích hợp cho việc ăn trực tiếp bổ sung dinh dưỡng mà còn có thể chế biến thành nhiều món ăn.', '2023-11-30 10:22:57', NULL, 0, NULL, 8, 1),
(290, 'https://cdn.tgdd.vn/Products/Images/8788/270320/bhx/xoai-keo-09-11kg-2-3-trai-giao-ngau-nhien-xoai-xanh-hoac-vang-202311271134017763.jpg', 'Xoài keo 0.9kg - 1.1kg', 25000, 0, 25000, 'túi', '0.9-1.1kg', 'Xoài keo có nguồn gốc từ Campuchia, là loại trái cây được ưa chuộng giàu chất xơ, vitamin, khoáng chất thiết yếu và mang lại nhiều lợi ích tuyệt vời cho hệ tiêu hóa, tim mạch, giúp mắt sáng, làm đẹp da. Xoài keo có quả chắc giòn giòn, chua nhẹ thơm ngon được nhiều người ưa thích.', '2023-11-30 10:22:57', NULL, 0, NULL, 8, 1),
(291, 'https://cdn.tgdd.vn/Products/Images/8788/302709/bhx/dua-gang-trai-08kg-1kg-giao-ngau-nhien-song-hoac-chin-202310032231230074_300x300.jpg', 'Dưa gang trái 1kg', 15000, 5, 14250, 'trái', '1kg', 'Dưa gang là loại trái cây thơm ngon, vị ngọt bùi và thanh mát. Dưa gang có nguồn gốc từ Tiền Giang. Dưa có thể ăn trực tiếp hoặc ăn dầm đá đường, dầm sữa đường rất ngon và hấp dẫn. Dưa tươi ngon, không bị dập, giao ngẫu nhiên sống hoặc chín.', '2023-11-30 10:22:57', NULL, 0, NULL, 8, 1),
(292, 'https://cdn.tgdd.vn/Products/Images/8788/272179/bhx/dua-hau-khong-hat-trai-tu-28kg-tro-len-202303211520394309_300x300.jpg', 'Dưa hấu không hạt trái từ 2.3kg', 53000, 0, 53000, 'trái', '2.3kg', '1. Thông tin sản phẩm\r\nDưa hấu không hạt là trái cây giàu nước, vitamin A, vitamin C, khoáng chất cần thiết cho cơ thể như kali, kẽm, canxi, đặc biệt ít calo và chất béo.\r\nDưa hấu được trồng ở Tiền Giang, Long An. Dưa chắc ruột, ít ngọt hơn dưa hấu có hạt và ngọt khi trái tròn đều, cuốn héo, xanh đậm có đầu vàng. \r\nSản phẩm sạch, đạt tiêu chuẩn kiểm nghiệm VS ATTP thực phẩm theo tiêu chuẩn ISO/IEC 17025:2017\r\n\r\nSản phẩm đầu vào của Bách hoá XANH được cung cấp bởi các Nhà cung cấp khác nhau theo từng khu vực. Bách hoá XANH có thể cung cấp giấy kiểm định sản phẩm theo từng khu vực đặt hàng của Khách hàng khi có yêu cầu.\r\n\r\n2. Cam kết Hoàn tiền hoặc Đổi hàng ngay\r\n\r\nBách hóa XANH cam kết hoàn tiền hoặc đổi hàng ngay trong tất cả trường hợp khách nhận sản phẩm không đạt chất lượng gồm dưa dập, nứt, úng bên ngoài, ruột trắng, bị non hoặc vỏ quá dày\r\n\r\nLiên hệ tổng đài 1900.1908 để được hỗ trợ nhanh nhất, hoặc để lại thông tin sản phẩm hư hỏng trên web/app theo hướng dẫn tại đây\r\n\r\n\r\n\r\n3. Món ăn ngon từ dưa hấu không hạt\r\n\r\nDưa hấu giàu các loại axit amin như citrulline và lycopene. Thành phần citrulline có trong vỏ màu trắng bao quanh ruột dưa hấu có tác dụng làm giảm huyết áp và là chất cần thiết có các cơ quan như: thận, phổi, gan, hệ thống miễn dịch,... Ngoài dùng làm trái cây tráng miệng, bạn có thể chế biến dưa hấu thành nhiều món ngon như: \r\n\r\nKem dưa hấu sữa chua mát lạnh\r\n5 cách làm salad dưa hấu ngon và dễ làm\r\nSinh tố dưa hấu sữa tươi mát lạnh \r\nKem dưa hấu kiwi ngon ngất ngây\r\n\r\n4. Cách bảo quản dưa hấu không hạt tươi ngon\r\n\r\nDưa hấu nên được bảo quản ở nơi khô ráo, thoáng mát, tránh ánh nắng trực tiếp của mặt trời. Tránh va đập mạnh làm dập hoặc úng dưa hấu\r\n\r\nNgoài ra, bạn có thể rửa sạch dưa hấu bằng nước lạnh và lau khô bằng khăn sạch. Tiếp theo, cắt dưa hấu thành các miếng vừa ăn và bảo quản trong ngăn mát tủ lạnh. Dưa hấu có thể hấp thụ mùi của các thực phẩm khác trong tủ lạnh, do đó, hãy tránh bảo quản cùng với các loại thực phẩm có mùi đặc trưng khác.\r\n\r\nLưu ý: Sản phẩm nhận được có thể khác với hình ảnh về màu sắc và số lượng nhưng vẫn đảm bảo về mặt khối lượng và chất lượng.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
