(296, 'https://cdn.tgdd.vn/Products/Images/8788/319192/bhx/cam-vang-noi-dia-trung-09-11kg-3-5-trai-202311291410184690_300x300.jpg', 'Cam vàng nội địa Trung 0.9-1.1kg (3 - 5 trái)', 59000, 0, 59000, 'túi', '', 'Cam Vàng là trái cây nhập khẩu từ Trung Quốc. Đạt tiêu chuẩn xuất khẩu toàn cầu. Cam ngọt thanh, thơm đặc trưng, màu vàng bắt mắt, tép cam mọng nước ít xơ. Cam vàng Trung Quốc chứa nhiều Vitamin C, tốt cho da, chống lão hóa, giảm Cholesterol, phục sức khỏe, tạo hồng huyết cầu, giảm căng thẳng', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(297, 'https://cdn.tgdd.vn/Products/Images/8788/318522/bhx/cam-sanh-tui-09-11kg-6-9-trai-202311271118564228.jpg', '2 túi Cam sành 0.9-1.1kg (6 - 9 trái)', 44000, 0, 44000, 'túi 1kg', '', 'Cam sành là một nguồn cung cấp chất dinh dưỡng quan trọng, đặc biệt là vitamin C, vitamin A và chất chống oxy hóa. Ngoài ra, 2 túi Cam sành 0.9-1.1kg (6 - 9 trái) cũng cung cấp chất xơ và các khoáng chất quan trọng như kali và folate.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(298, 'https://cdn.tgdd.vn/Products/Images/8788/202933/bhx/cam-vang-uc-09-11kg-3-5-trai-202308231331209487_300x300.jpg', 'Cam vàng Úc 0.9kg - 1.1kg', 79000, 0, 79000, 'túi', '0.9-1.1kg', 'Cam Vàng Úc là trái cây nhập khẩu từ Úc. Đạt tiêu chuẩn xuất khẩu toàn cầu. Cam ngọt thanh, thơm đặc trưng, màu vàng bắt mắt, tép cam mọng nước ít xơ. Cam vàng Úc chứa nhiều Vitamin C, tốt cho da, chống lão hóa, giảm Cholesterol, phục sức khỏe, tạo hồng huyết cầu, giảm căng thẳng', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(299, 'https://cdn.tgdd.vn/Products/Images/8788/270353/bhx/chuoi-su-nai-18kg-giao-ngau-nhien-song-hoac-chin-202311130906432410_300x300.jpg', 'Chuối sứ nải 1.8kg', 25000, 0, 25000, 'nải', '1.8kg', 'Chuối sứ là trái cây chứa rất nhiều chất dinh dưỡng cần thiết cho cơ thể, hương vị bùi bùi ngọn dịu vô cùng hấp dẫn. Ngoài ăn trực tiếp chuối sứ còn có thể dùng chế biến nhiều món ăn ngon hấp dẫn như sinh tố, chè, bánh, kem, sữa,...Chuối ngon nhất khi bắt đầu xuất hiện đốm nâu.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(300, 'https://cdn.tgdd.vn/Products/Images/8788/270354/bhx/chuoi-cau-nai-800g-tro-len-giao-ngau-nhien-song-hoac-chin-202309301657453395_300x300.jpg', 'Chuối cau nải 1kg', 25000, 0, 25000, 'nải', '1kg', 'Chuối cau là trái cây thân thuộc, được trồng nhiều tại Việt Nam. Trái nhỏ, tròn khi chín có màu vàng ươm đẹp mắt, hương thơm nhẹ đặc trưng, vị ngọi thanh. Chuối cau chứa nhiều chất xơ, vitamin, khoáng chất và ít tinh bột có tác dụng làm đẹp da, chống lão hóa, tốt cho tim mạch, đường huyết, giảm cân', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(301, 'https://cdn.tgdd.vn/Products/Images/8788/312875/bhx/nho-mau-don-noi-dia-trung-500g-202308260902030188_300x300.jpg', 'Nho mẫu đơn nội địa Trung 450g - 550g', 89000, 0, 89000, 'hộp', '450-550g', 'Nho mẫu đơn là giống nho mọng nước, quả có hình tròn đều, vị ngọt đậm đà và hương thơm nhẹ. Nho mẫu đơn tại Bách hóa XANH được đảm bảo nguồn gốc xuất xứ từ Trung Quốc và được đóng gói trong hộp nhựa sạch sẽ, đảm bảo vệ sinh.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(302, 'https://cdn.tgdd.vn/Products/Images/8788/284397/bhx/nho-do-ninh-thuan-500g-202308150841599529_300x300.jpg', 'Nho đỏ Ninh Thuận 500g', 32000, 0, 32000, 'hộp', '500g', 'Nho đỏ có phần thịt dày mọng nước, vị ngọt xen lẫn chua nhẹ hài hoà, là loại trái cây được nhiều người yêu thích vào những ngày hè. Loại nho đỏ Ninh Thuận  mang lại nhiều lợi ích đối với sức khoẻ, nho ngọt khi có vỏ màu đỏ tím, đậm, chín đều, chắc, mọng.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1);
INSERT INTO `product` (`id`, `thumbnail`, `name`, `reg_price`, `discount_percent`, `discount_price`, `unit`, `canonical`, `description`, `created_at`, `updated_at`, `deleted`, `rating`, `category_id`, `brand_id`) VALUES
(303, 'https://cdn.tgdd.vn/Products/Images/8788/319523/bhx/combo-le-ma-hong-oi-dai-loan-202311281323377482_300x300.jpg', 'Combo 1kg lê má hồng, 1kg ổi Đài Loan', 79000, 6, 74000, 'túi', '', 'Combo lê má hồng và ổi Đài Loan gồm có lê má hồng vỏ ngoài mỏng, thịt bên trong màu trắng, nhiều nước nên được ưa chuộng vào màu hè làm thành nhiều món ngon giải khát. Ổi Đài Loan có nhiều vitamin, đặc biệt và vitamin C, giúp giải nhiệt hiệu quả', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(304, 'https://cdn.tgdd.vn/Products/Images/8788/319531/bhx/combo-tao-gala-my-oi-dai-loan-202311281324047041_300x300.jpg', 'Combo 1kg táo Gala Mỹ, 1kg ổi Đài Loan', 89000, 6, 84000, 'hộp', '', 'Combo táo Gala Mỹ, ổi Đài Loan gồm: Táo gala nhập khẩu từ Mỹ, ngon, ngọt, chất lượng, không bị dập, úng. Ổi Đài Loan có vị ngọt man mát, hơi xốp, giòn, thơm nhè nhẹ, đặc biệt rất ít hạt cho cảm giăc ăn vô cùng thích thú.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(305, 'https://cdn.tgdd.vn/Products/Images/8788/319532/bhx/combo-tao-rockit-oi-dai-loan-202311281324091638_300x300.jpg', 'Combo 1kg táo Rockit, 1kg ổi Đài Loan', 75000, 10, 67250, 'túi', '', 'Combo táo Rockit, ổi Đài Loan tươi ngon, gồm Táo Rocki quả nhỏ, vỏ ngoài hồng đậm pha chút trắng vàng, thịt và vỏ giòn, thơm ngọt, được nhiều người ưa chuộng. Ổi Đài Loan có vị ngọt man mát, hơi xốp, giòn, thơm nhè nhẹ, đặc biệt rất ít hạt', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(306, 'https://cdn.tgdd.vn/Products/Images/8788/319528/bhx/combo-tao-dazzle-oi-dai-loan-202311281323569185_300x300.jpg', 'Combo 1kg táo Dazzle, 1kg ổi Đài Loan', 105000, 5, 100000, 'túi', '', 'Combo táo Dazzle, ổi Đài Loan ổi Đài Loan tươi ngon với Táo Dazzle giòn, ngọt và thơm vô cùng từ New Zealand. Đạt tiêu chuẩn xuất khẩu toàn cầu, được lai tạo giữa 2 giống táo: Sweetie và Scired. Và Ổi Đài Loan hơi xốp, giòn, thơm nhè nhẹ, đặc biệt rất ít hạt.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(307, 'https://cdn.tgdd.vn/Products/Images/8788/319527/bhx/combo-tao-cripps-red-oi-dai-loan-202311281323498053_300x300.jpg', 'Combo 1kg táo Cripps Red, 1kg ổi Đài Loan', 79000, 6, 74000, 'túi', '', 'Combo táo Cripps Red, ổi Đài Loan ổi Đài Loan tiết kiệm, tươi ngon với Táo Cripps Red là một sản phẩm nhập khẩu từ Nam Phi, giòn ngọt, vị chua nhẹ và Ổi Đài Loan hơi xốp, giòn, thơm nhè nhẹ, đặc biệt rất ít hạt.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(308, 'https://cdn.tgdd.vn/Products/Images/8788/233980/bhx/tao-dazzle-new-zealand-09kg-11kg-5-7-trai-202308081613352247_300x300.jpeg', 'Táo Dazzle New Zealand 1kg', 85000, 0, 85000, 'túi', '1kg', 'Táo Dazzle là trái cây từ New Zealand. Đạt tiêu chuẩn xuất khẩu toàn cầu, được lai tạo giữa 2 giống táo: Sweetie và Scired. Táo chắc, khi ăn giòn, ngọt và thơm vô cùng, chứa nhiều vitamin A, C, canxi, và sắt, cùng với pectin tốt cho sức khỏe. Size táo có kích thước lớn, vỏ sáng bóng, màu đỏ thẩm.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(309, 'https://cdn.tgdd.vn/Products/Images/8788/234962/bhx/tao-fuji-mini-nam-phi-09kg-11kg-8-10-trai-202308081602433997_300x300.jpg', 'Táo Fuji mini Nam Phi 0.9kg - 1.1kg', 49000, 0, 49000, 'túi 1kg', '0.9-1.1kg', 'Táo Fuji mini là loại trái cây nhập khẩu từ Nam Phi. Táo Fuji có độ giòn, vị ngọt thanh nhiều nước và có hương thơm đặc trưng quyến rũ. Táo Fuji mini giàu chất xơ, kẽm và vitamin C, B1, B2, tốt cho người muốn cải thiện hệ tiêu hoá.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(310, 'https://cdn.tgdd.vn/Products/Images/8788/319452/bhx/tao-autumn-glory-mini-my-09-11kg-202311241056370602_300x300.jpg', 'Táo Autumn Glory mini Mỹ 0.9-1.1kg', 55000, 0, 55000, 'túi', '0.9-1.1kg', 'Táo Autumn Glory mini là trái cây nhập khẩu Mỹ, chất lượng an toàn cùng lượng dưỡng chất dồi dào, có vị giòn ngọt và thanh mát. Ngoài ra, nhiều nghiên cứu cho rằng ăn 2 quả táo mỗi ngày có thể giảm nguy cơ đột quỵ hoặc đau tim nếu nguyên nhân xuất phát từ cholesterol làm cứng động mạch.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(311, 'https://cdn.tgdd.vn/Products/Images/8788/319449/bhx/tao-autumn-glory-my-09-11kg-202311241026593333_300x300.jpg', 'Táo Autumn Glory Mỹ 0.9-1.1kg', 69000, 0, 69000, 'túi', '0.9-1.1kg', 'Táo Autumn Glory là trái cây nhập khẩu từ Mỹ, chất lượng an toàn cùng lượng dưỡng chất dồi dào, có vị giòn ngọt và thanh mát. Ngoài ra, nhiều nghiên cứu cho rằng ăn 2 quả táo mỗi ngày có thể giảm nguy cơ đột quỵ hoặc đau tim nếu nguyên nhân xuất phát từ cholesterol làm cứng động mạch.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(312, 'https://cdn.tgdd.vn/Products/Images/8788/310069/bhx/tao-fuji-nam-phi-09-11kg-5-7-trai-202308180928263139_300x300.jpg', 'Táo Fuji Nam Phi 1kg', 49000, 0, 49000, 'túi', '1kg', 'Táo Fuji tươi ngon, giòn ngọt vô cùng hấp dẫn. Đây là loại trái cây chứa nhiều dưỡng chất dinh dưỡng, tốt cho sức khỏe, thích hợp là món quà cho bạn bè và người thân.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(313, 'https://cdn.tgdd.vn/Products/Images/8788/311191/bhx/tao-rockit-ong-2-trai-76g-202310101720541453_300x300.jpg', 'Táo Rockit ống 2 trái 76g', 55000, 5, 52250, 'ống', '76g', 'Táo Rockit là loại trái cây nhập khẩu cao cấp, có hương vị giòn ngọt. Loại trái cây này quả nhỏ, vỏ ngoài hồng đậm pha chút trắng vàng, thịt và vỏ giòn, thơm ngọt, được nhiều người ưa chuộng.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(314, 'https://cdn.tgdd.vn/Products/Images/8788/213642/bhx/tao-pink-lady-nhap-khau-new-zealand-1kg-5-7-trai-202308251422366798_300x300.jpg', 'Táo Pink Lady nhập khẩu Nam Phi 1kg (5-7 trái)', 69000, 0, 69000, 'túi', '1kg', 'Táo nhập khẩu 100% từ Nam Phi. Đạt tiêu chuẩn xuất khẩu toàn cầu. Bảo quản tươi ngon đến tận tay khách hàng. Trái vừa ăn, chắc tay, vỏ táo màu hồng xanh đẹp mắt. Táo ngon nhất khi có lớp vỏ màu đỏ đậm, táo còn cứng, không bị dập.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(315, 'https://cdn.tgdd.vn/Products/Images/8788/317968/bhx/tao-gala-mini-phap-tui-09-11kg-202311110841020225_300x300.jpg', 'Táo Gala mini pháp 0.9-1.1kg', 55000, 11, 49000, 'túi', '', 'Táo gala mini là trái cây nhập khẩu Pháp, với công nghệ trồng và bảo quản hiện đại, luôn giữ được giá trị dinh dưỡng cả khi vận chuyển quảng đường dài. Ăn táo mỗi ngày cấp cấp nhiều chất dinh dưỡng cực tốt cho cơ thể,', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(316, 'https://cdn.tgdd.vn/Products/Images/8788/296883/bhx/tao-gala-my-1kg-5-7-trai-202311110853430503_300x300.jpg', 'Táo Gala Mỹ 1kg', 69000, 0, 69000, 'hộp', '1kg', 'Táo gala là trái cây nhập khẩu từ Mỹ. Đạt tiêu chuẩn xuất khẩu toàn cầu. Bảo quản tươi ngon đến tận tay khách hàng. Táo gala Mỹ ngon, ngọt, chất lượng, không bị dập, úng.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(317, 'https://cdn.tgdd.vn/Products/Images/8788/261699/bhx/tao-cripps-red-nhap-khau-nam-phi-hop-1kg-5-7-trai-202302201530524621_300x300.jpg', 'Táo Cripps Red Nam Phi 0.9- 1.1kg', 59000, 0, 59000, 'túi 1kg', '0.9-1.1kg', 'Táo Cripps Red là một trong những giống táo nhập khẩu Nam Phi được nhiều người tiêu dùng yêu thích với những đặc điểm riêng biệt. Táo Cripps Red là trái cây nhập khẩu giòn, ngọt có vị chua nhẹ.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(318, 'https://cdn.tgdd.vn/Products/Images/8788/319234/bhx/le-tai-nung-noi-dia-trung-09-11kg-202311231418336240_300x300.jpg', 'Lê Tai Nung nội địa Trung Quốc 0.9-1.1kg', 45000, 0, 45000, 'túi', '0.9-1.1kg', 'Lê Tai Nung nhập khẩu từ Trung Quốc, với vỏ mỏng, xanh và thịt trắng. Lê Tai Nung là có đặc điểm quả nhỏ, núm ở cuống hơi lõm, thịt trắng, đặc ruột, mọng nước chứa nhiều vitamin C, canxi và sắt. Khi chín có vị ngọt thanh có tác dụng bổ sung chất dinh dưỡng cho cơ thể và phù hợp làm trái cây giải nhiệt.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(319, 'https://cdn.tgdd.vn/Products/Images/8788/223091/bhx/le-duong-3-5-trai-202308210939244299_300x300.jpg', 'Lê đường 1kg', 53000, 0, 53000, 'túi', '1kg', 'Lê đường là trái cây có xuất xứ từ những vùng có khí hậu lạnh. Lê đường được nhập khẩu từ Trung Quốc với đầy đủ các tiêu chuẩn chất lượng. Đặc điểm của lê là giòn, ngọt và mọng nước. Lê đường có nhiều dưỡng chất tốt cho sức khỏe; nổi tiếng với món lê hấp đường phèn giảm ho, cải thiện đau rát cổ họng', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(320, 'https://cdn.tgdd.vn/Products/Images/8788/238709/bhx/le-ma-hong-1kg-202311140853464074_300x300.jpg', 'Lê má hồng 1kg', 59000, 0, 59000, 'túi', '', 'Lê má hồng là loại trái cây có vị ngọt dịu, giòn thơm mát và mọng nước. Lê má hồng có vỏ ngoài mỏng, màu xanh, thịt bên trong màu trắng, nhiều nước nên được ưa chuộng vào màu hè làm thành nhiều món ngon giải khát, giải nhiệt. Sản phẩm tươi ngon, sạch, an toàn cho sức khoẻ người tiêu dùng.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(321, 'https://cdn.tgdd.vn/Products/Images/8788/317826/bhx/le-hoang-kim-09-11kg-202311181137380625_300x300.jpg', 'Lê hoàng kim 0.9-1.1kg', 59000, 0, 59000, 'túi', '', 'Lê hoàng kim là loại trái cây có thịt bên trong màu trắng, giòn, mọng nước và vị ngọt thanh. Vỏ lê mỏng, thịt ngọt nhẹ, nhiều nước và ít calo, giàu dưỡng chất nên đem lại nhiều lợi ích cho sức khoẻ và làm đẹp. Với vị ngọt tự nhiên, lê hoàng kim có thể làm nguyên liệu cho món bánh, salad hay các loại nước uống giải khát. Và đặc biệt ăn ngon, ngọt hơn khi ướp lạnh.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(322, 'https://cdn.tgdd.vn/Products/Images/8788/317183/bhx/le-hoang-kim-3kg-202311192236492188_300x300.jpeg', 'Lê hoàng kim 3kg', 199000, 0, 199000, 'hộp', '3kg', 'Hộp quà lê hoàng kim 3kg với thiết kế tinh tế, sang trọng chắc chắn sẽ là món quà ý nghĩa, phù hợp cho mọi dịp để dành tặng cho những người thân yêu.\r\nLê hoàng kim là loại trái cây có thịt bên trong màu trắng, giòn, mọng nước và vị ngọt thanh. Vỏ lê mỏng, thịt ngọt nhẹ, mọng nước và ít calo, nhiều dưỡng chất nên đem lại nhiều lợi ích cho sức khoẻ và làm đẹp. Với vị ngọt tự nhiên, lê hoàng kim có thể làm nguyên liệu cho món bánh, salad hay các loại nước uống giải khát.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(323, 'https://cdn.tgdd.vn/Products/Images/8788/301165/bhx/tao-boom-ninh-thuan-500g-4-7-trai-202311291402327882_300x300.jpg', 'Táo boom Ninh Thuận 500g', 23500, 0, 23500, 'hộp', '500g', 'Là loại trái cây có màu xanh bóng ửng vàng, nhẵn mịn. Táo boom Ninh Thuận giòn ngọt, thanh mát chứa nhiều vitamin và dưỡng chất tốt cho cơ thể như tăng cường sức đề kháng, chống ô xy hóa, tốt cho sức khỏe và làn da.Cam kết giao đúng khối lượng, chất lượng và an toàn.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(324, 'https://cdn.tgdd.vn/Products/Images/8788/302714/bhx/tao-ninh-thuan-500g-12-15-trai-202308211519385423_300x300.jpg', 'Táo Ninh Thuận 500g', 21000, 0, 21000, 'túi', '500g', 'Táo xanh Ninh Thuận là trái cây đặc sản của vùng đất Phan Rang Ninh Thuận. Táo xanh hay táo ta, táo gai, tên khoa học Ziziphus mauritiana, là cây ăn quả nhiệt đới có nguồn gốc châu Phi. Khi ăn rửa sạch và ăn luôn vỏ, có vị ngọt thanh, giòn tan trong miệng. Quả ngon hơn khi chấm cùng muối ớt/muối tôm', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(325, 'https://cdn.tgdd.vn/Products/Images/8788/292790/bhx/oi-tran-chau-ruot-do-09-11kg-5-7-trai-202308211500312313_300x300.jpg', 'Ổi trân châu ruột đỏ 1kg', 31000, 25, 23250, 'vỉ', '1kg', 'Ổi trân châu ruột đỏ giòn ngọt, tươi ngon, trái to, không bị dập. Ổi có ruột màu đỏ hồng vô cùng hấp dẫn, ổi ngọt ngon. Ổi ngon, được đóng gói cẩn thận, tiện lợi, là loại trái cây cung cấp nhiều dưỡng chất cho cơ thể. Ổi ngon, giòn nhất khi trái chắc, xanh sáng, cầm nặng tay.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(326, 'https://cdn.tgdd.vn/Products/Images/8788/292850/bhx/oi-ruby-09-11kg-4-6-trai-202310061314282550_300x300.jpg', 'Ổi Ruby 0.9kg - 1.1kg', 32000, 25, 24000, 'vỉ', '0.9-1.1kg', 'Ổi ruby là loại trái cây chất lượng, thơm ngon có lớp vỏ màu xanh lá cây bóng mượt, bên trong có màu đỏ hồng rất bắt mắt và hấp dẫn. Ổi ruby được rất nhiều người ưa chuộng và chọn mua bởi sự giòn, ngọt của nó.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(327, 'https://cdn.tgdd.vn/Products/Images/8788/310664/bhx/man-sua-1kg-5-9-trai-202307150823288745_300x300.jpg', 'Mận sữa 1kg', 39000, 0, 39000, 'túi 1kg', '1kg', 'Mận sữa tươi ngon, chất lượng, có màu trắng của sữa trông rất bắt mắt và hấp dẫn. Mận sữa có vị ngọt thanh, giòn, ăn kèm với muối ớt vô cùng bắt vị. Mận sữa có nguồn gốc từ các tỉnh ở khu vực miền tây: Tiền Giang, Đồng Tháp, Cần Thơ, Vĩnh Long .... (tuỳ theo lô hàng)', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(328, 'https://cdn.tgdd.vn/Products/Images/8788/233526/bhx/coc-lon-09-11kg-4-8-trai-202308211502572861_300x300.jpg', 'Cóc lớn 0.9kg - 1.1kg', 33000, 0, 33000, 'túi 1kg', '0.9-1.1kg', 'Cóc là loại trái cây nhiệt đới có quả giòn, ngọt dịu, pha ít vị chua nhẹ nhàng dễ chịu, ăn trực tiếp hoặc làm ước ép đều rất thơm ngon và bổ dưỡng. Cóc lớn ngon nhất khi có vỏ trơn láng, xanh đậm, đốm vàng, khi đó cóc sẽ ngọt và giòn ngon. Cam kết bán đúng khối lượng', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(329, 'https://cdn.tgdd.vn/Products/Images/8788/310908/bhx/coc-giong-thai-1kg-202308260911361453_300x300.jpg', 'Cóc giống Thái 0.9-1.1kg ', 15000, 0, 15000, 'túi 1kg', '0.9-1.1kg', 'Cóc giống Thái là loại trái cây có màu xanh lục đẹp mắt, vị chua và giòn, vỏ dày nhưng mềm. Trái cóc Thái khi còn non ăn rất giòn, nhưng khi quả già và chín thì thịt quả mềm, có vị chua ngọt. Cóc tại Bách hóa XANH được đảm bảo nguồn gốc xuất xứ, chất lượng và cam kết bán đúng khối lượng.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(330, 'https://cdn.tgdd.vn/Products/Images/8788/319197/bhx/hong-gion-moc-chau-09-11kg-202311200944417422_300x300.jpg', 'Hồng giòn Mộc Châu 0.9-1.1kg', 45000, 0, 45000, 'túi', '', 'Hồng giòn Mộc Châu là loại trái cây thơm ngon, thịt quả màu vàng nhạt, vị ngọt thanh dễ chịu. Với vỏ ngoài màu xanh, đáy nhọn và có hạt, cần lưu ý khi sử dụng cho trẻ em. Hồng giòn chứa nhiều dưỡng chất, có thể chế biến thành nhiều món ăn ngon.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(331, 'https://cdn.tgdd.vn/Products/Images/8788/316335/bhx/thanh-long-09-11kg-2-3-trai-202310041026015860_300x300.jpg', 'Thanh long 0.9kg - 1.1kg', 18000, 0, 18000, 'túi', '0.9-1.1kg', 'Thanh long trắng là loại trái cây có bề ngoài bóng bẩy đẹp mắt, tươi ngon, vị ngọt thanh hấp dẫn. Trong thanh long có chứa hàm lượng lớn vitamin C giúp tăng cường sức đề kháng cho cở thể khỏe mạnh. Thanh long ngon nhất khi vỏ màu đỏ đậm, quả chắc sẽ rất ngọt và mọng nước.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(332, 'https://cdn.tgdd.vn/Products/Images/8788/309813/bhx/vu-sua-bo-hong-1kg-2-4-trai-202306271534535526_300x300.jpg', 'Vú sữa bơ hồng 1kg', 69000, 0, 69000, 'túi', '1kg', 'Là một trong những loại trái cây đặc sản của Việt Nam. Vú sữa bơ hồng xuất xứ Vĩnh Long, Tiền Giang căng mọng có vị ngọt hương thơm bơ sữa hấp dẫn, quyến rũ. Đặc biệt trong cú sữa có chứa các dưỡng chất như canxi, phốt pho, sắt và magiê rất tốt cho sức khỏe phụ nữa mang thai và thai nhi.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(333, 'https://cdn.tgdd.vn/Products/Images/8788/299803/bhx/vu-sua-tim-tui-1kg-4-5-trai-202212311322033438_300x300.jpg', 'Vú sữa tím 1kg', 69000, 0, 69000, 'túi 1kg', '1kg', 'Vú sữa là loại trái cây chứa nhiều vitamin và chất dinh dưỡng. Vú sữa tím có vị ngọt béo, nhiều nước, mùi thơm thoảng, quả to tròn, thơm ngon, thịt quả màu tím nhạt đẹp mắt, hấp dẫn, ngon ngọt khó chối từ. Vú sữa tím có nguồn gốc từ Sóc Trăng, Hậu Giang, Cần Thơ.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(334, 'https://cdn.tgdd.vn/Products/Images/8788/312807/bhx/chanh-day-450g-550g-4-6-trai-202310032210474301_300x300.jpg', 'Chanh dây 450g - 550g', 15000, 0, 15000, 'túi 500gr', '450-550g', 'Chanh dây (Passiflora) là một loại trái cây nhiệt đới. Chanh chín có vỏ màu tím sang đậm dần. Ruột chanh vàng mọng nước. Có vị chua và mùi thơm được sử dụng nhiều trong pha chế và nấu ăn, chứa chất chống oxy hóa mạnh và nhiều loại vitamin tốt cho hệ tiêu hóa, tim mạch, tăng cường miễn dịch.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(335, 'https://cdn.tgdd.vn/Products/Images/8788/312804/bhx/thom-nu-hoang-12kg-16kg-202309091650235600_300x300.jpg', 'Thơm nữ hoàng 900g trở lên', 22000, 0, 22000, 'trái', '900 trở lên', 'Thơm nữ hoàng tươi ngon, trái từ 900g trở lên, là dòng thơm nổi tiếng xuất xứ Tiền Giang. Thơm nữ hoàng được đánh giá là giống thơm ngon nhất cả nước, có thể dùng như một loại trái cây giải nhiệt, có thể ép lấy nước, làm sinh tố, làm bánh và chế biến món ăn.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(336, 'https://cdn.tgdd.vn/Products/Images/8788/222969/bhx/sapoche-09-11kg-5-10-trai-giao-ngau-nhien-trai-song-hoac-chin-202309261937003073_300x300.jpg', 'Sapoche 1kg', 33000, 0, 33000, 'túi 1kg', '1kg', 'Sapoche hay còn còn là hồng xiêm, là loại trái cây nhiệt đới có nguồn gốc từ Trung và Nam Mỹ. Sapoche ngọt nhất khi có vỏ chín màu vàng nâu, nhám nhẹ, khi ấn vào thấy mềm, có thể gọt vỏ ăn trực tiếp hoặc làm thành sinh tố đều rất ngon và giàu chất dinh dưỡng', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(337, 'https://cdn.tgdd.vn/Products/Images/8788/309469/bhx/me-thai-300g-202306210829126193_300x300.jpg', 'Me Thái 300g', 42000, 0, 42000, 'hộp', '300g', 'Me Thái là một trong những loại trái cây được nhiều người yêu thích bởi vị chua ngọt, thơm ngon, hấp dẫn của nó. Me Thái có thể dùng trực tiếp hoặc chế biến thành các món ăn, thức uống ngon khác cũng rất bắt vị.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(338, 'https://cdn.tgdd.vn/Products/Images/8788/309411/bhx/khe-chua-300g-6-9-trai-202308231328216703_300x300.jpg', 'Khế chua 300g', 18000, 5, 17100, 'vỉ', '300g', 'Khế chua tươi ngon, chất lượng, vỏ khế thường có màu xanh đậm, vị chua thích hợp để làm gỏi, nấu canh chua,... Ngoài ra khế chua còn là nguồn cung cấp nhiều dưỡng chất và vitamin cần thiết cho cơ thể.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(339, 'https://cdn.tgdd.vn/Products/Images/8788/317676/bhx/hop-qua-trai-cay-nhap-khau-1-202311011629565921_300x300.jpg', 'Hộp quà trái cây An Khang NK1', 360000, 19, 289000, 'hộp', '', 'Hộp quà trái cây An Khang NK1 là sự kết hợp của các loại trái cây tươi ngon như cam Cara và táo Envy. Vị trái cây tươi ngọt cùng phần bao bì đóng gói đẹp mắt thích hợp để biếu, tặng cho người thân, bạn bè, đồng nghiệp.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(340, 'https://cdn.tgdd.vn/Products/Images/8788/317677/bhx/hop-qua-trai-cay-nhap-khau-2-202311011629503059_300x300.jpg', 'Hộp quà trái cây Thịnh Vượng NK2', 450000, 20, 359000, 'hộp', '', 'Hộp quà trái cây Thịnh Vượng NK2 là sự kết hợp của các loại trái cây tươi ngon như táo Dazzle, kiwi, Nho đen nhập khẩu. Vị trái cây tươi ngọt cùng phần bao bì đóng gói đẹp mắt thích hợp để biếu, tặng cho người thân, bạn bè, đồng nghiệp.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(341, 'https://cdn.tgdd.vn/Products/Images/8788/317708/bhx/hop-qua-trai-cay-nhap-khau-7-202311011626369247_300x300.jpg', 'Hộp quà trái cây Đại Lợi NK7', 450000, 20, 359000, 'hộp', '', 'Hộp quà trái cây Đại Lợi NK7 là sự kết hợp của các loại trái cây tươi ngon như lê Singo, nho đen nhập khẩu, quýt Úc, táo Envy.Vị trái cây tươi ngọt cùng phần bao bì đóng gói đẹp mắt thích hợp để biếu, tặng cho người thân, bạn bè, đồng nghiệp.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(342, 'https://cdn.tgdd.vn/Products/Images/8788/317679/bhx/hop-qua-trai-cay-nhap-khau-3-202311011629395516_300x300.jpg', 'Hộp quà trái cây Sum Vầy NK3', 450000, 20, 359000, 'hộp', '', 'Hộp quà trái cây Sum Vầy NK3 là sự kết hợp của các loại trái cây tươi ngon như cam Cara, táo Envy, nho xanh không hạt. Vị trái cây tươi ngọt cùng phần bao bì đóng gói đẹp mắt thích hợp để biếu, tặng cho người thân, bạn bè, đồng nghiệp.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(343, 'https://cdn.tgdd.vn/Products/Images/8788/317703/bhx/hop-qua-trai-cay-nhap-khau-4-202311011627030742_300x300.jpg', 'Hộp quà trái cây Sung Túc NK4', 525000, 20, 419000, 'hộp', '', 'Hộp quà trái cây Sung Túc NK4 là sự kết hợp của các loại trái cây tươi ngon như lê Singo, kiwi, táo Dazzle. Vị trái cây tươi ngọt cùng phần bao bì đóng gói đẹp mắt thích hợp để biếu, tặng cho người thân, bạn bè, đồng nghiệp.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(344, 'https://cdn.tgdd.vn/Products/Images/8788/317710/bhx/hop-qua-trai-cay-nhap-khau-8-202311011625569620_300x300.jpg', 'Hộp quà trái cây Đại Cát NK8', 625000, 20, 499000, 'hộp', '', 'Hộp quà trái cây Đại Cát NK8 là sự kết hợp của các loại trái cây tươi ngon như dưa lưới, táo Dazzle, kiwi, nho xanh không hạt, cam vàng.Vị trái cây tươi ngọt cùng phần bao bì đóng gói đẹp mắt thích hợp để biếu, tặng cho người thân, bạn bè, đồng nghiệp.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(345, 'https://cdn.tgdd.vn/Products/Images/8785/283722/bhx/thom-nguyen-vo-trai-1kg-12kg-202206242002152465_300x300.jpg', 'Thơm nguyên vỏ trái 1kg - 1.2kg', 25000, 0, 25000, 'trái 1kg', '1-1.2kg', 'Thơm là một loại trái cây vừa ngon, chua chua ngọt ngọt lại vừa cung cấp rất nhiều chất dinh dưỡng cho cơ thể. Thơm có thể chế biến thành nhiều món ăn khác nhau như: làm nước ép, kho, xào,... mỗi một món sẽ mang lại một hương vị khác nhau.', '2023-11-30 10:22:58', NULL, 0, NULL, 8, 1),
(346, 'https://cdn.tgdd.vn/Products/Images/12439/306167/bhx/rau-cu-hon-hop-400g-202304250823449083_300x300.jpg', 'Rau củ hỗn hợp 400g', 31500, 0, 31500, 'gói', '400g', 'Rau củ hỗn hợp gồm cà rốt, khoai lang, khoai tây, khoai môn,.. tươi ngon, được gọt sẵn, cắt thành miếng vừa ăn, thích hợp để nấu canh, nấu nước dùng,... tiết kiệm thời gian cho người bận rộn, lại vô cùng dinh dưỡng, ngọt nước.', '2023-11-30 10:22:58', NULL, 0, NULL, 9, 1),
(347, 'https://cdn.tgdd.vn/Products/Images/12439/306165/bhx/rau-cu-nau-sup-400g-202304211517393472_300x300.jpg', 'Rau củ nấu súp 400g', 31500, 5, 29925, 'gói', '400g', 'Rau củ nấu súp gồm cà rốt, khoai tây, su su, củ cải trắng,.. được cắt sẵn và làm sạch vô cùng tiết kiệm thời gian chế biến. Rau củ dùng để nấu súp, mang đến hương vị ngọt thanh và dinh dưỡng.', '2023-11-30 10:22:58', NULL, 0, NULL, 9, 1),
(348, 'https://cdn.tgdd.vn/Products/Images/12439/306178/bhx/rau-hon-hop-300g-202304211604132405_300x300.jpg', 'Rau hỗn hợp 300g', 31000, 5, 29450, 'khay', '300g', 'Rau hỗn hợp gồm cà rốt, bắp non, măng tây tươi ngon, là những loại rau củ dinh dưỡng, thích hợp nấu được nhiều món ăn ngon. Rau củ chất lượng, được cắt sẵn, tiện lợi và tiết kiệm thời gian cho người nấu ăn.', '2023-11-30 10:22:58', NULL, 0, NULL, 9, 1),
(349, 'https://cdn.tgdd.vn/Products/Images/12439/303418/bhx/nguyen-lieu-nau-canh-muop-mong-toi-khay-450g-202303081329245633_300x300.jpg', 'Nguyên liệu canh mướp mồng tơi 450g', 29000, 5, 27550, 'khay', '450g', 'Rau mồng tơi và mướp hương có tác dụng thanh nhiệt, giải độc, chống đau nhức. Nguyên liệu nấu canh mướp mồng tơi khay 450g nấu cùng thịt thanh mát, vừa ngon vừa có tác dụng giải nhiệt.', '2023-11-30 10:22:58', NULL, 0, NULL, 9, 1),
(350, 'https://cdn.tgdd.vn/Products/Images/12439/306173/bhx/khoai-lang-giong-nhat-lam-sach-300g-202304211546512469_300x300.jpg', 'Khoai lang giống Nhật làm sạch 300g', 27500, 0, 27500, 'gói', '300g', 'Khoai lang giống Nhật làm sạch sẵn, tiện lợi, cắt thành miếng vừa ăn, tươi ngon, chất lượng. Khoai lang giống Nhật mềm, ngọt, dẻo được rất nhiều người yêu thích. Khoai lang là loại củ dinh dưỡng có thể luộc, nấu canh,...', '2023-11-30 10:22:58', NULL, 0, NULL, 9, 1),
(351, 'https://cdn.tgdd.vn/Products/Images/12439/303422/bhx/dau-tuoi-hon-hop-an-lac-goi-100g-202303040954302424_300x300.jpg', 'Đậu tươi hỗn hợp 100g', 27000, 0, 27000, 'gói', '100g', 'Sản phẩm gồm các loại đậu tươi ngon như đậu trắng, đậu đỏ, đậu ngự, đậu hà lan được làm sạch và đóng gói kín đáo tiện lợi. Đậu tươi hỗn hợp gói 100g hạt chắc, tươi ngon, phù hợp dùng nấu chè, nấu súp, cung cấp nhiều dinh dưỡng cho gia đình', '2023-11-30 10:22:58', NULL, 0, NULL, 9, 1),
(352, 'https://cdn.tgdd.vn/Products/Images/12439/303415/bhx/combo-rau-nau-canh-chua-khay-500g-202303081321141807_300x300.jpg', 'Combo rau nấu canh chua 500g', 25000, 5, 23750, 'khay', '500g', 'Canh chua là món canh có vị chua chua được tạo nên từ những loại rau và nguyên liệu, xen chút vị cay the của ớt cùng hương vị thơm béo của cá. Combo rau nấu canh chua khay 500g bao gồm: Giá, thơm, cà chua, đậu bắp, bạc hà, me, ớt, ngò ôm, ngò gai.', '2023-11-30 10:22:58', NULL, 0, NULL, 9, 1),
(353, 'https://cdn.tgdd.vn/Products/Images/12439/303417/bhx/nguyen-lieu-com-chien-duong-chau-an-lac-goi-200g-202303040914348128_300x300.jpg', 'Nguyên liệu cơm chiên dương châu 150g', 24000, 5, 22800, 'gói', '150g', 'Sản phẩm gồm những topping quen thuộc sử dụng trong món cơm chiên dương châu như cà rốt, bắp hạt, đậu,...được làm sạch và cắt nhỏ miếng vừa ăn vô cùng tiện lợi đóng gói sạch sẽ thành nguyên liệu cơm chiên dương châu vô cùng tiện lợi, giúp tiết kiệm được thời gian khi nấu nướng', '2023-11-30 10:22:58', NULL, 0, NULL, 9, 1),
(354, 'https://cdn.tgdd.vn/Products/Images/12439/303403/bhx/khoai-mi-lam-sach-an-lac-goi-300g-202303040903050683_300x300.jpg', 'Khoai mì làm sạch 300g', 22000, 5, 20900, 'gói', '300g', 'Khoai mì là một trong những loại củ được trồng nhiều tại các vùng nông thôn miền núi, củ mì thon dài, nhiều tinh bột và chế biến được nhiều món như khoai mì hấp cốt dừa, bánh khoai mì, bánh tầm, bánh ít, canh khoai mì, khoai mì nướng,...Khoai mì được làm sạch tiện lợi, dễ sử dụng', '2023-11-30 10:22:58', NULL, 0, NULL, 9, 1),
(355, 'https://cdn.tgdd.vn/Products/Images/12439/303380/bhx/kho-qua-bao-300g-202308181450493017.jpg', 'Khổ qua bào 300g', 22000, 50, 11000, 'khay', '300g', 'Khổ qua hay còn gọi là mướp đắng, đây là thực phẩm được xem là đắng nhất trong các loại củ quả và rất quen thuộc trong thực đơn hàng tuần của các bà nội trợ. Khổ qua bào khay 300g chứa rất nhiều vitamin và khoáng chất tốt cho cơ thể, giúp nâng cao chức năng miễn dịch, thanh nhiệt giải độc.', '2023-11-30 10:22:58', NULL, 0, NULL, 9, 1),
(356, 'https://cdn.tgdd.vn/Products/Images/12439/303377/bhx/hoa-chuoi-bao-an-lac-khay-200g-202303040844057666_300x300.jpg', 'Hoa chuối bào 200g', 19000, 5, 18050, 'khay', '200g', 'Hoa chuối bào khay 200g hay còn gọi là bắp chuối bào, đây là một loại rau ăn sống, rau nộm, chế biến thành nhiều món ngon khác nhau như: Trộn gỏi, nấu lẩu, nấu canh. Ngoài ra hoa chuối còn cung cấp năng lượng và tốt cho sức khỏe', '2023-11-30 10:22:58', NULL, 0, NULL, 9, 1),
(357, 'https://cdn.tgdd.vn/Products/Images/12439/303400/bhx/bi-do-lam-sach-350g-202303141511065377_300x300.jpg', 'Bí đỏ làm sạch 350g', 19000, 5, 18050, 'khay', '350g', 'Bí đỏ hay còn gọi là bí ngô, đây là loại củ rất ngon, có vị ngọt thanh, được sử dụng rất phổ biến trong nấu canh như Canh bí đỏ xương heo. Bí đỏ làm sạch khay 350g đảm bảo tươi ngon, rất giàu dinh dưỡng, nhất là Vitamin A và chất chống oxy hóa.', '2023-11-30 10:22:58', NULL, 0, NULL, 9, 1),
(358, 'https://cdn.tgdd.vn/Products/Images/12439/303383/bhx/nguyen-lieu-tuoi-kho-tieu-xanh-an-lac-goi-80g-202303040924153302_300x300.jpg', 'Nguyên liệu kho tiêu xanh 80g', 15000, 5, 14250, 'gói', '80g', 'Nguyên liệu tươi kho tiêu xanh An Lạc gói 80g sạch, tươi, xanh ngon và tốt cho sức khỏe. Là loại rau gia vị thơm ngon, giúp các món ăn thêm bắt vị, kích thích vị giác tốt, còn chứa nhiều dưỡng chất thiết yếu cần thiết cho cơ thể.', '2023-11-30 10:22:58', NULL, 0, NULL, 9, 1),
(359, 'https://cdn.tgdd.vn/Products/Images/12439/303387/bhx/hanh-tim-xay-an-lac-hu-50g-202303040847408670_300x300.jpg', 'Hành tím xay 50g', 10000, 5, 9500, 'hũ', '50g', 'Hành tím là loại củ gia vị quen thuộc trong mỗi gia đình, hàng quán giúp gia tăng hương vị cho các món ăn như làm hành phi, xào, hành ngâm chua,..hoặc dùng ướp kèm các loại thịt cá. Hành tím xay hũ 50g tại Bách hóa XANH tiện lợi, đảm bảo sạch sẽ với hũ nắp đậy, dễ bảo quản', '2023-11-30 10:22:58', NULL, 0, NULL, 9, 1),
(360, 'https://cdn.tgdd.vn/Products/Images/12439/303402/bhx/toi-xay-50g-202308160936451733.jpg', 'Tỏi xay 50g', 10000, 50, 5000, 'hũ', '50g', 'Tỏi xay hũ 50g sạch, tươi, xanh ngon và làm sẵn hợp vệ sinh. Là loại rau gia vị thơm ngon, giúp các món ăn thêm bắt vị cay nồng đậm đà, kích thích vị giác tốt, còn chứa vài dưỡng chất thiết yếu cần thiết cho cơ thể.', '2023-11-30 10:22:58', NULL, 0, NULL, 9, 1),
(361, 'https://cdn.tgdd.vn/Products/Images/12439/303405/bhx/sa-xay-an-lac-hu-50g-202303040941533020_300x300.jpg', 'Sả xay 50g', 8500, 5, 8075, 'hũ', '50g', 'Sả xay hũ 50g sạch, tươi, xanh ngon và làm sẵn hợp vệ sinh. Là loại rau gia vị thơm ngon, giúp các món ăn thêm bắt vị cay nhẹ thơm nồng đậm đà, kích thích vị giác tốt, còn chứa vài dưỡng chất thiết yếu cần thiết cho cơ thể.', '2023-11-30 10:22:58', NULL, 0, NULL, 9, 1),
(362, 'https://cdn.tgdd.vn/Products/Images/7459/200117/bhx/kim-chi-cai-thao-len-men-tu-nhien-viet-han-hop-500g-202307261351598632_300x300.jpg', 'Kim chi cải thảo lên men Việt Hàn hộp 500g', 38000, 21, 30000, 'hộp', '', 'Kim chi Hàn Việt mang đến hương vị truyền thống của người Hàn Quốc với độ chua cay vừa. Kim chi cải thảo lên men tự nhiên Việt Hàn hộp 500g nổi bật với mùi vị thơm đặc trưng của cải thảo và táo lê, hòa quyện cùng vị cay của bột ớt, vị lên men chua tự nhiên nên kim chi rất kích thích vị giác.', '2023-11-30 10:22:58', NULL, 0, NULL, 9, 1),
(363, 'https://cdn.tgdd.vn/Products/Images/7459/200187/bhx/kim-chi-cai-thao-mama-goi-400g-202205170839563639_300x300.png', 'Kim chi cải thảo Mama gói 400g', 32000, 20, 25500, 'gói', '', 'Kim chi Mama mang đến hương vị truyền thống của người Hàn Quốc với độ chua cay vừa, cắt lát tiện lợi. Kim chi cải thảo Mama gói 400g nổi bật với mùi vị thơm đặc trưng của cải thảo và táo lê, hòa quyện cùng vị cay của bột ớt, vị lên men chua tự nhiên nên kim chi rất kích thích vị giác.', '2023-11-30 10:22:58', NULL, 0, NULL, 9, 1),
(364, 'https://cdn.tgdd.vn/Products/Images/7459/91790/bhx/ca-phao-ngam-chua-ngot-song-huong-hu-370g-202306201044013159_300x300.png', 'Cà pháo ngâm chua ngọt Sông Hương hũ 370g', 27000, 7, 25200, 'hũ', '370g', 'Là món đồ chua thích hợp để ăn kèm trong các bữa ăn, là món ăn truyền thống của người Việt Nam. Cà pháo chua ngọt Sông Hương hũ 370g được làm theo công thức truyền thống của người Việt từ những nguyên liệu tự nhiên, trên dây chuyền đạt tiêu chuẩn quốc tế từ thương hiệu đồ chua Sông Hương.', '2023-11-30 10:22:58', NULL, 0, NULL, 9, 1),
(365, 'https://cdn.tgdd.vn/Products/Images/8285/91763/bhx/mam-tom-chua-tron-ca-phao-song-huong-hu-430g-202306201037148975_300x300.png', 'Mắm tôm chua cà pháo Sông Hương hũ 430g', 69000, 0, 69000, 'hũ', '', 'Mắm được làm từ 2 nguyên liệu chính là tôm chua và cà pháo thơm ngon, mặn mà. Mắm tôm chua trộn cà pháo Sông Hương hũ 430g ăn kèm với cơm, bún, rau sống, thịt luộc, dưa giá. Mắm Sông Hương chất lượng, thơm ngon, dinh dưỡng ăn rất hao cơm và ngon miệng', '2023-11-30 10:22:58', NULL, 0, NULL, 9, 1),
(366, 'https://cdn.tgdd.vn/Products/Images/8285/281693/bhx/mam-thai-ca-loc-hai-an-tui-250g-202205281319026072_300x300.jpg', 'Mắm thái cá lóc HAI AN túi 250g', 39000, 0, 39000, 'túi', '', 'Dưa mắm là món ăn ngon, tiện lợi, thích hợp cho những ngày mưa. Mắm HAI AN ngon, giúp em nhiều cơm cùng hương vị đậm đà, được nhiều người chọn lựa. Mắm thái cá lóc HAI AN túi 250g đóng gói sẵn, cho bạn tiết kiệm thời gian mà vẫn có được bữa ăn ngon', '2023-11-30 10:22:58', NULL, 0, NULL, 9, 1),
(367, 'https://cdn.tgdd.vn/Products/Images/8285/293984/bhx/mam-ca-phao-chua-cay-song-huong-hu-390g-202302220839073367.jpg', 'Mắm cà pháo chua cay Sông Hương hũ 390g', 37000, 0, 37000, 'hũ', '', 'Mắm cà pháo chua cay Sông Hương hũ 390g có hương vị chua chua, cay cay rất bắt miệng. Mắm Sông Hương là thương hiệu mắm thơm ngon, hấp dẫn, hương vị chuẩn, dễ ăn, được nhiều người yêu thích chọn lựa.', '2023-11-30 10:22:58', NULL, 0, NULL, 9, 1),
(368, 'https://cdn.tgdd.vn/Products/Images/8285/91764/bhx/mam-ca-phao-song-huong-hu-390g-202306201036204393_300x300.png', 'Mắm cà pháo Sông Hương hũ 390g', 36000, 0, 36000, 'hũ', '', 'Mắm được làm từ nguyên liệu chính là cà pháo và gia vị đi kèm thơm ngon, mặn mà. Mắm cà pháo Sông Hương hũ 390g ăn kèm với cơm, bún, rau sống, thịt luộc, dưa giá. Mắm Sông Hương chất lượng, thơm ngon, dinh dưỡng ăn rất hao cơm và ngon miệng', '2023-11-30 10:22:58', NULL, 0, NULL, 9, 1),
(369, 'https://cdn.tgdd.vn/Products/Images/7459/227486/bhx/mang-luoc-xe-vi-lam-goi-500g-202305220849258885_300x300.png', 'Măng luộc xé Vĩ Lâm gói 500g', 32500, 0, 32500, 'gói', '', 'Măng chua muối là món ăn dân dã được nhiều người ưa thích bởi vị chua mát của nó. Sản phẩm măng luộc xé Vĩ Lâm gói 500g rất bắt miệng dùng để ăn kèm hoặc dùng chế biến các món ăn khác như gỏi, canh, lẩu cũng rất ngon, giúp các bà nội trợ chế biến nhanh chóng.', '2023-11-30 10:22:58', NULL, 0, NULL, 9, 1),
(370, 'https://cdn.tgdd.vn/Products/Images/7459/206549/bhx/mang-chua-tre-xanh-goi-300g-202305250859119021_300x300.jpg', 'Măng chua Tre Xanh gói 300g', 28000, 0, 28000, 'gói', '', 'Là sản phẩm đến từ thương hiệu măng chua Tre Xanh, quen thuộc với người tiêu dùng qua nhiều năm qua. Măng chua Tre Xanh gói 300g là món măng chua có độ giòn, ngon, vị chua vừa phải. Nấu canh chua, lẩu với cá, thịt (gà, vịt, sườn heo), hải sản. Dùng chế biến các món ăn chay.', '2023-11-30 10:22:58', NULL, 0, NULL, 9, 1),
(371, 'https://cdn.tgdd.vn/Products/Images/7459/206552/bhx/mang-la-tre-xanh-goi-450g-202311242053515800_300x300.jpg', 'Măng lá Tre Xanh gói 450g', 28000, 0, 28000, 'gói', '', 'Là sản phẩm đến từ thương hiệu măng chua Tre Xanh, quen thuộc với người tiêu dùng qua nhiều năm qua. Măng chua Tre Xanh gói 300g là món măng chua có độ giòn, ngon, vị chua vừa phải. Nấu canh chua, lẩu với cá, thịt (gà, vịt, sườn heo), hải sản. Dùng chế biến các món ăn chay.', '2023-11-30 10:22:58', NULL, 0, NULL, 9, 1),
(372, 'https://cdn.tgdd.vn/Products/Images/7459/227366/bhx/cai-chua-vi-lam-goi-500g-202304051630192229_300x300.jpg', 'Cải chua Vĩ Lâm gói 500g', 26500, 0, 26500, 'gói', '', 'Là sản phẩm đến từ thương hiệu đồ chua Vĩ Lâm, được nhiều người tiêu dùng ưa chuộng và tin dùng. Cải chua Vĩ Lâm gói 500g được chế biến từ loại rau cải sậy tươi ngon muối chua với hỗn hợp nước và muối, mang đến món đồ chua giòn giòn chua chua, đầy kích thích.', '2023-11-30 10:22:58', NULL, 0, NULL, 9, 1),
