(379, 'https://cdn.tgdd.vn/Products/Images/7172/236775/bhx/rau-hon-hop-dong-lanh-mama-food-goi-500g-202205171021099388_300x300.png', 'Rau hỗn hợp Mama Food 500g', 42000, 0, 42000, 'gói', '500g', 'Rau củ đông lạnh là những sản phẩm thiết yếu trong gian bếp cho mỗi gia đình trong thời đại ngày nay. Rau hỗn hợp đông lạnh Mama Food gói 500g đến từ thực phẩm đông lạnh Mama Food có thể dùng để chế biến thành nhiều món ăn như cơm chiên, rau củ xào,... một cách nhanh chóng.', '2023-11-30 10:22:58', NULL, 0, NULL, 10, 14),
