(382, 'https://cdn.tgdd.vn/Products/Images/7172/288595/bhx/khoai-tay-dong-lanh-tran-gia-goi-1kg-202309080919568946_300x300.jpg', 'Khoai tây Trần Gia 1kg', 80000, 0, 80000, 'bịch', '', 'Khoai tây đông lạnh Trần Gia là sản phẩm rau củ đông lạnh khá nổi tiếng, có xuất sứ từ Hà Lan gồm nhiều loại khác nhau. Khoai tây đông lạnh Trần Gia gói 1kg với nguyên liệu tự nhiên cùng dây chuyền sản xuất hiện đại cho sản phẩm đầy ấn tượng, chế biến nhanh chóng, tiện dụng.', '2023-11-30 10:22:58', NULL, 0, NULL, 10, 15),
(383, 'https://cdn.tgdd.vn/Products/Images/7172/239239/bhx/khoai-tay-dong-lanh-tran-gia-goi-500g-202305091031278739.jpg', 'Khoai tây đông lạnh Trần Gia 500g', 48000, 0, 48000, 'gói', '', 'Là loại rau củ đông lạnh với thành phần gồm 96% khoai tây và 5% dầu cọ. Khoai tây đông lạnh Trần Gia gói 500g có thời hạn quản được lâu tiện lợi chế biến những món ngon, khoái khấu được nhiều người yêu thích đến từ rau củ đông lạnh Trần Gia.', '2023-11-30 10:22:58', NULL, 0, NULL, 10, 15),
(384, 'https://cdn.tgdd.vn/Products/Images/7172/239248/bhx/rau-qua-hon-hop-dong-lanh-tran-gia-goi-500g-202309081411102430_300x300.jpg', 'Rau quả hỗn hợp Trần Gia 500g', 35000, 0, 35000, 'gói', '', 'Là sự kết hợp giữa các loại rau củ đông lạnh, mang đến nguồn vitamin A, B6, C, K, cùng chất xơ và các khoáng chất khác. Rau quả hỗn hợp Trần Gia gói 500g được làm sạch và bao gói bảo quản lạnh cẩn thận, là sản phẩm tiện lợi cho mọi gia đình đến từ rau củ đông lạnh Trần Gia.', '2023-11-30 10:22:58', NULL, 0, NULL, 10, 15),
(385, 'https://cdn.tgdd.vn/Products/Images/7172/239249/bhx/dau-ha-lan-dong-lanh-tran-gia-goi-400g-202305111406306706.jpg', 'Đậu Hà Lan Trần Gia 400g', 35000, 0, 35000, 'gói', '', 'Là loại rau củ đông lạnh chứa nhiều protein tốt, vitamin A B6 C K, chất xơ và các khoáng chất khác, đặc biệt rất ít chất béo bão hòa cholesterol. Đậu Hà Lan Trần Gia gói 400g được làm sạch và bao gói bảo quản lạnh cẩn thận, là sản phẩm tiện lợi cho mọi gia đình đến từ rau củ đông lạnh Trần Gia.', '2023-11-30 10:22:58', NULL, 0, NULL, 10, 15),
(386, 'https://cdn.tgdd.vn/Products/Images/7172/239245/bhx/bap-hat-dong-lanh-tran-gia-goi-500g-202205171036015761_300x300.png', 'Bắp hạt Trần Gia 500g', 32000, 0, 32000, 'gói', '500g', 'Là loại rau củ đông lạnh dồi dào các loại vitamin C, B1, B9 và các thành phần khác. Bắp hạt đông lạnh Trần Gia gói 500g có thời hạn quản được lâu tiện lợi chế biến những món ngon, khoái khấu được nhiều người yêu thích đến từ rau củ đông lạnh Trần Gia.', '2023-11-30 10:22:58', NULL, 0, NULL, 10, 15),
