(389, 'https://cdn.tgdd.vn/Products/Images/8820/271489/bhx/rau-thom-cac-loai-goi-200g-202301031313108896_300x300.jpg', 'Rau thơm các loại 200g', 15000, 0, 15000, 'gói', '200g', 'Rau thơm các loại tại Bách hoá XANH bao gồm rau rau diếp cá, rau quế, rau tía tô, rau húng,... Đây là loại rau thơm không thể thiếu giúp tạo thêm hương vị cho các món ăn như bánh xèo, bánh khọt, bánh ướt,... Rau thơm tại Bách hoá XANH tươi ngon, xanh mơn mởn.', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(390, 'https://cdn.tgdd.vn/Products/Images/8820/303266/bhx/xa-lach-lo-lo-xanh-thuy-canh-cay-tu-230g-202303170838328707_300x300.jpg', 'Xà lách lô lô thuỷ canh cây 200g trở lên', 15000, 0, 15000, 'cây', '200g', 'Được trồng theo hình thức thủy canh, Xà lách lô lô thủy canh rất tươi mát, có vị ngon ngọt, lá không quá giòn và cũng không quá mềm. Rau được nuôi trồng bởi quy trình nghiêm ngặt nên đảm bảo về chất lượng và an toàn đến tay người tiêu dùng.', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(391, 'https://cdn.tgdd.vn/Products/Images/8820/227717/bhx/gia-dau-xanh-300g-202305091426095796_300x300.jpg', 'Giá đậu xanh 300g', 8800, 0, 8800, 'gói', '300g', 'Giá đậu xanh được nuôi trồng và đóng gói theo những tiêu chuẩn nghiêm ngặt, bảo đảm các tiêu chuẩn xanh - sạch, chất lượng và an toàn với người dùng. Giá giòn, ngọt thường được dùng làm rau ăn kèm cho các món có nước như bún, phở hoặc nấu canh chua, xào với thịt.', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(392, 'https://cdn.tgdd.vn/Products/Images/8820/223334/bhx/rau-muong-hat-baby-goi-300g-202301031322121332_300x300.jpg', 'Rau muống hạt baby 300g', 14000, 0, 14000, 'gói', '300g', 'Rau muống hạt baby là rau non nên có độ giòn, ngọt hơn so với rau muống thông thường, quy trình trồng nghiêm ngặt, đảm bảo an toàn và chất lượng đến tay người tiêu dùng. Rau muống hạt baby có hàm lượng chất dinh dưỡng cao, đặc biệt là sắt và chất xơ, thường được dùng để luộc, xào,...', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
