(394, 'https://cdn.tgdd.vn/Products/Images/8820/319261/bhx/cai-ngot-baby-300g-dau-hao-chay-maggi-nam-huong-chai-150g-202311210848299914_300x300.jpg', 'Cải ngọt baby 300g & Dầu hào chay Maggi chai 150g', 26500, 34, 17400, 'chai', '', 'Xem thêm', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(395, 'https://cdn.tgdd.vn/Products/Images/8820/271493/bhx/ngo-gai-rau-om-goi-100g-202301031409488803_300x300.jpg', 'Ngò gai, rau om 100g', 6000, 0, 6000, 'gói', '100g', 'Ngò gai, rau om loại rau thường gặp trong các món canh chua, canh khoai mỡ,... nếu các món canh này mà thiếu đi loại rau này thì sẽ giảm mất độ ngon đi khá nhiều. Ngoài ngò gai, rau om còn làm gia vị cho các món ăn và còn có thể giúp điều trị một số loại bệnh một cách hiệu quá.', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(396, 'https://cdn.tgdd.vn/Products/Images/8820/299258/bhx/rau-diep-ca-goi-100g-202301031305203582_300x300.jpg', 'Rau diếp cá 100g', 6000, 6, 5650, 'gói', '100g', 'Rau diếp cá là loại rau thường được ăn sống để chấm thịt kho, cuốn bánh tráng,... Ngoài làm thực phẩm thì diếp cá còn là một vị thuốc đông y cực tốt để chữ trị một số bệnh nhẹ như táo bón, trĩ, hạ sốt,... Đặc biệt, diếp cá còn có thể giúp làm đẹp hiệu quả như: trị mụn, đẹp da,..', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
