(398, 'https://cdn.tgdd.vn/Products/Images/8820/299256/bhx/rau-hung-que-goi-100g-202301031303428757_300x300.jpg', 'Rau húng quế 100g', 7000, 0, 7000, 'gói', '100g', 'Rau húng quế có mùi thơm rất dễ chịu, đặc trưng và thường kết hợp với húng cây làm thành \"bộ đôi rau nêm\" góp mặt trong nhiều bữa ăn của gia đình Việt như: Phở bò, bò kho, hủ tiếu, tiết canh, các món luộc, nướng,... Ngoài ra, húng quế còn có thể dùng để hỗ trợ một số bệnh nhẹ như: cảm mạo, ho,...', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(399, 'https://cdn.tgdd.vn/Products/Images/8820/299254/bhx/bac-ha-khay-200g-202212090825582069_300x300.jpg', 'Bạc hà 200g', 6800, 0, 6800, 'vỉ', '200g', 'Môn to, dọc mùng, ráy dọc mùng là những tên gọi khác của môn bạc hà, một loại cây rau gia vị không thể thiếu trong những bát canh chua đậm vị, thơm ngon. Vị ngọt, giòn giòn, tính mát của bạc hà giúp tạo cảm giác ngon miệng, kích thích vị giác người ăn.', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(400, 'https://cdn.tgdd.vn/Products/Images/8820/299255/bhx/tia-to-goi-100g-202301031311132603_300x300.jpg', 'Tía tô 100g', 7000, 0, 7000, 'gói', '100g', 'Tía tô là một loại rau ăn kèm với các món ăn của người Việt. Vị cay cay, chát nhẹ của loại rau này được rất nhiều người yêu thích. Ngoài là một loại thực phẩm thì tía tô còn có thể hỗ trợ điều vị một số bệnh như: giúp đầu óc tỉnh táo, giảm stress, giảm đau kháng viêm....', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(401, 'https://cdn.tgdd.vn/Products/Images/8820/271499/bhx/rau-can-tau-can-ta-200g-202301031406136654_300x300.jpg', 'Rau cần tàu (cần ta) 200g', 10000, 0, 10000, 'gói', '200g', 'Rau cần tàu (cần ta) gói 200g là một loại rau xanh phổ biến được rất nhiều người yêu thích bởi vì hương vị vô cùng đặc trưng, thân cây còn mềm xốp, khi ăn có vị ngọt ngon vô cùng.  Bạn có thể mua rau cần tàu về làm nguyên liệu cho nhiều món như rau cần xào mực, rau cần nấu cà chua,...', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(402, 'https://cdn.tgdd.vn/Products/Images/8820/271503/bhx/rau-ram-goi-100g-202301031307124268_300x300.jpg', 'Rau răm 100g', 5500, 5, 5225, 'gói', '100g', 'Rau răm là một loại rau có vị cay, tính ấm và mùi thơm đặc trưng, thường ăn kèm với các món có tính hàn, giúp bụng của bạn tốt hơn. Rau răm thường dùng ăn kèm với hột vịt lộn, làm món đậu hũ kèm rau răm hay làm tăng gia vị cho các món kho, món gỏi,..', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(403, 'https://cdn.tgdd.vn/Products/Images/8820/271485/bhx/xa-lach-lo-lo-xanh-goi-500g-202301031304365304_300x300.jpg', 'Xà lách lô lô xanh 500g', 21000, 0, 21000, 'gói', '500g', 'Rau xà lách lô lô xanh của Bách hóa Xanh được trồng tại Lâm Đồng và đóng gói theo những tiêu chuẩn nghiêm ngặt, bảo đảm các tiêu chuẩn xanh - sach. Xà lách lô lô nhiều chất xơ, hàm lượng dinh dưỡng cao, vị ngọt, giòn nên thường dùng làm rau ăn kèm cho các món cuốn', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(404, 'https://cdn.tgdd.vn/Products/Images/8820/310085/bhx/xa-lach-lo-lo-xanh-500gr-202307041031263366_300x300.jpg', 'Xà lách lô lô xanh 450g - 550g', 21000, 0, 21000, 'túi 500gr', ' 450-550g', 'Rau xà lách lô lô xanh của Bách hóa Xanh được trồng tại Lâm Đồng và đóng gói theo những tiêu chuẩn nghiêm ngặt, bảo đảm các tiêu chuẩn xanh - sach. Xà lách lô lô nhiều chất xơ, hàm lượng dinh dưỡng cao, vị ngọt, giòn nên thường dùng làm rau ăn kèm cho các món cuốn', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(405, 'https://cdn.tgdd.vn/Products/Images/8820/271482/bhx/xa-lach-bup-mo-goi-500g-202301031306115056_300x300.jpg', 'Xà lách búp mỡ 500g', 23000, 0, 23000, 'gói', '500g', 'Rau xà lách búp mỡ của Bách hóa Xanh được nuôi trồng tại Lâm Đồng và đóng gói theo những tiêu chuẩn nghiêm ngặt, bảo đảm các tiêu chuẩn xanh - sach, chất lượng và an toàn với người dùng. Xà lách mỡ giòn, thơm, tươi mát nên rất thích hợp làm rau ăn kèm cho các món cuốn.', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1);
INSERT INTO `product` (`id`, `thumbnail`, `name`, `reg_price`, `discount_percent`, `discount_price`, `unit`, `canonical`, `description`, `created_at`, `updated_at`, `deleted`, `rating`, `category_id`, `brand_id`) VALUES
(406, 'https://cdn.tgdd.vn/Products/Images/8820/315536/bhx/xa-lach-carol-500g-202309281332457341_300x300.jpg', 'Xà lách carol 500g', 19500, 5, 18525, 'gói', '500g', 'Xà lách carol được đảm bảo xuất xứ Đà Lạt, là loại xà lách xoăn tròn, màu xanh tươi, có vị ngọt nhẹ, lá cứng và giòn hơn các loại khác. Xà lách carol được nhiều người yêu thích và lựa chọn cho các món cuốn, salad quen thuộc.', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(407, 'https://cdn.tgdd.vn/Products/Images/8820/303372/bhx/rau-thi-la-goi-100g-202303020858185247_300x300.jpg', 'Rau thì là 100g', 9500, 0, 9500, 'gói', '100g', 'Rau thì là gói 100g sạch, tươi, xanh ngon và tốt cho sức khỏe. Là loại rau gia vị thơm ngon, giúp các món ăn thêm bắt vị, kích thích vị giác tốt, còn chứa nhiều dưỡng chất thiết yếu cần thiết cho cơ thể.', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(408, 'https://cdn.tgdd.vn/Products/Images/8820/281516/bhx/rau-muong-nuoc-bo-la-goi-300g-202301031318214887_300x300.jpg', 'Rau muống nước bỏ lá 300g', 10000, 0, 10000, 'gói', '300g', 'Rau muống nước bỏ lá tươi ngon, xanh, sạch chứa nhiều dưỡng chất. Rau muống giòn, có thể chế biến thành nhiều món ăn ngon như rau muốn xào tỏi, rau muống trộn gỏi,... Rau muống được đảm bảo chất lượng, đạt tiêu chuẩn.', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(409, 'https://cdn.tgdd.vn/Products/Images/8820/271527/bhx/rau-muong-hat-500gr-202310201705039397_300x300.jpg', 'Rau muống hạt 500g', 14000, 0, 14000, 'gói', '500g', 'Rau muống hạt của Bách hóa Xanh được nuôi trồng và đóng gói theo những tiêu chuẩn nghiêm ngặt, bảo đảm các tiêu chuẩn xanh - sach, chất lượng và an toàn với người dùng. Vị ngọt, tính mát, chứa một lượng lớn vitamin, sắt nên thường được dùng trong các bữa ăn hàng ngày như xào hoặc nấu canh.', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(410, 'https://cdn.tgdd.vn/Products/Images/8820/222782/bhx/cai-thia-thuy-canh-goi-300g-202301031343268875_300x300.jpg', 'Cải thìa thuỷ canh 300g', 15500, 0, 15500, 'gói', '300g', 'Cải thìa thủy canh là loại rau được nuôi trồng và đóng gói theo những tiêu chuẩn nghiêm ngặt, bảo đảm các tiêu chuẩn xanh - sạch, chất lượng và an toàn với người dùng. Cải thìa thủy canh ngọt, bẹ lá giòn, mọng nước, chứa nhiều chất xơ nên thường được dùng để luộc, hấp hoặc xào.', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(411, 'https://cdn.tgdd.vn/Products/Images/8820/310773/bhx/cai-ngot-500gr-202310201648376519_300x300.jpg', 'Cải ngọt 500g', 14500, 0, 14500, 'gói', '500g', 'Cải ngọt gói tại Bách hóa Xanh được đảm bảo quy trình nuôi trồng và đóng gói đảm bảo tiêu chuẩn nghiêm ngặt, cam kết đưa đến tay người dùng những sản phẩm rau đạt chuẩn xanh, sạch, chất lượng và an toàn. Cải ngọt có tính mát, thơm, ngọt dịu, thường được chế biến thành canh hoặc xào để thưởng thức.', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(412, 'https://cdn.tgdd.vn/Products/Images/8820/271522/bhx/cai-be-xanh-450g-550g-202310201717342737_300x300.jpg', 'Cải bẹ xanh 450g - 550g', 16000, 0, 16000, 'gói', '450-550g', 'Cải bẹ xanh của Bách hóa Xanh được nuôi trồng và đóng gói theo những tiêu chuẩn nghiêm ngặt, bảo đảm các tiêu chuẩn xanh - sach, chất lượng và an toàn với người dùng. Với bẹ lá to, vị hơi đắng nhẹ, mát và thơm nên thường được dùng để nấu canh hoặc rau cuốn ăn kèm với bánh xèo, gỏi cuốn.', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(413, 'https://cdn.tgdd.vn/Products/Images/8820/271473/bhx/hanh-paro-tui-500g-202208121355157617_300x300.jpg', 'Hành paro 500g', 20000, 0, 20000, 'túi', '500g', 'Hành paro trồng tại Lâm Đồng cũng là một loại rau rất quen thuộc với chị em nội trợ. Hành Paro có kích thước khá to, hơn gấp nhiều lần so với hành lá thông thường. Cũng giống với hành lá thông thường, hàng Paro cũng mang lại rất nhiều lượng dưỡng chất và vitamin cho cơ thể.', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(414, 'https://cdn.tgdd.vn/Products/Images/8820/222781/bhx/cai-be-dun-thuy-canh-goi-300g-202301031327300659_300x300.jpg', 'Cải bẹ dún thuỷ canh 300g', 16500, 0, 16500, 'gói', '300g', 'Được nuôi trồng trong môi trường thủy canh theo những quy chuẩn nghiêm ngặt. Cải bẹ dún thuỷ canh của Bách hóa Xanh đảm các tiêu chuẩn an toàn xanh sạch và chất lượng. Rau chứa nhiều vitamin C, nhiều nguyên tố vi lượng, có tác dụng làm mát gan, thanh lọc, giải nhiệt cơ thể, giảm cân,..', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(415, 'https://cdn.tgdd.vn/Products/Images/8820/271521/bhx/cai-be-dun-450g-550g-202310201724330846_300x300.jpg', 'Cải bẹ dún 450g - 550g', 16000, 0, 16000, 'túi 500gr', '450-550g', 'Cải bẹ dún của Bách hóa Xanh được nuôi trồng và đóng gói theo những tiêu chuẩn nghiêm ngặt, bảo đảm các tiêu chuẩn xanh - sach, chất lượng và an toàn với người dùng. Rau tươi, giòn và ngọt thường được sử dụng làm rau ăn kèm với các món cuốn hoặc trộn như bún trộn, bánh xèo,...', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(416, 'https://cdn.tgdd.vn/Products/Images/8820/271531/bhx/cai-ngong-450g-550g-202310201719408103_300x300.jpg', 'Cải ngồng 450g - 550g', 16500, 0, 16500, 'gói', '450-550g', 'Do giàu chất xơ và chứa nhiều loại vitamin A, B1, B2, B3, B5, B6, C, K,..., Cài Ngồng Bách Hóa Xanh luôn là một trong những sự lựa chọn tuyệt vời cho những món canh ngon trên bàn ăn mỗi ngày của bạn. Cải ngồng giúp hỗ trợ làm đẹp, hỗ trợ gan hoạt động tốt hơn,...', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(417, 'https://cdn.tgdd.vn/Products/Images/8820/310775/bhx/rau-mong-toi-500-g-202310201702409514_300x300.jpg', 'Rau mồng tơi 500g', 15000, 0, 15000, 'gói', '500g', 'Rau mồng tơi là loại rau có hàm lượng vitamin và khoáng chất dồi dào, giúp hỗ trợ hoạt động của hệ tiêu hóa và ngăn ngừa các bệnh về đường ruột. Rau mồng tơi tại Bách hóa XANH được đảm bảo chất lượng, nguồn gốc, xuất xứ với giá cả hợp lý, có thể dùng để chế biến nhiều món ăn ngon.', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(418, 'https://cdn.tgdd.vn/Products/Images/8820/299806/bhx/tieu-xanh-tui-50g-202212280832496462_300x300.jpg', 'Tiêu xanh 50g', 7700, 0, 7700, 'túi', '50g', 'Tiêu xanh là một loại rau gia vị quen thuộc không thể thiếu trong mỗi căn bếp. Tiêu xanh với vị cay nhẹ nhè và mùi thơm nức mũi, tiêu xanh sẽ giúp cho các món ăn của bạn được tăng thêm hương vị rất nhiều. Bạn có thể tham khảo món thịt kho tiêu xanh, bao tử hầm tiêu xanh,...', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(419, 'https://cdn.tgdd.vn/Products/Images/8820/309412/bhx/la-dua-200g-202306200819217789_300x300.jpg', 'Lá dứa 200g', 7500, 0, 7500, 'gói', '200g', 'Lá dứa là một trong những nguyên liệu quen thuộc, hay được sử dụng để tạo mùi hương cho nhiều món ăn Việt Nam từ chè, xôi, thạch,.. Lá dứa khi nấu tạo nên mùi hương ngọt, nhẹ nhàng và rất thơm, giúp món ăn trở nên bắt vị và hấp dẫn hơn.', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(420, 'https://cdn.tgdd.vn/Products/Images/8820/271525/bhx/rau-den-500gr-202310201659198260_300x300.jpg', 'Rau dền 500g', 16000, 0, 16000, 'gói', '500g', 'Rau dền bịch 500g tại Bách hoá XANH tươi ngon vô cùng, bạn có thể dễ dàng tìm được rau dền xanh mướt, rau đã tươi và ngon thì nấu món gì cũng hấp dẫn. Bạn có thể tham khảo canh rau dền tôm, cháo rau dền tôm,... thơm ngon mà cả nhà ai cũng thích', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(421, 'https://cdn.tgdd.vn/Products/Images/8820/309766/bhx/bong-he-200g-202307050831444358_300x300.jpg', 'Bông hẹ 200g', 16000, 0, 16000, 'gói', '200g', 'Bông hẹ được trồng tại Lâm Đồng, là loại rau có vị hăng, thường được sử dụng làm nguyên liệu cho các món ăn và bài thuốc. Bông hẹ tươi ngon, còn bông, là lựa chọn tốt cho gia đình bạn.', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(422, 'https://cdn.tgdd.vn/Products/Images/8820/271535/bhx/rau-lang-goi-500g-202301031348348523_300x300.jpg', 'Rau lang 500g', 14000, 0, 14000, 'gói', '500g', 'Rau lang chứa nhiều chất xơ, ngoài ra còn có đạm, tinh bột, nước và các khoáng chất cần thiết như Canxi, Kali, Sắt, Natri và Vitamin C giúp tạo ra collagen giữ cho làn da luôn tươi trẻ, săn chắc, căng đầy sức sống. Rau lang là một trong những loại rau được lựa chọn đầu tiên của người dùng.', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(423, 'https://cdn.tgdd.vn/Products/Images/8820/271747/bhx/rau-ma-goi-200g-202301031350456164_300x300.jpg', 'Rau má 200g', 10000, 0, 10000, 'gói', '200g', 'Rau má tươi ngon vô cùng, nấu được nhiều món ngon và mang lại nhiều lợi ích hữu dụng trong làm đẹp mà chị em nào cũng thích. Rau má xay sinh tố thì mát, đẹp da, rau má đắp mặt nạ thì giúp trị mụn, có thể nói đây là món rau không thể thiếu trong bếp của các chị em.', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(424, 'https://cdn.tgdd.vn/Products/Images/8820/299807/bhx/rau-dang-goi-200g-202301031345146459_300x300.jpg', 'Rau đắng 200g', 9000, 0, 9000, 'gói', '200g', 'Rau đắng được nuôi trồng và đóng gói theo những tiêu chuẩn nghiêm ngặt, bảo đảm các tiêu chuẩn xanh - sach, chất lượng và an toàn với người dùng. Vị rau đắng, hậu vị ngọt, tươi ngon thích hợp làm rau ăn kèm cho các món cuốn hoặc các món cháo cá, tăng cảm giác ngon miệng.', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(425, 'https://cdn.tgdd.vn/Products/Images/8820/271530/bhx/rau-tan-o-goi-500g-202301050918417070_300x300.jpg', 'Rau tần ô 500g', 21000, 0, 21000, 'gói', '500g', 'Rau tần ô gói 500g tại Lâm Đồng còn gọi là rau cải cúc, là một loại rau xanh vô cùng tươi ngon, rất dễ ăn và còn giúp trị ho, chữa tiêu chảy siêu hiệu quả. Rau tần ô sau khi mua về rửa sạch là có thể chế biến thành các món như canh rau tần ô thịt, canh rau tần ô tôm, rau tần ô xào thịt,..', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(426, 'https://cdn.tgdd.vn/Products/Images/8820/271471/bhx/can-tay-goi-500g-202208121347117947_300x300.jpg', 'Cần tây 500g', 30000, 0, 30000, 'gói', '500g', 'Cần tây của Bách hóa Xanh là rau được nuôi trồng tại Đà Lạt và đóng gói theo những tiêu chuẩn nghiêm ngặt, bảo đảm các tiêu chuẩn xanh - sach, chất lượng và an toàn. Rau cần tây có vị giòn ngọt, có chút hăng nhẹ nhưng cần tây hỗ trợ rất tốt cho người đang ăn kiêng giảm cân.', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(427, 'https://cdn.tgdd.vn/Products/Images/8820/271532/bhx/rau-can-nuoc-goi-500g-202301050917432392_300x300.jpg', 'Rau cần nước 500g', 15000, 0, 15000, 'gói', '500g', 'Rau cần nước là rau cần ta chứa nhiều chất xơ, vitamin và khoáng chất. Rau cần có vị hơi hăng nhẹ, rất thích hợp để xào cùng với thịt bò và các loại rau củ để tạo nên những món ăn thơm ngon và đầy đủ dinh dưỡng, đặc biệt hỗ trợ giảm cân cho người đang ăn kiêng.', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(428, 'https://cdn.tgdd.vn/Products/Images/8820/315515/bhx/dot-su-su-500g-202309281103267036_300x300.jpg', 'Đọt su su 500g', 22000, 5, 20900, 'gói', '500g', 'Đọt su su có xuất xứ Đà Lạt, bao gồm phần ngọt và lá của cây su su, màu xanh đậm, lá to, ngọn non và dài, có các tua cuốn. Đọt su su có vị ngọn và giòn tự nhiên nên thường được dùng để chế biến thành các món ăn ngon như: Đọt su su xào tỏi,  xào với thịt bò, lòng gà, đọt su su luộc hoặc nấu canh,...', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(429, 'https://cdn.tgdd.vn/Products/Images/8820/271745/bhx/la-giang-goi-200g-202301031346032785_300x300.jpg', 'Lá giang 200g', 14000, 0, 14000, 'gói', '200g', 'Lá giang là loại rau có vị chua chua, giúp cho món ăn của bạn có vị chua ngon đậm đà vô cùng. Lá giang có thể dùng làm nguyên liệu cho nhiều món ăn thơm ngon như canh cá lá giang, lẩu gà lá giang,.... thơm ngon, cả nhà ai cũng thích', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(430, 'https://cdn.tgdd.vn/Products/Images/8820/223357/bhx/bong-sung-tui-300g-202212280817026855_300x300.jpg', 'Bông súng 300g', 12000, 0, 12000, 'gói', '300g', 'Bông súng - đặc sản miền Tây có mùi thơm, nhiều màu: màu trắng, màu tím lục bình, màu hồng cánh sen. Thân bông súng có màu nâu. Vị giòn, ngọt và thơm nên thường người sử dụng thân bông súng để chế biến món ăn như gỏi, lẩu,...', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(431, 'https://cdn.tgdd.vn/Products/Images/8820/305690/bhx/bong-bi-nu-300g-202309270950202545_300x300.jpg', 'Bông bí nụ 300g', 27000, 0, 27000, 'vỉ', '300g', 'Bông bí nụ là một thực phẩm chứa nhiều dưỡng chất dinh dưỡng, được thu hoạch lúc cuống chưa rụng hoa. Bông bí nụ khi ăn giòn, ngon, ngọt, chế biến được nhiều món ăn ngon, hấp dẫn.', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(432, 'https://cdn.tgdd.vn/Products/Images/8820/291167/bhx/nguyen-lieu-nau-nuoc-mat-goi-500g-202209190837577568_300x300.jpg', 'Nguyên liệu nấu nước mát 500g', 14000, 5, 13300, 'gói', '500g', 'Với đặc tính vị ngọt, tính mát, bộ nguyên liệu nấu nước mát của Bách Hóa Xanh luôn được khách hàng tin dùng để nấu những ly nước mát cho gia đình, giúp giải khát, thanh nhiệt vào những ngày hè nóng bức.', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(433, 'https://cdn.tgdd.vn/Products/Images/8820/303363/bhx/la-che-tuoi-goi-200g-202303080818089482_300x300.jpg', 'Lá chè tươi 200g', 13000, 0, 13000, 'gói', '200g', 'Lá chè tươi xanh, nguyên cành, là loại lá thường được dùng để hãm uống. Nước chè xanh khá tốt cho sức khỏe, mang lại nhiều lợi ích như lợi tiểu, giải khát, tập trung,.... Lá chè tươi chất lượng, được đóng gói cẩn thận.', '2023-11-30 10:22:58', NULL, 0, NULL, 11, 1),
(434, 'https://cdn.tgdd.vn/Products/Images/8785/271665/bhx/hanh-tim-tui-300g-202211240924251676_300x300.jpg', 'Hành tím 300g', 25000, 0, 25000, 'túi', '300g', 'Củ hành tím là gia vị không thể thiếu trong căn bếp của mỗi gia đình. Hành tím không chỉ giúp món ăn của bạn thêm đậm đà, hấp dẫn mà còn còn có công dụng trong việc chăm sóc sức khỏe. Trong hành tím có chứa rất nhiều chất dinh dưỡng tốt cho sức khỏe.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(435, 'https://cdn.tgdd.vn/Products/Images/8785/222881/bhx/2-trai-bap-my-tu-600g-tro-len-202211281620514171_300x300.jpg', '2 trái bắp mỹ (600g trở lên)', 17100, 0, 17100, 'cặp', '600g trở lên', 'Bắp Mỹ là một loại thực phẩm được trồng rất nhiều ở khắp nơi trên thế giới. Đây là một loại quả vừa ngon, lại có rất nhiều chất khoáng chất và vitamin. Bắp có thể chế biến thành nhiều món ăn ngon như: cơm bắp, chè bắp, sữa bắp,... bất kỳ món gì cũng tạo nên hương vị tuyệt hảo.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(436, 'https://cdn.tgdd.vn/Products/Images/8785/278286/bhx/bau-sao-trai-500g-600g-202211240955098622_300x300.jpg', 'Bầu sao trái 500g', 15000, 0, 15000, 'trái', '500g', 'Bầu sao là một loại quả có thể biến thành các món ăn ngon cho gia đình. Trái bầu thon dài, bề mặt có ít lông tơ, vỏ màu xanh tươi. Bầu có thể chế biến thành các món ăn như luộc, xào, nấu canh đều rất ngon.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(437, 'https://cdn.tgdd.vn/Products/Images/8785/271518/bhx/khoai-lang-mat-tui-1kg-3-10-cu-202209180802068974_300x300.jpg', 'Khoai lang mật 1kg (2 - 5 củ)', 39000, 0, 39000, 'túi', '1kg', 'Khoai lang mật được trồng và có củ quanh năm, ngon nhất là khi được nướng lên trên một bếp than đổ hồng. Loại củ này có vị ngọt ngào như mật, khi cho vào miệng thì bở tơi, tan tan trên đầu lưỡi thì còn gì bằng. Khoai lang Nhật chứa nhiều vitamin A, B, C và nhiều khoáng chất cần thiết cho làn da đẹp.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(438, 'https://cdn.tgdd.vn/Products/Images/8785/271743/bhx/dau-bap-khay-250g-12-18-trai-202209060850073674_300x300.jpg', 'Đậu bắp 250g (12-18 trái)', 8400, 0, 8400, 'vỉ', '250g', 'Đậu bắp là loại quả chứa nhiều chất xơ, giàu dinh dưỡng, nhiều vitamin,…Đậu bắp luôn rất được ưa chuộng để chế biến những món ăn hàng ngày. Những thành phần dưỡng chất trong đậu bắp rất hữu ích cho hệ tiêu hóa, tim mạch, chống ung thư, tốt cho da và mắt,...', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(439, 'https://cdn.tgdd.vn/Products/Images/8785/271573/bhx/su-su-tui-500g-1-3-trai-202211160838403213_300x300.jpg', 'Su su 500g (1 - 3 trái)', 15000, 0, 15000, 'túi', '500g', 'Su su là một loại rau củ được nhiều chị em nội trợ chọn mua để chế biến thành các món ăn ngon cho gia đình. Quả su su trồng tại Lâm Đồng có tính mát, lành tính, chứa nhiều chất dinh dưỡng có lợi cho sức khỏe như nước, protid, glucid, vitamin C,... Su su có thể chế biến thành nhiều món ăn ngon', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(440, 'https://cdn.tgdd.vn/Products/Images/8785/226885/bhx/bi-do-tron-tui-500g-202211240931573594_300x300.jpg', 'Bí đỏ tròn 450g - 550g', 9500, 0, 9500, 'túi', '450-550g', 'Bí đỏ tròn bùi ngậy, thơm ngon và bảo quản theo tiêu chuẩn nghiêm ngặt để giữ được độ tươi ngon của thực phẩm. Sự kết hợp giữa bí đỏ béo bùi với xương heo ngọt, canh bí đỏ xương heo luôn là sự lựa chọn tuyệt vời cho mâm cơm mỗi ngày của bạn.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(441, 'https://cdn.tgdd.vn/Products/Images/8785/316284/bhx/bi-do-non-trai-250g-350g-202310170842260991_300x300.jpg', 'Bí đỏ non trái (250g - 350g)', 10000, 0, 10000, 'trái', '250-350g', 'Bí đỏ non có xuất xứ Đà Lạt, là loại bí đỏ được thu hoạch khi còn non, chưa rụng cuống, có vị ngọt nhẹ, thanh mát và không có hạt. Bí đỏ non phù hợp cho các món xào, luộc chín chấm mắm hoặc hầm nước dừa cũng rất ngon miệng.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(442, 'https://cdn.tgdd.vn/Products/Images/8785/217180/bhx/muop-huong-tui-500g-2-4-trai-202211240946435487_300x300.jpg', 'Mướp hương 450g-550g (2 - 3 trái)', 12500, 0, 12500, 'túi', '450-550g', 'Mướp hương là loại rau củ được nhiều chị em nội trợ chọn mua để chế biến thành các món ăn ngon cho gia đình. Mướp hương cũng chứa nhiều nước, protid, lipid, glucid, các vitamin rất tốt cho cơ thể. Mướp có thể chế biến thành các món xào, món canh, hấp đều rất ngon.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(443, 'https://cdn.tgdd.vn/Products/Images/8785/291352/bhx/kho-qua-khay-500g-3-5-trai-202209190821236554_300x300.jpg', 'Khổ qua 500g (3-5 trái)', 16700, 0, 16700, 'vỉ', '500g', 'Khổ qua hay mướp đắng là thực phẩm quen thuộc trong thực đơn hàng tuần của các bà nội trợ. Trong khổ qua chứa rất nhiều vitamin và khoáng chất tốt cho cơ thể, giúp nâng cao chức năng miễn dịch, thanh nhiệt giải độc. Khổ qua có thể chế biến thành canh hoặc các món xào đều rất ngon.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(444, 'https://cdn.tgdd.vn/Products/Images/8785/271510/bhx/khoai-tay-tui-500g-3-7-cu-202209060832355981_300x300.jpg', 'Khoai tây Đà Lạt 500g (3 - 7 củ)', 16000, 0, 16000, 'túi', '500g', 'Khoai tây trồng tại Trung Quốc đã quá quen thuộc với mỗi chúng ta. Loại củ này được xuất hiện thường xuyên trên mâm cơm này có rất nhiều công dụng hữu ích. Khoai tây không chỉ có thể chế biến nhiều món ăn ngon mà còn tốt cho sức khỏe, làm đẹp hiệu quả mà còn có rất nhiều tác dụng bổ ích khác.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(445, 'https://cdn.tgdd.vn/Products/Images/8785/230843/bhx/khoai-mon-tui-500g-1-cu-202211240942348566_300x300.jpg', 'Khoai môn 450g - 550g (1 củ)', 27000, 0, 27000, 'túi', '450-550g', 'Củ khoai môn có hàm lượng chất xơ và nhiều loại vitamin, khoáng chất dồi dào rất cần thiết cho sức khỏe con người. Khoai môn có lớp vỏ ngoài màu nâu, phần thịt bên trong màu trắng kết hợp với nhiều đốm màu tím nhạt, có thể chế biến thành nhiều món ăn ngon, hấp dẫn. \r\n', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(446, 'https://cdn.tgdd.vn/Products/Images/8785/220460/bhx/khoai-mo-tui-1kg-1-2-cu-202211240941176792_300x300.jpg', 'Khoai mỡ 0.9-1.1kg (1 - 2 củ)', 35000, 0, 35000, 'túi', '0.9-1.1kg', 'Khoai mỡ là loại củ khá được ưa chuộng trong những bữa ăn gia đình. Khoai mỡ có hàm lượng khoáng chất và vitamin giúp cải thiện hệ tiêu hoá, giúp nhuận tràng, chữa táo bón rất tốt. Khoai mỡ có thể sử dụng để chế biến thành các món như: canh, bánh khoai mỡ, khoai mỡ chiên giòn,...', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(447, 'https://cdn.tgdd.vn/Products/Images/8785/311394/bhx/ca-rot-09-11kg-5-10-cu-202309220856133341_300x300.jpg', 'Cà rốt 0.9 - 1.1kg (5 - 10 củ)', 25000, 5, 23750, 'túi 1kg', '0.9-1.1kg', 'Cà rốt là một loại củ rất quen thuộc trong các món ăn của người Việt. Cà rốt có hàm lượng chất dinh dưỡng và vitamin A cao, được xem là nguyên liệu cần thiết cho các món ăn dặm của trẻ nhỏ, giúp trẻ sáng mắt và cung cấp nguồn chất xơ dồi dào.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(448, 'https://cdn.tgdd.vn/Products/Images/8785/271469/bhx/cu-cai-trang-500g-2-5-cu-202308141521230066.jpg', 'Củ cải trắng 500g (2 - 5 củ)', 11000, 50, 5500, 'túi', '500g', 'Củ cải trắng trồng ở Đà Lạt là một loại rau củ vừa có thể dùng để làm thực phẩm, vừa có thể sử dụng để làm dầu hạt cải. Củ cải trắng chứa rất nhiều vitamin và khoáng chất, tốt cho cơ thể. Một vài công dụng của củ cải trắng có thể kể đến như: giảm cân, hỗ trợ hệ tiêu hoá, tăng cường miễn dịch,...', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(449, 'https://cdn.tgdd.vn/Products/Images/8785/271470/bhx/cu-den-tui-500g-2-5-cu-202209060827254536_300x300.jpg', 'Củ dền 500g (2 - 5 củ)', 20000, 0, 20000, 'túi', '500g', 'Củ dền trồng tại Lâm Đồng là một loại củ thường được các chị em nội trợ chọn vào menu hàng tuần. Củ dền chứa nhiều vitamin và khoáng chất giúp cải thiện sức khoẻ cho cơ thể. Củ dền có thể dùng chế biến thành các món ăn như canh hay có thể dùng để làm nước ép cũng rất ngon.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(450, 'https://cdn.tgdd.vn/Products/Images/8785/283722/bhx/thom-nguyen-vo-trai-1kg-12kg-202206242002152465_300x300.jpg', 'Thơm nguyên vỏ trái 1kg - 1.2kg', 25000, 0, 25000, 'trái 1kg', '1-1.2kg', 'Thơm là một loại trái cây vừa ngon, chua chua ngọt ngọt lại vừa cung cấp rất nhiều chất dinh dưỡng cho cơ thể. Thơm có thể chế biến thành nhiều món ăn khác nhau như: làm nước ép, kho, xào,... mỗi một món sẽ mang lại một hương vị khác nhau.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(451, 'https://cdn.tgdd.vn/Products/Images/8785/309358/bhx/khoai-lang-nhat-xuat-khau-1kg-202306141638453831_300x300.jpg', 'Khoai lang Nhật xuất khẩu 0.9-1.1kg', 43000, 5, 40850, 'túi 1kg', '0.9-1.1kg', 'Khoai lang Nhật xuất khẩu siêu ngọt, siêu dẻo được chọn từ những củ khoai lang to, chất lượng nhất. Loại củ này có vị ngọt ngào như mật, tan tan trên đầu lưỡi, ngon nhất là khi được nướng lên trên một bếp than đổ hồng Khoai lang Nhật chứa nhiều vitamin A, B, C và nhiều khoáng chất cần thiết.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(452, 'https://cdn.tgdd.vn/Products/Images/8785/271508/bhx/khoai-lang-nhat-tui-1kg-4-10-cu-202209060831213650_300x300.jpg', 'Khoai lang Nhật 1kg (4 - 10 củ)', 39000, 5, 37050, 'túi', '1kg', '1. Thông tin sản phẩm\r\nKhoai lang Nhật trồng tại Lâm Đồng là món ăn được rất nhiều người yêu thích, được trồng và có củ quanh năm, ngon nhất là khi được nướng lên trên một bếp than đỏ hồng.\r\nKhoai lang Nhật có vị ngọt nhẹ, bùi, chứa nhiều vitamin A, B, C. \r\n\r\nSản phẩm sạch, đạt tiêu chuẩn kiểm nghiệm VS ATTP thực phẩm theo tiêu chuẩn ISO/IEC 17025:2017\r\n\r\nSản phẩm đầu vào của Bách hoá XANH được cung cấp bởi các Nhà cung cấp khác nhau theo từng khu vực. Bách hoá XANH có thể cung cấp giấy kiểm định sản phẩm theo từng khu vực đặt hàng của Khách hàng khi có yêu cầu.\r\n\r\n2. Cam kết Hoàn tiền hoặc Đổi hàng ngay\r\n\r\nBách hóa XANH cam kết hoàn tiền hoặc đổi hàng ngay trong tất cả trường hợp khách nhận sản phẩm không đạt chất lượng gồm khoai bị sượng, xơ, vỏ ngoài bị hư, sâu\r\n\r\nLiên hệ tổng đài 1900.1908 để được hỗ trợ nhanh nhất, hoặc để lại thông tin sản phẩm hư hỏng trên web/app theo hướng dẫn tại đây\r\n\r\n\r\n3. Món ăn ngon từ khoai lang Nhật\r\n\r\nTrong 100g khoai lang Nhật có khoảng 86 Calo\r\n\r\nKhoai lang có thể được chế biến theo nhiều cách như: khoai lang luộc, khoai lang nướng, khoai lang chiên giòn \r\n\r\nKhoai lang là thực phẩm ăn dặm thích hợp cho trẻ em, bạn có thể tham khảo 10 cách nấu cháo khoai lang ăn dặm cho bé tại đây\r\n\r\n\r\n4. Cách bảo quản khoai lang Nhật tươi ngon \r\nKhoai lang có thể bảo quản được trong môi trường bên ngoài. Tuy nhiên không nên để quá lâu chúng sẽ bị mọc mầm. \r\nĐể kéo dài thời gian sử dụng, bạn có thể đặt khoai lang trong ngăn rau của tủ lạnh. Điều này giúp duy trì nhiệt độ và độ ẩm ổn định cho khoai. \r\n\r\nLưu ý: Sản phẩm nhận được có thể khác với hình ảnh về màu sắc và số lượng nhưng vẫn đảm bảo về mặt khối lượng và chất lượng.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(453, 'https://cdn.tgdd.vn/Products/Images/8785/315526/bhx/khoai-lang-tim-1kg-202309281441148914_300x300.jpg', 'Khoai lang tím 1kg', 38000, 0, 38000, 'túi', '1kg', 'Khoai lang tím có xuất xứ từ Đà Lạt có củ to, béo bùi, không bị sượng, thích hợp để luộc hoặc chế biến thành các món ăn ngon. Khoai tím giàu dinh dưỡng, ít năng lượng, thích hợp cho những người đang trong giai đoạn ăn kiêng hoặc kiểm soát cân nặng.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(454, 'https://cdn.tgdd.vn/Products/Images/8785/281514/bhx/2-trai-bap-nep-tu-500g-tro-len-202211240951157909_300x300.jpg', '2 trái bắp nếp (từ 500g trở lên)', 18000, 0, 18000, 'cặp', '500g trở lên', 'Bắp nếp là một loại thực phẩm được trồng rất nhiều ở nước ta. Đây là một loại quả vừa ngon, lại có rất nhiều chất khoáng chất và vitamin. Bắp có thể chế biến thành nhiều món ăn ngon như: cơm bắp, chè bắp, sữa bắp,... bất kỳ món gì cũng tạo nên hương vị tuyệt hảo.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(455, 'https://cdn.tgdd.vn/Products/Images/8785/305687/bhx/bap-nu-hoang-trai-tu-250g-tro-len-202304081423338825_300x300.jpg', 'Bắp nữ hoàng trái 250g trở lên', 16000, 0, 16000, 'trái', '250g trở lên', 'Bắp nữ hoàng là một loại thực phẩm có màu bắt mắt, có nguồn gốc nhập khẩu từ Thái Lan, có thể ăn sống. Bắp nữ hoàng vừa ngon, lại có rất nhiều chất khoáng chất và vitamin. Bắp có thể chế biến thành nhiều món ăn ngon như: cơm bắp, chè bắp, sữa bắp,... khi luộc màu sắc của bắp sẽ bị giảm.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(456, 'https://cdn.tgdd.vn/Products/Images/8785/275312/bhx/bap-cai-thao-500g-600g-202306200827249468_300x300.jpg', 'Bắp cải thảo 500g', 12000, 0, 12000, 'túi 500gr', '500g', 'Bắp cải thảo là loại rau có bẹ lá to, giòn, ngọt thường được dùng để nấu canh, xào chung với rau củ hoặc để muối kim chi. Bắp cải thảo của Bách hóa Xanh được trồng tại Lâm Đồng và đóng gói theo những tiêu chuẩn nghiêm ngặt, bảo đảm các tiêu chuẩn xanh - sạch, chất lượng và an toàn với người dùng.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(457, 'https://cdn.tgdd.vn/Products/Images/8785/275316/bhx/bap-cai-trang-tui-500g-600g-202211240949505337_300x300.jpg', 'Bắp cải trắng 500g', 12000, 0, 12000, 'túi 500gr', '500g', 'Bắp cải trắng là loại rau được trồng tại Lâm Đồng rất dễ mua và chế biến thành nhiều món ăn đa dạng khác nhau trong bữa cơm hằng ngày. Bắp cải trắng đặc biệt mang đến lợi ích trong việc hỗ trợ phòng chống ung thư, giúp cơ thể khỏe mạnh toàn diện.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(458, 'https://cdn.tgdd.vn/Products/Images/8785/288584/bhx/bap-cai-trang-500gr-1-bap-202311271055597112.jpg', '2 bắp cải trắng 500g - 600g/túi', 24000, 0, 24000, 'túi 500gr', '500g', 'Bắp cải trắng là loại rau được trồng tại Lâm Đồng rất dễ mua và chế biến thành nhiều món ăn đa dạng khác nhau trong bữa cơm hằng ngày. Bắp cải trắng đặc biệt mang đến lợi ích trong việc hỗ trợ phòng chống ung thư, giúp cơ thể khỏe mạnh toàn diện.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(459, 'https://cdn.tgdd.vn/Products/Images/8785/306739/bhx/dua-leo-giong-nhat-cap-2-trai-600g-202305110834435492_300x300.jpg', 'Dưa leo giống Nhật cặp 2 trái 500g', 15000, 0, 15000, 'cặp', '500g', 'Dưa leo gai tươi ngon, chất lượng, thanh mát, chứa nhiều dưỡng chất. Dưa leo gai là loại rau củ được nhiều người lựa chọn, có nguồn gốc xuất xứ từ Lâm Đồng. Dưa leo gai thường được dùng để ăn sống, làm kim chi, salad,...', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(460, 'https://cdn.tgdd.vn/Products/Images/8785/271475/bhx/ca-chua-bi-hop-300g-202212070837143287_300x300.jpg', 'Cà chua bi 300g', 20000, 0, 20000, 'hộp', '300g', 'Cà chua bi được trồng ở Lâm Đồng là loại thực phẩm dinh dưỡng, tốt cho sức khỏe được nhiều người chọn lựa. Cà chua bi to trái, căng mọng có thể dùng ăn chơi hoặc là nguyên liệu cho những món ăn ngon khác. Cà chua bi giúp đẹp da, sáng mắt là thực phẩm nên sử dụng thường xuyên.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(461, 'https://cdn.tgdd.vn/Products/Images/8785/271472/bhx/ca-chua-tui-1kg-10-12-trai-202209061036228305_300x300.jpg', 'Cà chua 1kg (10 - 12 trái)', 39000, 0, 39000, 'túi', '1kg', 'Cà chua được trồng ở Lâm Đồng là loại rau củ rất tốt cho sức khoẻ của người sử dụng, loại rau củ này không những giúp bổ sung chất dinh dưỡng cần thiết cho cơ thể mà chúng có giúp làm đẹp da cho phái nữ. Cà chua có thể ăn sống hoặc chế biến các món ăn cũng rất ngon.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(462, 'https://cdn.tgdd.vn/Products/Images/8785/271516/bhx/ca-chua-beef-khay-500g-2-4-trai-202209061555307497_300x300.jpg', 'Cà chua beef 500g (2-4 trái)', 25000, 0, 25000, 'túi', '500g', 'Cà chua là loại rau củ rất tốt cho sức khoẻ nhờ chứa nhiều dinh dưỡng đặc biệt là vitamin A, C, K ngoài ra loại quả này còn giúp làm đẹp da cho phái nữ rất tốt. Cà chua được trồng tại Lâm Đồng có thể ăn sống hoặc chế biến các món ăn cũng rất phù hợp.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(463, 'https://cdn.tgdd.vn/Products/Images/8785/316279/bhx/bong-cai-trang-700g-800g-202310170836137566_300x300.jpg', 'Bông cải trắng 700g - 800g', 58000, 0, 58000, 'túi', '700-800g', 'Bông cải trắng tại Bách hóa XANH đảm bảo các tiêu chuẩn xanh - sạch, nguồn gốc bông cải từ Đà Lạt, chất lượng và an toàn cho sức khỏe người dùng. Bông cải có vị giòn ngọt và chứa hàm lượng dinh dưỡng cao, thích hợp cho các món xào hoặc luộc.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(464, 'https://cdn.tgdd.vn/Products/Images/8785/304421/bhx/bong-cai-xanh-450g-600g-1-bong-202303170847081037_300x300.jpg', 'Bông cải xanh 450-600g (1 bông)', 33000, 0, 33000, 'túi', '450-600g', 'Bông cải xanh là một loại rau xanh quen thuộc và được rất nhiều người ưa chuộng. Bông cải xanh được trồng tại Trung Quốc không chỉ thơm ngon, dễ ăn mà còn mang lại rất nhiều lợi ích cho sức khoẻ. Bông cải xanh có thề chế biến thành bông cải xanh hấp, bông cải xanh xào hải sải, súp bông cải xanh,...', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(465, 'https://cdn.tgdd.vn/Products/Images/8785/316280/bhx/bong-cai-xanh-400g-500g-202310170840436827_300x300.jpg', 'Bông cải xanh 400g - 500g', 35000, 0, 35000, 'túi', '400-500g', 'Bông cải xanh tại Bách hóa XANH đảm bảo tươi sạch, chất lượng, đảm bảo nguồn gốc bông cải từ Đà Lạt, an toàn cho sức khỏe. Bông cải xanh không chỉ dễ ăn mà còn đem lại nhiều lợi ích sức khỏe, thường được dùng để hấp, xào hoặc làm súp,...', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(466, 'https://cdn.tgdd.vn/Products/Images/8785/271491/bhx/dau-cove-lam-dong-tui-500g-202209060838028496_300x300.jpg', 'Đậu cove Lâm Đồng 500g', 23000, 0, 23000, 'túi', '500g', 'Đậu cove được sản xuất tại Lâm Đồng và đóng gói theo tiêu chuẩn xanh - sạch, chất lượng và an toàn khi đến tay người dùng. Với vị mát, giòn và ngọt nên đậu cove đã trở thành một trong những món ăn ưa chuộng của bữa cơm Việt. Có thể dùng để luộc, xào cùng các loại thịt hoặc để nấu súp.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(467, 'https://cdn.tgdd.vn/Products/Images/8785/292789/bhx/ot-xiem-xanh-goi-50g-202212280843185476_300x300.jpg', 'Ớt xiêm xanh 50g', 6400, 0, 6400, 'túi', '50g', 'Ớt xiêm xanh là một trong những gia vị không thể thiếu trong căn bếp, giúp chế biến thành nhiều món ăn ngon có hương vị cay nồng, chất lượng. Ớt xiêm xanh có màu xanh tươi, trái nhỏ, nhưng rất thơm, cay cay rất bắt vị giác', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(468, 'https://cdn.tgdd.vn/Products/Images/8785/313979/bhx/2-trai-bau-sao-trai-500g-600g-202311271057524557.jpg', '2 trái bầu sao 500g - 600g/trái', 30000, 0, 30000, 'trái', '1-1.2kg', 'Bầu sao trái có hình dáng thon dài, bề mặt phẳng lì, ít lông tơ và vỏ màu xanh tươi. Bầu sao trái giàu dinh dưỡng, có thể chế biến thành các món ăn như luộc, xào, nấu canh đều rất ngon.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(469, 'https://cdn.tgdd.vn/Products/Images/8785/271515/bhx/dau-cove-nhat-tui-500g-202209060851410381_300x300.jpg', 'Đậu cove Nhật 500g', 28000, 0, 28000, 'túi', '500g', 'Đậu cove Nhật được nuôi trồng và đóng gói theo những tiêu chuẩn nghiêm ngặt, bảo đảm các tiêu chuẩn xanh - sạch, chất lượng và an toàn với người dùng. Vị giòn, ngọt và mát nên đậu que Nhật thường được dùng cho các món xào ăn kèm hoặc luộc. Hàm lượng dinh dưỡng trong đậu rất cao.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(470, 'https://cdn.tgdd.vn/Products/Images/8785/301657/bhx/ot-chuong-xanh-tui-tu-230g-1-2-trai-202301120931018053_300x300.jpg', 'Ớt chuông xanh 180g trở lên (1 - 2 trái)', 11000, 0, 11000, 'túi', '180g trở lên', 'Ớt chuông xanh trồng tại Lâm Đồng là thực phẩm giàu dinh dưỡng và có nhiều công dụng như tăng cường thị lực, tốt cho tim mạch, giúp ăn ngon, ngủ ngon. Ớt chuông xanh có thể sử dụng cho nhiều món ăn ngon như xào, salad, cari,...rất hấp dẫn', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(471, 'https://cdn.tgdd.vn/Products/Images/8785/301656/bhx/ot-chuong-do-tu-180g-1-2-trai-202308291307507805_300x300.jpg', 'Ớt chuông đỏ 180g trở lên (1 - 2 trái)', 19000, 0, 19000, 'túi', '180g trở lên', 'Ớt chuông đỏ trồng tại Lâm Đồng có kích thước to và căng mọng... Ớt chuông đỏ này không có vị cay gắt như các loại ớt thông thường khác mà có vị giòn nên thích hợp cho các món xào, ăn sống. Loại ớt này còn chứa nhiều khoáng chất và vitamin tốt cho cơ thể.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(472, 'https://cdn.tgdd.vn/Products/Images/8785/222783/bhx/mang-tay-lam-dong-bo-200g-202209060847394004_300x300.jpg', 'Măng tây Lâm Đồng 200g', 29000, 0, 29000, 'bó', '200g', 'Măng tây được nuôi trồng tại Lâm Đồng và đóng gói theo những tiêu chuẩn nghiêm ngặt, bảo đảm các tiêu chuẩn xanh - sạch, chất lượng và an toàn với người dùng. Măng giòn, ngọt, hàm lượng dinh dưỡng cao nên thường được chế biên bằng hấp, luộc hoặc nướng để có thể giữ được độ tươi ngon.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(473, 'https://cdn.tgdd.vn/Products/Images/8785/271467/bhx/bi-ngoi-xanh-tui-500g-1-2-trai-202211240953277291_300x300.jpg', 'Bí ngòi xanh 500g (1-2 trái)', 22000, 0, 22000, 'túi', '500g', 'Bí ngòi xanh được trồng Lâm Đồng có thể dùng để chế biến thành nhiều món ăn ngon cho gia đình như: nấu canh, xào, kho,... Đặc biệt, các thành phần dinh dưỡng có chứa trong loại bí này cũng đem đến rất nhiều tác dụng tích cực đối với sức khỏe con người như: chống lão hoá, giảm cân rất hiệu quả.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(474, 'https://cdn.tgdd.vn/Products/Images/8785/271468/bhx/ca-tim-tui-500g-2-3-trai-202211160817250411_300x300.jpg', 'Cà tím 500g (2 - 3 trái)', 12000, 0, 12000, 'túi', '500g', 'Cà tím được trồng tại Đà Lạt hay còn được gọi là cà dái dê, đây là một loại rau củ chế biến được thành rất nhiều món ăn thơm ngon như: hấp, xào, nướng, ăn sống,... mỗi dạng đều mang lại hương vị rất ngon. Trong cà tím chứa hàm lượng chất xơ vô cùng cao và giàu sắt rất tốt cho cơ thể.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(475, 'https://cdn.tgdd.vn/Products/Images/8785/271511/bhx/su-hao-xanh-tui-500g-2-3-cu-202209060836432842_300x300.jpg', 'Su hào xanh 500g (2 - 3 củ)', 16000, 0, 16000, 'túi', '500g', 'Su hào được trồng tại Lâm Đồng là một loại củ rất quen thuộc, được nhiều bà nội trợ chọn để chế biến thành các món ăn ngon cho gia đình. Su hào rất giàu Vitamin, chất xơ, giúp chống oxy hóa mạnh, răng và nướu khỏe mạnh. Su hào có thể chế biến thành các món ăn ngon.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(476, 'https://cdn.tgdd.vn/Products/Images/8785/315506/bhx/cu-cai-do-500g-202310101026075586_300x300.jpg', 'Củ cải đỏ 500g', 33000, 0, 33000, 'túi', '500g', 'Củ cải đỏ xuất xứ Đà Lạt, có vị ngọt mát, thanh đạm, có lớp vỏ ngoài mỏng, màu đỏ hồng. Bên trong có phần thịt giòn xốp màu trắng trong và củ có dạng tròn. Củ cải đỏ là loại củ chứa nhiều chất dinh dưỡng, vitamin rất tốt cho cơ thể, giúp giảm cân hiệu quả, lành mạnh.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(477, 'https://cdn.tgdd.vn/Products/Images/8785/271476/bhx/cu-san-tui-1kg-3-5-cu-202209060829526388_300x300.jpg', 'Củ sắn 1kg (3 - 5 củ)', 21000, 0, 21000, 'túi', '1kg', 'Củ sắn hay củ đậu là một loại củ khá ngọt, nhiều nước và rất giòn, chứa nhiều khoáng chất như: sắt, photpho, canxi và các vitamin A, C, B…. Thông thường người ta sẽ dùng củ sắn để ăn sống hoặc chế biến thành nhiều món ăn như: xào, luộc hay nấu canh,...', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(478, 'https://cdn.tgdd.vn/Products/Images/8785/301611/bhx/ca-phao-vi-200g-202301110816250574_300x300.jpg', 'Cà pháo 200g', 8000, 0, 8000, 'vỉ', '200g', 'Cà pháo là món ăn truyền thống trong mỗi mâm cơm gia đình Việt Nam từ thời xa xư. Loại quả này không những ngon, mà còn có thể làm thành thuốc giúp nhuận tràng, lợi tiểu, trị thũng thấp độc, trừ hòn cục trong bụng, ho lao... Cà pháo được chế biến nhiều nhất là món cà pháo muối, chấm mắm tôm.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(479, 'https://cdn.tgdd.vn/Products/Images/8785/274194/bhx/nha-dam-tui-500g-1-2-be-202211241004324028_300x300.jpg', 'Nha đam 450g - 550g (1 - 2 bẹ)', 8500, 0, 8500, 'túi 500gr', '450- 550g', 'Nha đam được trồng và đóng gói theo những tiêu chuẩn nghiêm ngặt, bảo đảm các tiêu chuẩn xanh - sạch, chất lượng và an toàn với người dùng. Nha đam giòn, dai, thanh mát chứa nhiều chất dinh dưỡng, hỗ trợ làm đẹp thường được dùng để nấu các loại nước mát.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(480, 'https://cdn.tgdd.vn/Products/Images/8785/281523/bhx/tac-trai-tui-200g-202208150853565752_300x300.jpg', 'Tắc trái 200g (20 - 21 trái)', 8500, 0, 8500, 'túi', '200g', 'Tắc trái của Bách Hóa Xanh tươi ngon, mọng nước và to trái. Tắc được bảo đảm các chỉ tiêu về an toàn và chất lượng. Hương tắc thơm, vị chua dịu, không quá gắt kích thích vị giác của người dùng thường được dùng ăn kèm với các món bún, pha nước tắc.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(481, 'https://cdn.tgdd.vn/Products/Images/8785/271480/bhx/toi-tim-trung-quoc-tui-300g-7-9-cu-202211240922340351_300x300.jpg', 'Tỏi tím Trung Quốc 300g (7-9 củ)', 23000, 0, 23000, 'túi', '300g', 'Tỏi tím Trung Quốc là một loại gia vị mà nhà nhà đều phải có trong gian bếp của mình. Chúng giúp tạo ra một món ăn ngon hơn, thơm hơn, kích thích vị giác,... Các thành phần trong tỏi không những cung cấp dưỡng chất rất tốt cho cơ thể mà còn có thể giúp hỗ trợ phòng ngừa một số bệnh khác.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(482, 'https://cdn.tgdd.vn/Products/Images/8785/271536/bhx/toi-co-don-tui-300g-202211240919500394_300x300.jpg', 'Tỏi cô đơn 300g', 40000, 0, 40000, 'túi', '300g', 'Tỏi cô đơn là một gia vị không thể thiếu trong gian bếp của mỗi gia đình. Tỏi cô đơn được trồng tại Trung Quốc, theo quy trình công nghệ nghiêm ngặt, bảo đảm các chỉ tiêu về an toàn và chất lượng. Tỏi có hàm lượng dinh dưỡng cao, tăng cường sức miễn dịch cho người sử dụng.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(483, 'https://cdn.tgdd.vn/Products/Images/8785/303376/bhx/cu-rieng-100g-202310061004438494_300x300.jpg', 'Củ riềng 100g', 6500, 0, 6500, 'gói', '100g', 'Củ riềng gói 100g sạch, tươi, ngon và tốt cho sức khỏe. Là loại củ quả thơm ngon, giúp các món ăn thêm bắt vị, kích thích vị giác tốt, còn chứa nhiều dưỡng chất thiết yếu cần thiết cho cơ thể.', '2023-11-30 10:22:58', NULL, 0, NULL, 12, 1),
(484, 'https://cdn.tgdd.vn/Products/Images/8779/319278/bhx/lau-nam-thien-nhien-300g-hat-nem-cao-cap-vi-nam-huong-maggi-goi-55g-202311210942236258_300x300.jpg', 'Lẩu nấm thiên nhiên 300g & Hạt nêm nấm hương Maggi gói 55g', 39300, 5, 37470, 'gói', '', 'Xem thêm', '2023-11-30 10:22:58', NULL, 0, NULL, 13, 1),
(485, 'https://cdn.tgdd.vn/Products/Images/8779/301609/bhx/nam-moi-den-150g-202309120933571261_300x300.jpg', 'Nấm mối đen 150g', 70000, 0, 70000, 'hộp', '150g', 'Nấm mối đen tươi ngon, dinh dưỡng, được nhiều người lựa chọn cho bữa ăn hằng ngày. Nấm mối đen là loại nấm có vị ngọt thanh, đầu nấm có màu đen như tên gọi, khi ăn rất ngon, có thể chế biến được nhiều món ngon.', '2023-11-30 10:22:58', NULL, 0, NULL, 13, 1),
(486, 'https://cdn.tgdd.vn/Products/Images/8779/233786/bhx/nam-mo-nau-hop-150g-202205210949361158_300x300.jpg', 'Nấm mỡ nâu 150g', 55000, 5, 52250, 'hộp', '150g', 'Nấm mỡ nâu được nuôi trồng tại Lâm Đồng và đóng gói theo những tiêu chuẩn nghiêm ngặt, bảo đảm các tiêu chuẩn xanh - sạch, chất lượng và an toàn với người dùng. Chứa hàm lượng dinh dưỡng dồi dào, vị nấm ngọt dịu, thịt nấm giòn chắc thích hợp để nấu lẩu, xào cùng rau củ hoặc nấu các loại súp.', '2023-11-30 10:22:58', NULL, 0, NULL, 13, 1),
(487, 'https://cdn.tgdd.vn/Products/Images/8779/301605/bhx/nam-dong-trung-ha-thao-hop-150g-202301110829199066_300x300.jpg', 'Nấm đông trùng hạ thảo 150g', 55000, 5, 52250, 'hộp', '150g', 'Nấm đông trùng hạ thảo là một loại nấm quý, có giá trị dinh dưỡng cao, được nhiều người lựa chọn bồi bổ sức khỏe. Nấm đông trùng hạ thảo có nhiều công dụng, nguồn gốc rõ ràng.', '2023-11-30 10:22:58', NULL, 0, NULL, 13, 1),
(488, 'https://cdn.tgdd.vn/Products/Images/8779/233788/bhx/nam-mo-trang-hop-150g-202205210951225917_300x300.jpg', 'Nấm mỡ trắng 150g', 48000, 0, 48000, 'hộp', '150g', 'Nấm mỡ trắng được nuôi trồng và đóng gói theo những tiêu chuẩn nghiêm ngặt, bảo đảm các tiêu chuẩn xanh - sạch, chất lượng và an toàn với người dùng. Nấm mỡ chứa hàm lượng chất dinh dưỡng cao, nhiều vitamin và protein quan trọng nên thường được chế biến bằng cách xào hoặc nướng.', '2023-11-30 10:22:58', NULL, 0, NULL, 13, 1),
(489, 'https://cdn.tgdd.vn/Products/Images/3235/316646/bhx/2-goi-nam-tuyet-vietfresh-50g-202310031449445288_300x300.jpg', '2 gói nấm tuyết Vietfresh 50g', 60000, 30, 42000, 'gói', '', 'Nấm khô Vietfresh là một trong những loại nấm khô thơm ngon, hấp dẫn và vô cùng thanh mát cho cơ thể. 2 gói nấm tuyết Vietfresh 50g được sấy khô, chỉ cần ngâm nước cho nấm nở là có thể sử dụng. Nấm tuyết dùng cho nấu chè ngon, các món nộm, gỏi, xào đều hấp dẫn', '2023-11-30 10:22:58', NULL, 0, NULL, 13, 1),
(490, 'https://cdn.tgdd.vn/Products/Images/3235/316632/bhx/2-goi-nam-meo-den-thai-soi-50g-202310031352188941_300x300.jpg', '2 gói nấm mèo đen thái sợi 50g ', 32000, 30, 22400, 'gói', '', 'Nấm mèo tiện lợi, dinh dưỡng. Chỉ cần ngâm nước và rửa sạch và có thể đem đi chế biến là có thể đem đi nấu nướng. 2 gói nấm mèo đen thái sợi Naita 50g tiện lợi, nhìn gói nhỏ nhưng ngâm ra rất nhiều. Nấm khô từ thương hiệu nấm khô Naita chất lượng, tiện lợi và dễ bảo quản', '2023-11-30 10:22:58', NULL, 0, NULL, 13, 1),
(491, 'https://cdn.tgdd.vn/Products/Images/3235/316621/bhx/nam-meo-den-kho-goi-50g-clone-202310031055591302_300x300.jpg', '2 gói nấm mèo đen khô 50g ', 29200, 30, 20400, 'gói', '', 'Nấm mèo tiện lợi, dinh dưỡng. Chỉ cần ngâm nước và rửa sạch và có thể đem đi chế biến là có thể đem đi nấu nướng. 2 gói nấm mèo đen 50g tiện lợi, nhìn gói nhỏ nhưng ngâm ra rất nhiều. Nấm khô chất lượng, tiện lợi và dễ bảo quản', '2023-11-30 10:22:58', NULL, 0, NULL, 13, 1),
(492, 'https://cdn.tgdd.vn/Products/Images/3235/198143/bhx/nam-meo-den-viet-san-goi-100g-202205231511231907_300x300.jpg', 'Nấm mèo đen Việt San gói 100g', 26000, 20, 20900, 'gói', '100g', 'Được làm từ 100% nấm mèo phơi khô, tiện lợi, dễ chế biến, chỉ cần ngâm, rửa sạch là có thể đem đi nấu những món ăn ngon. Nấm mèo đen Việt San gói 100g ngâm ra sẽ nở ra rất nhiều. Đồ khô Việt San tiện lợi, an toàn và chất lượng', '2023-11-30 10:22:58', NULL, 0, NULL, 13, 1),
(493, 'https://cdn.tgdd.vn/Products/Images/3235/197209/bhx/nam-huong-kho-viet-san-goi-80g-202205241035553179_300x300.jpg', 'Nấm hương khô Việt San gói 80g', 49000, 0, 49000, 'gói', '80g', 'Được làm từ 100% nấm khô hương sấy khô, tiện lợi, dễ chế biến, chỉ cần ngâm, rửa sạch là có thể đem đi nấu những món ăn ngon. Nấm hương sấy khô Việt San 80g ngâm ra sẽ nở ra rất nhiều. Đồ khô Việt San tiện lợi, an toàn và chất lượng', '2023-11-30 10:22:58', NULL, 0, NULL, 13, 1),
(494, 'https://cdn.tgdd.vn/Products/Images/3235/286690/bhx/nam-huong-kho-ly-tuong-goi-50g-202208170900473652_300x300.jpg', 'Nấm hương khô Lý Tưởng gói 50g', 33000, 0, 33000, 'gói', '50g', 'Nấm Lý Tưởng là thương hiệu nấm chất lượng, uy tín, được nhiều người lựa chọn. Nấm hương khô Việt Nam Lý Tưởng gói 50g chất lượng, được thu hoạch từ những cây nấm tươi và được sấy khô nguyên cây.', '2023-11-30 10:22:58', NULL, 0, NULL, 13, 1),
(495, 'https://cdn.tgdd.vn/Products/Images/3235/245243/bhx/nam-huong-kho-nguyen-bao-goi-50g-202205241056495293_300x300.jpg', 'Nấm hương khô Nguyên Bảo gói 50g', 32000, 0, 32000, 'gói', '50g', 'Với 100% nấm khô có hạt chất lượng cao, tiện lợi cho các món hầm, tiềm hoặc các món ăn khác. Nấm hương khô Nguyên Bảo gói 50g tiện lợi, dinh dưỡng và an toàn. Chỉ cần ngâm nấm khô Nguyên Bảo, đem đi rửa sạch là có thể chế biến được rồi', '2023-11-30 10:22:58', NULL, 0, NULL, 13, 1),
(496, 'https://cdn.tgdd.vn/Products/Images/3235/252985/bhx/nam-tuyet-vietfresh-goi-50g-202205241114024053_300x300.jpg', 'Nấm tuyết Vietfresh gói 50g', 30000, 0, 30000, 'gói', '50g', 'Nấm khô Vietfresh là một trong những loại nấm khô thơm ngon, hấp dẫn và vô cùng thanh mát cho cơ thể. Nấm tuyết Vietfresh gói 50g được sấy khô, chỉ cần ngâm nước cho nấm nở là có thể sử dụng. Nấm tuyết dùng cho nấu chè ngon, các món nộm, gỏi, xào đều hấp dẫn', '2023-11-30 10:22:58', NULL, 0, NULL, 13, 1),
(497, 'https://cdn.tgdd.vn/Products/Images/3235/233827/bhx/nam-dong-co-kho-goi-50g-202205231524360621_300x300.jpg', 'Nấm đông cô gói 50g', 29000, 0, 29000, 'gói', '50g', 'Nấm khô được làm từ nấm đông cô và được lựa chọn từ những nấm chất lượng, thơm ngon đem phơi khô và đóng gói sạch sẽ. Nấm đông cô khô gói 50g chỉ cần ngâm nước là nở ra rất nhiều để sử dụng. Nấm khô chất lượng, vệ sinh và an toàn được người dùng tin chọn.', '2023-11-30 10:22:58', NULL, 0, NULL, 13, 1),
