(499, 'https://cdn.tgdd.vn/Products/Images/3235/200371/bhx/nam-meo-den-kho-goi-50g-202205231523347877_300x300.jpg', 'Nấm mèo đen khô gói 50g', 14600, 0, 14600, 'gói', '50g', 'Nấm mèo tiện lợi, dinh dưỡng. Chỉ cần ngâm nước và rửa sạch và có thể đem đi chế biến là có thể đem đi nấu nướng. Nấm mèo đen gói 50g tiện lợi, nhìn gói nhỏ nhưng ngâm ra rất nhiều. Nấm khô chất lượng, tiện lợi và dễ bảo quản', '2023-11-30 10:22:58', NULL, 0, NULL, 13, 1),
(500, 'https://cdn.tgdd.vn/Products/Images/8779/281521/bhx/nam-huong-hop-150g-202212291514540187_300x300.jpg', 'Nấm hương 150g', 33000, 0, 33000, 'hộp', '150g', 'Với 100% nấm hương có hạt chất lượng cao, tiện lợi cho các món hầm, tiềm hoặc các món ăn khác. Nấm hương tươi tiện lợi, dinh dưỡng và an toàn. Chỉ cần đem đi rửa sạch là có thể chế biến được nhiều món ăn ngon bổ dưỡng', '2023-11-30 10:22:59', NULL, 0, NULL, 13, 1),
(501, 'https://cdn.tgdd.vn/Products/Images/8779/234856/bhx/nam-linh-chi-nau-150g-202306170846456300_300x300.jpg', 'Nấm linh chi nâu 150g', 33000, 0, 33000, 'gói', '150g', 'Nấm linh chi màu nâu được nuôi trồng và đóng gói theo những tiêu chuẩn nghiêm ngặt, bảo đảm các tiêu chuẩn xanh - sạch, chất lượng và an toàn với người dùng. Vị nấm giòn dai và ngọt, chứa hàm lượng dinh dưỡng cao rất thích hợp cho các món nhúng lẩu, xào với rau củ hoặc nấu súp.', '2023-11-30 10:22:59', NULL, 0, NULL, 13, 1),
(502, 'https://cdn.tgdd.vn/Products/Images/8779/304604/bhx/3-goi-nam-kim-cham-thai-lan-150gr-202308301324007332_300x300.jpg', '3 gói nấm kim châm Thái Lan 150g', 33000, 41, 19500, 'gói', '150g', 'Nấm kim châm Thái Lan tươi ngon, được đóng gói cẩn thận, chất lượng và an toàn với người dùng. Sợi nấm dai, giòn và ngọt, khi nấu chín rất thơm nên thường được lăn bột chiên giòn, nấu súp hoặc để nướng ăn kèm.', '2023-11-30 10:22:59', NULL, 0, NULL, 13, 1),
(503, 'https://cdn.tgdd.vn/Products/Images/8779/228921/bhx/nam-dui-ga-200g-202308291336593557_300x300.jpg', 'Nấm đùi gà 200g', 30000, 0, 30000, 'vỉ', '200g', 'Nấm được nuôi trồng và đóng gói theo những tiêu chuẩn nghiêm ngặt, bảo đảm các tiêu chuẩn xanh - sạch, chất lượng và an toàn với người dùng. Nấm đùi gà giòn dai, ngọt thịt, nhiều dinh dưỡng thường được dùng cho các món xào, chiên giòn hoặc nướng ăn kèm với các loại xốt chấm.', '2023-11-30 10:22:59', NULL, 0, NULL, 13, 1),
(504, 'https://cdn.tgdd.vn/Products/Images/8779/301601/bhx/nam-dui-ga-baby-200g-202308291340481858_300x300.jpg', 'Nấm đùi gà baby 200g', 30000, 0, 30000, 'vỉ', '200g', 'Nấm được nuôi trồng và đóng gói theo những tiêu chuẩn nghiêm ngặt, bảo đảm các tiêu chuẩn xanh - sạch, chất lượng và an toàn với người dùng. Nấm đùi gà baby giòn dai, ngọt thịt, nhiều dinh dưỡng thường được dùng cho các món xào, chiên giòn hoặc nướng ăn kèm với các loại xốt chấm.', '2023-11-30 10:22:59', NULL, 0, NULL, 13, 1),
(505, 'https://cdn.tgdd.vn/Products/Images/8779/226955/bhx/nam-bao-ngu-trang-300g-202307180943222257_300x300.jpg', 'Nấm bào ngư trắng 300g', 20000, 0, 20000, 'bịch', '300g', 'Nấm bào ngư trắng gói 300g là một lọai nấm thơm ngon, dễ ăn, được rất nhiều người ưa chuộng. Nấm bào ngư trắng là một nguyên liệu quen thuộc cho các bữa cơm trong gia đình với nhiều món ăn ngon như nấm bào ngư xào sả ớt, nấm bào ngư xào thịt,...', '2023-11-30 10:22:59', NULL, 0, NULL, 13, 1);
